ero results may be returned.\";'),('en','messages:api-help-param-multi-all','s:44:\"en:To specify all values, use <kbd>$1</kbd>.\";'),('en','messages:api-help-param-multi-separate','s:92:\"en:Separate values with <kbd>|</kbd> or [[Special:ApiHelp/main#main/datatypes|alternative]].\";'),('en','messages:api-help-param-no-description','s:54:\"en:<span class=\"apihelp-empty\">(no description)</span>\";'),('en','messages:api-help-param-templated','s:108:\"en:This is a [[Special:ApiHelp/main#main/templatedparams|templated parameter]]. When making the request, $2.\";'),('en','messages:api-help-param-templated-var','s:57:\"en:<var>&#x7B;$1&#x7D;</var> with values of <var>$2</var>\";'),('en','messages:api-help-param-templated-var-first','s:100:\"en:<var>&#x7B;$1&#x7D;</var> in the parameter\'s name should be replaced with values of <var>$2</var>\";'),('en','messages:api-help-param-token','s:88:\"en:A \"$1\" token retrieved from [[Special:ApiHelp/query+tokens|action=query&meta=tokens]]\";'),('en','messages:api-help-param-token-webui','s:68:\"en:For compatibility, the token used in the web UI is also accepted.\";'),('en','messages:api-help-param-type-enum','s:147:\"en:{{PLURAL:$1|1=One of the following values|2=Values (separate with <kbd>{{!}}</kbd> or [[Special:ApiHelp/main#main/datatypes|alternative]])}}: $2\";'),('en','messages:api-help-param-type-expiry','s:106:\"en:Type: {{PLURAL:$1|1=expiry|2=list of expiries}} ([[Special:ApiHelp/main#main/datatype/expiry|details]])\";'),('en','messages:api-help-param-type-limit','s:34:\"en:Type: integer or <kbd>max</kbd>\";'),('en','messages:api-help-param-type-presenceboolean','s:73:\"en:Type: boolean ([[Special:ApiHelp/main#main/datatype/boolean|details]])\";'),('en','messages:api-help-param-type-timestamp','s:122:\"en:Type: {{PLURAL:$1|1=timestamp|2=list of timestamps}} ([[Special:ApiHelp/main#main/datatype/timestamp|allowed formats]])\";'),('en','messages:api-help-parameters','s:56:\"en:{{PLURAL:$1|Specific parameter|Specific parameters}}:\";'),('en','messages:api-help-parameters-note','s:42:\"en:Other general parameters are available.\";'),('en','messages:api-help-paramvalue-direction-newer','s:59:\"en:List oldest first. Note: $1start has to be before $1end.\";'),('en','messages:api-help-paramvalue-direction-older','s:73:\"en:List newest first (default). Note: $1start has to be later than $1end.\";'),('en','messages:api-help-permissions','s:40:\"en:{{PLURAL:$1|Permission|Permissions}}:\";'),('en','messages:api-help-permissions-granted-to','s:31:\"en:{{PLURAL:$1|Granted to}}: $2\";'),('en','messages:api-help-right-apihighlimits','s:138:\"en:Use higher limits in API queries (slow queries: $1; fast queries: $2). The limits for slow queries also apply to multivalue parameters.\";'),('en','messages:api-help-source','s:13:\"en:Source: $1\";'),('en','messages:api-help-source-unknown','s:55:\"en:Source: <span class=\"apihelp-unknown\">unknown</span>\";'),('en','messages:api-help-templatedparams','s:563:\"en:Templated parameters support cases where an API module needs a value for each value of some other parameter. For example, if there were an API module to request fruit, it might have a parameter <var>fruits</var> to specify which fruits are being requested and a templated parameter <var>{fruit}-quantity</var> to specify how many of each fruit to request. An API client that wants 1 apple, 5 bananas, and 20 strawberries could then make a request like <kbd>fruits=apples|bananas|strawberries&apples-quantity=1&bananas-quantity=5&strawberries-quantity=20</kbd>.\";'),('en','messages:api-help-templatedparams-header','s:23:\"en:Templated parameters\";'),('en','messages:api-help-title','s:21:\"en:MediaWiki API help\";'),('en','messages:api-help-undocumented-module','s:34:\"en:No documentation for module $1.\";'),('en','messages:api-login-fail-aborted','s:280:\"en:Authentication requires user interaction, which is not supported by <kbd>action=login</kbd>. To be able to login with <kbd>action=login</kbd>, see 