 If set to <kbd>infinite</kbd>, <kbd>indefinite</kbd>, or <kbd>never</kbd>, the block will never expire.\";'),('en','messages:apihelp-block-param-hidename','s:84:\"en:Hide the username from the block log. (Requires the <code>hideuser</code> right).\";'),('en','messages:apihelp-block-param-id','s:26:\"en:The block ID to modify.\";'),('en','messages:apihelp-block-param-namespacerestrictions','s:109:\"en:List of namespace IDs to block the user from editing. Only applies when <var>partial</var> is set to true.\";'),('en','messages:apihelp-block-param-newblock','s:57:\"en:Add another block even if the user is already blocked.\";'),('en','messages:apihelp-block-param-nocreate','s:28:\"en:Prevent account creation.\";'),('en','messages:apihelp-block-param-noemail','s:98:\"en:Prevent user from sending email through the wiki. (Requires the <code>blockemail</code> right).\";'),('en','messages:apihelp-block-param-pagerestrictions','s:102:\"en:List of titles to block the user from editing. Only applies when <var>partial</var> is set to true.\";'),('en','messages:apihelp-block-param-partial','s:76:\"en:Block user from specific pages or namespaces rather than the entire site.\";'),('en','messages:apihelp-block-param-reason','s:20:\"en:Reason for block.\";'),('en','messages:apihelp-block-param-reblock','s:215:\"en:If the user is already blocked by a single block, overwrite the existing block. If the user is blocked more than once, this will failuse the <var>id</var> parameter instead to specify which block to overwrite.\";'),('en','messages:apihelp-block-param-tags','s:54:\"en:Change tags to apply to the entry in the block log.\";'),('en','messages:apihelp-block-param-user','s:17:\"en:User to block.\";'),('en','messages:apihelp-block-param-userid','s:52:\"en:Specify <kbd>$1user=#<var>ID</var></kbd> instead.\";'),('en','messages:apihelp-block-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-block-param-watchuser','s:56:\"en:Watch the user\'s or IP address\'s user and talk pages.\";'),('en','messages:apihelp-block-summary','s:16:\"en:Block a user.\";'),('en','messages:apihelp-browsebyproperty-summary','s:77:\"en:API module to retrieve information about a property or list of properties.\";'),('en','messages:apihelp-browsebysubject-summary','s:54:\"en:API module to retrieve information about a subject.\";'),('en','messages:apihelp-changeauthenticationdata-example-password','s:79:\"en:Attempt to change the current user\'s password to <kbd>ExamplePassword</kbd>.\";'),('en','messages:apihelp-changeauthenticationdata-summary','s:51:\"en:Change authentication data for the current user.\";'),('en','messages:apihelp-changecontentmodel-example','s:67:\"en:Change the main page to have the <code>text</code> content model\";'),('en','messages:apihelp-changecontentmodel-param-bot','s:49:\"en:Mark the content model change with a bot flag.\";'),('en','messages:apihelp-changecontentmodel-param-model','s:36:\"en:Content model of the new content.\";'),('en','messages:apihelp-changecontentmodel-param-pageid','s:102:\"en:Page ID of the page to change the contentmodel of. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-changecontentmodel-param-summary','s:36:\"en:Edit summary and log entry reason\";'),('en','messages:apihelp-changecontentmodel-param-tags','s:50:\"en:Change tags to apply to the log entry and edit.\";'),('en','messages:apihelp-changecontentmodel-param-title','s:101:\"en:Title of the page to change the contentmodel of. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-changecontentmodel-summary','s:37:\"en:Change the content model of a page\";'),('en','messages:apihelp-checktoken-example-simple','s:48:\"en:Test the validity of a <kbd>csrf</kbd> token.\";'),('en','messages:apihelp-checktoken-param-maxtokenage','s:48:\"en:Maximum allowed age of the token, in seconds.\";'),('en','messages:apihelp-checktoken-param-token','s:17:\"en:Token to test.\";'),('en','messages:apihelp-checktoken-param-type','s:30:\"en:Type of token being tested.\";'),('en','messages:apihelp-checktoken-summary','s:107:\"en:Check the validity of a token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\";'),('en','messages:apihelp-clearhasmsg-example-1','s:59:\"en:Clear the <code>hasmsg</code> flag for the current user.\";'),('en','messages:apihelp-clearhasmsg-summary','s:60:\"en:Clears the <code>hasmsg</code> flag for the current user.\";'),('en','messages:apihelp-clientlogin-example-login','s:115:\"en:Start the process of logging in to the wiki as user <kbd>Example</kbd> with password <kbd>ExamplePassword</kbd>.\";'),('en','messages:apihelp-clientlogin-example-login2','s:132:\"en:Continue logging in after a <samp>UI</samp> response for two-factor auth, supplying an <var>OATHToken</var> of <kbd>987654</kbd>.\";'),('en','messages:apihelp-clientlogin-summary','s:49:\"en:Log in to the wiki using the interactive flow.\";'),('en','messages:apihelp-compare-example-1','s:42:\"en:Create a diff between revision 1 and 2.\";'),('en','messages:apihelp-compare-extended-description','s:117:\"en:A revision number, a page title, a page ID, text, or a relative reference for both \"from\" and \"to\" must be passed.\";'),('en','messages:apihelp-compare-param-difftype','s:50:\"en:Return the comparison formatted as inline HTML.\";'),('en','messages:apihelp-compare-param-fromcontentformat','s:87:\"en:Specify <kbd>fromslots=main</kbd> and use <var>fromcontentformat-main</var> instead.\";'),('en','messages:apihelp-compare-param-fromcontentformat-{slot}','s:67:\"en:Content serialization format of <var>fromtext-&#x7B;slot}</var>.\";'),('en','messages:apihelp-compare-param-fromcontentmodel','s:86:\"en:Specify <kbd>fromslots=main</kbd> and use <var>fromcontentmodel-main</var> instead.\";'),('en','messages:apihelp-compare-param-fromcontentmodel-{slot}','s:119:\"en:Content model of <var>fromtext-&#x7B;slot}</var>. If not supplied, it will be guessed based on the other parameters.\";'),('en','messages:apihelp-compare-param-fromid','s:28:\"en:First page ID to compare.\";'),('en','messages:apihelp-compare-param-frompst','s:62:\"en:Do a pre-save transform on <var>fromtext-&#x7B;slot}</var>.\";'),('en','messages:apihelp-compare-param-fromrev','s:29:\"en:First revision to compare.\";'),('en','messages:apihelp-compare-param-fromsection','s:66:\"en:Only use the specified section of the specified \'from\' content.\";'),('en','messages:apihelp-compare-param-fromsection-{slot}','s:244:\"en:When <var>fromtext-&#x7B;slot}</var> is the content of a single section, this is the section identifier. It will be merged into the revision specified by <var>fromtitle</var>, <var>fromid</var> or <var>fromrev</var> as if for a section edit.\";'),('en','messages:apihelp-compare-param-fromslots','s:329:\"en:Override content of the revision specified by <var>fromtitle</var>, <var>fromid</var> or <var>fromrev</var>.\n\nThis parameter specifies the slots that are to be modified. Use <var>fromtext-&#x7B;slot}</var>, <var>fromcontentmodel-&#x7B;slot}</var>, and <var>fromcontentformat-&#x7B;slot}</var> to specify content for each slot.\";'),('en','messages:apihelp-compare-param-fromtext','s:78:\"en:Specify <kbd>fromslots=main</kbd> and use <var>fromtext-main</var> instead.\";'),('en','messages:apihelp-compare-param-fromtext-{slot}','s:81:\"en:Text of the specified slot. If omitted, the slot is removed from the revision.\";'),('en','messages:apihelp-compare-param-fromtitle','s:26:\"en:First title to compare.\";'),('en','messages:apihelp-compare-param-prop','s:38:\"en:Which pieces of information to get.\";'),('en','messages:apihelp-compare-param-slots','s:88:\"en:Return individual diffs for these slots, rather than one combined diff for all slots.\";'),('en','messages:apihelp-compare-param-tocontentformat','s:83:\"en:Specify <kbd>toslots=main</kbd> and use <var>tocontentformat-main</var> instead.\";'),('en','messages:apihelp-compare-param-tocontentformat-{slot}','s:65:\"en:Content serialization format of <var>totext-&#x7B;slot}</var>.\";'),('en','messages:apihelp-compare-param-tocontentmodel','s:82:\"en:Specify <kbd>toslots=main</kbd> and use <var>tocontentmodel-main</var> instead.\";'),('en','messages:apihelp-compare-param-tocontentmodel-{slot}','s:117:\"en:Content model of <var>totext-&#x7B;slot}</var>. If not supplied, it will be guessed based on the other parameters.\";'),('en','messages:apihelp-compare-param-toid','s:29:\"en:Second page ID to compare.\";'),('en','messages:apihelp-compare-param-topst','s:48:\"en:Do a pre-save transform on <var>totext</var>.\";'),('en','messages:apihelp-compare-param-torelative','s:168:\"en:Use a revision relative to the revision determined from <var>fromtitle</var>, <var>fromid</var> or <var>fromrev</var>. All of the other \'to\' options will be ignored.\";'),('en','messages:apihelp-compare-param-torev','s:30:\"en:Second revision to compare.\";'),('en','messages:apihelp-compare-param-tosection','s:64:\"en:Only use the specified section of the specified \'to\' content.\";'),('en','messages:apihelp-compare-param-tosection-{slot}','s:236:\"en:When <var>totext-&#x7B;slot}</var> is the content of a single section, this is the section identifier. It will be merged into the revision specified by <var>totitle</var>, <var>toid</var> or <var>torev</var> as if for a section edit.\";'),('en','messages:apihelp-compare-param-toslots','s:317:\"en:Override content of the revision specified by <var>totitle</var>, <var>toid</var> or <var>torev</var>.\n\nThis parameter specifies the slots that are to be modified. Use <var>totext-&#x7B;slot}</var>, <var>tocontentmodel-&#x7B;slot}</var>, and <var>tocontentformat-&#x7B;slot}</var> to specify content for each slot.\";'),('en','messages:apihelp-compare-param-totext','s:74:\"en:Specify <kbd>toslots=main</kbd> and use <var>totext-main</var> instead.\";'),('en','messages:apihelp-compare-param-totext-{slot}','s:81:\"en:Text of the specified slot. If omitted, the slot is removed from the revision.\";'),('en','messages:apihelp-compare-param-totitle','s:27:\"en:Second title to compare.\";'),('en','messages:apihelp-compare-paramvalue-prop-comment','s:182:\"en:The comment on the \'from\' and \'to\' revisions. If the comment has been revision deleted, a <samp>fromcommenthidden</samp> or <samp>tocommenthidden</samp> property will be returned.\";'),('en','messages:apihelp-compare-paramvalue-prop-diff','s:17:\"en:The diff HTML.\";'),('en','messages:apihelp-compare-paramvalue-prop-diffsize','s:39:\"en:The size of the diff HTML, in bytes.\";'),('en','messages:apihelp-compare-paramvalue-prop-ids','s:62:\"en:The page and revision IDs of the \'from\' and \'to\' revisions.\";'),('en','messages:apihelp-compare-paramvalue-prop-parsedcomment','s:189:\"en:The parsed comment on the \'from\' and \'to\' revisions. If the comment has been revision deleted, a <samp>fromcommenthidden</samp> or <samp>tocommenthidden</samp> property will be returned.\";'),('en','messages:apihelp-compare-paramvalue-prop-rel','s:78:\"en:The revision IDs of the revision previous to \'from\' and after \'to\', if any.\";'),('en','messages:apihelp-compare-paramvalue-prop-size','s:45:\"en:The size of the \'from\' and \'to\' revisions.\";'),('en','messages:apihelp-compare-paramvalue-prop-timestamp','s:50:\"en:The timestamp of the \'from\' and \'to\' revisions.\";'),('en','messages:apihelp-compare-paramvalue-prop-title','s:52:\"en:The page titles of the \'from\' and \'to\' revisions.\";'),('en','messages:apihelp-compare-paramvalue-prop-user','s:181:\"en:The username and ID of the \'from\' and \'to\' revisions. If the user has been revision deleted, a <samp>fromuserhidden</samp> or <samp>touserhidden</samp> property will be returned.\";'),('en','messages:apihelp-compare-summary','s:40:\"en:Get the difference between two pages.\";'),('en','messages:apihelp-createaccount-example-create','s:106:\"en:Start the process of creating the user <kbd>Example</kbd> with the password <kbd>ExamplePassword</kbd>.\";'),('en','messages:apihelp-createaccount-param-preservestate','s:352:\"en:If <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> returned true for <samp>hasprimarypreservedstate</samp>, requests marked as <samp>primary-required</samp> should be omitted. If it returned a non-empty value for <samp>preservedusername</samp>, that username must be used for the <var>username</var> parameter.\";'),('en','messages:apihelp-createaccount-summary','s:29:\"en:Create a new user account.\";'),('en','messages:apihelp-cspreport-param-reportonly','s:74:\"en:Mark as being a report from a monitoring policy, not an enforced policy\";'),('en','messages:apihelp-cspreport-param-source','s:59:\"en:What generated the CSP header that triggered this report\";'),('en','messages:apihelp-cspreport-summary','s:169:\"en:Used by browsers to report violations of the Content Security Policy. This module should never be used, except when used automatically by a CSP compliant web browser.\";'),('en','messages:apihelp-delete-example-reason','s:83:\"en:Delete [[{{MediaWiki:Mainpage}}]] with the reason <kbd>Preparing for move</kbd>.\";'),('en','messages:apihelp-delete-example-simple','s:37:\"en:Delete [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-delete-param-deletetalk','s:38:\"en:Delete the talk page, if it exists.\";'),('en','messages:apihelp-delete-param-oldimage','s:137:\"en:The name of the old image to delete as provided by [[Special:ApiHelp/query+imageinfo|action=query&prop=imageinfo&iiprop=archivename]].\";'),('en','messages:apihelp-delete-param-pageid','s:82:\"en:Page ID of the page to delete. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-delete-param-reason','s:87:\"en:Reason for the deletion. If not set, an automatically generated reason will be used.\";'),('en','messages:apihelp-delete-param-tags','s:57:\"en:Change tags to apply to the entry in the deletion log.\";'),('en','messages:apihelp-delete-param-title','s:81:\"en:Title of the page to delete. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-delete-param-unwatch','s:53:\"en:Remove the page from the current user\'s watchlist.\";'),('en','messages:apihelp-delete-param-watch','s:48:\"en:Add the page to the current user\'s watchlist.\";'),('en','messages:apihelp-delete-param-watchlist','s:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-delete-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-delete-summary','s:17:\"en:Delete a page.\";'),('en','messages:apihelp-disabled-summary','s:33:\"en:This module has been disabled.\";'),('en','messages:apihelp-discussiontoolscompare-summary','s:68:\"en:Get information about comment changes between two page revisions.\";'),('en','messages:apihelp-discussiontoolsedit-param-allownosectiontitle','s:47:\"en:Allow posting a new section without a title.\";'),('en','messages:apihelp-discussiontoolsedit-param-autosubscribe','s:60:\"en:Automatically subscribe the user to the talk page thread?\";'),('en','messages:apihelp-discussiontoolsedit-param-commentid','s:127:\"en:ID of the comment to reply to. Only used when <var>paction</var> is <var>addcomment</var>. Overrides <var>commentname</var>.\";'),('en','messages:apihelp-discussiontoolsedit-param-commentname','s:95:\"en:Name of the comment to reply to. Only used when <var>paction</var> is <var>addcomment</var>.\";'),('en','messages:apihelp-discussiontoolsedit-param-formtoken','s:75:\"en:An optional unique ID generated in the client to prevent double-posting.\";'),('en','messages:apihelp-discussiontoolsedit-param-html','s:78:\"en:Content to post, as HTML. Cannot be used together