rsed from the page\";'),('en','messages:apihelp-discussiontoolspageinfo-paramvalue-prop-transcludedfrom','s:56:\"en:Which other pages comments have been transcluded from\";'),('en','messages:apihelp-discussiontoolspageinfo-summary','s:64:\"en:Returns metadata required to initialize the discussion tools.\";'),('en','messages:apihelp-discussiontoolspreview-param-type','s:29:\"en:Type of message to preview\";'),('en','messages:apihelp-discussiontoolspreview-param-wikitext','s:35:\"en:Content to preview, as wikitext.\";'),('en','messages:apihelp-discussiontoolspreview-summary','s:42:\"en:Preview a message on a discussion page.\";'),('en','messages:apihelp-discussiontoolssubscribe-param-commentname','s:58:\"en:Name of the topic to subscribe to (or unsubscribe from)\";'),('en','messages:apihelp-discussiontoolssubscribe-param-page','s:36:\"en:A page on which the topic appears\";'),('en','messages:apihelp-discussiontoolssubscribe-param-subscribe','s:42:\"en:True to subscribe, false to unsubscribe\";'),('en','messages:apihelp-discussiontoolssubscribe-summary','s:69:\"en:Subscribe (or unsubscribe) to receive notifications about a topic.\";'),('en','messages:apihelp-discussiontoolsthank-param-commentid','s:30:\"en:ID of the comment to thank.\";'),('en','messages:apihelp-discussiontoolsthank-summary','s:54:\"en:Send a public thank-you notification for a comment.\";'),('en','messages:apihelp-echoarticlereminder-example-1','s:68:\"en:Create an article reminder notification for tomorrow with comment\";'),('en','messages:apihelp-echoarticlereminder-example-2','s:71:\"en:Create an article reminder notification for tomorrow without comment\";'),('en','messages:apihelp-echoarticlereminder-param-comment','s:51:\"en:Optional user comment to include in the reminder\";'),('en','messages:apihelp-echoarticlereminder-param-pageid','s:41:\"en:ID of article to remind the user about\";'),('en','messages:apihelp-echoarticlereminder-param-timestamp','s:40:\"en:On which timestamp to remind the user\";'),('en','messages:apihelp-echoarticlereminder-param-title','s:44:\"en:Title of article to remind the user about\";'),('en','messages:apihelp-echoarticlereminder-summary','s:56:\"en:Request a future reminder about the specified article\";'),('en','messages:apihelp-echocreateevent-description','s:44:\"en:Manually trigger a notification to a user\";'),('en','messages:apihelp-echocreateevent-example','s:22:\"en:Send a notification\";'),('en','messages:apihelp-echocreateevent-param-content','s:35:\"en:Body content of the notification\";'),('en','messages:apihelp-echocreateevent-param-email','s:35:\"en:Whether to send an email as well\";'),('en','messages:apihelp-echocreateevent-param-header','s:37:\"en:Header content of the notification\";'),('en','messages:apihelp-echocreateevent-param-page','s:38:\"en:Page to link to in the notification\";'),('en','messages:apihelp-echocreateevent-param-section','s:48:\"en:Section where notification would be delivered\";'),('en','messages:apihelp-echocreateevent-param-user','s:35:\"en:User to send the notification to\";'),('en','messages:apihelp-echocreateevent-summary','s:44:\"en:Manually trigger a notification to a user\";'),('en','messages:apihelp-echomarkread-example-1','s:30:\"en:Mark notification 8 as read\";'),('en','messages:apihelp-echomarkread-example-2','s:33:\"en:Mark all notifications as read\";'),('en','messages:apihelp-echomarkread-example-3','s:32:\"en:Mark notification 1 as unread\";'),('en','messages:apihelp-echomarkread-param-all','s:55:\"en:If set, marks all of a user\'s notifications as read.\";'),('en','messages:apihelp-echomarkread-param-list','s:46:\"en:A list of notification IDs to mark as read.\";'),('en','messages:apihelp-echomarkread-param-sections','s:38:\"en:A list of sections to mark as read.\";'),('en','messages:apihelp-echomarkread-param-unreadlist','s:48:\"en:A list of notification IDs to mark as unread.\";'),('en','messages:apihelp-echomarkread-param-wikis','s:78:\"en:List of wikis to mark notifi