 the edit created a temporary account, the API may respond with an URL that the client should visit to complete logging in. If this parameter is provided, the URL will redirect to a page with the given query parameters.\";'),('en','messages:apihelp-edit-param-section','s:145:\"en:Section identifier. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section. Often a positive integer, but can also be non-numeric.\";'),('en','messages:apihelp-edit-param-sectiontitle','s:67:\"en:The title for a new section when using <var>$1section=new</var>.\";'),('en','messages:apihelp-edit-param-starttimestamp','s:245:\"en:Timestamp when the editing process began, used to detect edit conflicts. An appropriate value may be obtained using <var>[[Special:ApiHelp/main|curtimestamp]]</var> when beginning the edit process (e.g. when loading the page content to edit).\";'),('en','messages:apihelp-edit-param-summary','s:348:\"en:Edit summary.\n\nWhen this parameter is not provided or empty, [[mw:Special:MyLanguage/Autosummary|an edit summary may be generated automatically]].\n\nWhen using <var>$1section=new</var> and <var>$1sectiontitle</var> is not provided, the value of this parameter is used for the section title instead, and an edit summary is generated automatically.\";'),('en','messages:apihelp-edit-param-tags','s:40:\"en:Change tags to apply to the revision.\";'),('en','messages:apihelp-edit-param-text','s:16:\"en:Page content.\";'),('en','messages:apihelp-edit-param-title','s:79:\"en:Title of the page to edit. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-edit-param-token','s:97:\"en:The token should always be sent as the last parameter, or at least after the $1text parameter.\";'),('en','messages:apihelp-edit-param-undo','s:72:\"en:Undo this revision. Overrides $1text, $1prependtext and $1appendtext.\";'),('en','messages:apihelp-edit-param-undoafter','s:82:\"en:Undo all revisions from $1undo to this one. If not set, just undo one revision.\";'),('en','messages:apihelp-edit-param-unwatch','s:53:\"en:Remove the page from the current user\'s watchlist.\";'),('en','messages:apihelp-edit-param-watch','s:48:\"en:Add the page to the current user\'s watchlist.\";'),('en','messages:apihelp-edit-param-watchlist','s:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-edit-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-edit-summary','s:25:\"en:Create and edit pages.\";'),('en','messages:apihelp-editcheckreferenceurl-param-url','s:16:\"en:URL to check.\";'),('en','messages:apihelp-editcheckreferenceurl-summary','s:52:\"en:Check the status of a URL for use as a reference.\";'),('en','messages:apihelp-emailuser-example-email','s:83:\"en:Send an email to the user <kbd>WikiSysop</kbd> with the text <kbd>Content</kbd>.\";'),('en','messages:apihelp-emailuser-param-ccme','s:34:\"en:Send a copy of this mail to me.\";'),('en','messages:apihelp-emailuser-param-subject','s:18:\"en:Subject header.\";'),('en','messages:apihelp-emailuser-param-target','s:29:\"en:User to send the email to.\";'),('en','messages:apihelp-emailuser-param-text','s:14:\"en:Email body.\";'),('en','messages:apihelp-emailuser-summary','s:16:\"en:Email a user.\";'),('en','messages:apihelp-expandtemplates-example-simple','s:71:\"en:Expand the wikitext <kbd><nowiki>{{Project:Sandbox}}</nowiki></kbd>.\";'),('en','messages:apihelp-expandtemplates-param-generatexml','s:58:\"en:Generate XML parse tree (replaced by $1prop=parsetree).\";'),('en','messages:apihelp-expandtemplates-param-includecomments','s:50:\"en:Whether to include HTML comments in the output.\";'),('en','messages:apihelp-expandtemplates-param-prop','s:161:\"en:Which pieces of information to get.\n\nNote that if no values are selected, the result will contain the wi