s:apihelp-help-param-modules','s:162:\"en:Modules to display help for (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>.\";'),('en','messages:apihelp-help-param-recursivesubmodules','s:43:\"en:Include help for submodules recursively.\";'),('en','messages:apihelp-help-param-submodules','s:51:\"en:Include help for submodules of the named module.\";'),('en','messages:apihelp-help-param-toc','s:50:\"en:Include a table of contents in the HTML output.\";'),('en','messages:apihelp-help-param-wrap','s:56:\"en:Wrap the output in a standard API response structure.\";'),('en','messages:apihelp-help-summary','s:42:\"en:Display help for the specified modules.\";'),('en','messages:apihelp-imagerotate-example-generator','s:75:\"en:Rotate all images in <kbd>Category:Flip</kbd> by <kbd>180</kbd> degrees.\";'),('en','messages:apihelp-imagerotate-example-simple','s:63:\"en:Rotate <kbd>File:Example.png</kbd> by <kbd>90</kbd> degrees.\";'),('en','messages:apihelp-imagerotate-param-rotation','s:37:\"en:Degrees to rotate image clockwise.\";'),('en','messages:apihelp-imagerotate-param-tags','s:48:\"en:Tags to apply to the entry in the upload log.\";'),('en','messages:apihelp-imagerotate-summary','s:29:\"en:Rotate one or more images.\";'),('en','messages:apihelp-import-example-import','s:75:\"en:Import [[meta:Help:ParserFunctions]] to namespace 100 with full history.\";'),('en','messages:apihelp-import-extended-description','s:143:\"en:Note that the HTTP POST must be done as a file upload (i.e. using multipart/form-data) when sending a file for the <var>xml</var> parameter.\";'),('en','messages:apihelp-import-param-assignknownusers','s:67:\"en:Assign edits to local users where the named user exists locally.\";'),('en','messages:apihelp-import-param-fullhistory','s:80:\"en:For interwiki imports: import the full history, not just the current version.\";'),('en','messages:apihelp-import-param-interwikipage','s:41:\"en:For interwiki imports: page to import.\";'),('en','messages:apihelp-import-param-interwikiprefix','s:130:\"en:For uploaded imports: interwiki prefix to apply to unknown usernames (and known users if <var>$1assignknownusers</var> is set).\";'),('en','messages:apihelp-import-param-interwikisource','s:46:\"en:For interwiki imports: wiki to import from.\";'),('en','messages:apihelp-import-param-namespace','s:80:\"en:Import to this namespace. Cannot be used together with <var>$1rootpage</var>.\";'),('en','messages:apihelp-import-param-rootpage','s:87:\"en:Import as subpage of this page. Cannot be used together with <var>$1namespace</var>.\";'),('en','messages:apihelp-import-param-summary','s:28:\"en:Log entry import summary.\";'),('en','messages:apihelp-import-param-tags','s:102:\"en:Change tags to apply to the entry in the import log and to the null revision on the imported pages.\";'),('en','messages:apihelp-import-param-templates','s:64:\"en:For interwiki imports: import all included templates as well.\";'),('en','messages:apihelp-import-param-xml','s:21:\"en:Uploaded XML file.\";'),('en','messages:apihelp-import-summary','s:56:\"en:Import a page from another wiki, or from an XML file.\";'),('en','messages:apihelp-json-param-ascii','s:129:\"en:If specified, encodes all non-ASCII using hexadecimal escape sequences. Default when <var>formatversion</var> is <kbd>1</kbd>.\";'),('en','messages:apihelp-json-param-callback','s:116:\"en:If specified, wraps the output into a given function call. For safety, all user-specific data will be restricted.\";'),('en','messages:apihelp-json-param-formatversion','s:20:\"en:Output formatting\";'),('en','messages:apihelp-json-param-utf8','s:193:\"en:If specified, encodes most (but not all) non-ASCII characters as UTF-8 instead of replacing them with hexadecimal escape sequences. Default when <var>formatversion</var> is not <kbd>1</kbd>.\";'),('en','messages:apihelp-json-paramvalue-formatversion-1','s:97:\"en:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\";'),('en','messages:apihelp-json-paramvalue-formatversion-2','s:17:\"en:Modern format.\";'),('en','messages:apihelp-json-paramvalue-formatversion-latest','s:78:\"en:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('en','messages:apihelp-json-summary','s:30:\"en:Output data in JSON format.\";'),('en','messages:apihelp-jsonfm-summary','s:53:\"en:Output data in JSON format (pretty-print in HTML).\";'),('en','messages:apihelp-labkipacksapply-description','s:138:\"en:Queues a unified background job to apply pack operations in a single atomic transaction. Returns an operation ID for tracking progress.\";'),('en','messages:apihelp-labkipacksapply-example-basic','s:24:\"en:Apply pack operations\";'),('en','messages:apihelp-labkipacksapply-summary','s:55:\"en:Apply batch pack operations (install/update/remove).\";'),('en','messages:apihelp-labkipackslist-description','s:165:\"en:Returns information about installed content packs, including their pages, metadata, and installation status. Can be filtered by repository, ref, or specific pack.\";'),('en','messages:apihelp-labkipackslist-example-all','s:60:\"en:List all installed packs across all repositories and refs\";'),('en','messages:apihelp-labkipackslist-example-by-ref','s:41:\"en:Get packs for a specific ref (by name)\";'),('en','messages:apihelp-labkipackslist-example-by-ref-id','s:39:\"en:Get packs for a specific ref (by ID)\";'),('en','messages:apihelp-labkipackslist-example-by-repo-id','s:37:\"en:Get packs for repository with ID 1\";'),('en','messages:apihelp-labkipackslist-example-by-repo-url','s:34:\"en:Get packs for repository by URL\";'),('en','messages:apihelp-labkipackslist-example-pack-by-id','s:34:\"en:Get pages for a pack by pack ID\";'),('en','messages:apihelp-labkipackslist-example-pack-pages','s:32:\"en:Get pages for a specific pack\";'),('en','messages:apihelp-labkipackslist-summary','s:42:\"en:List and query installed content packs.\";'),('en','messages:apihelp-labkipackspreview-description','s:171:\"en:Returns a detailed preview of what will happen when installing, updating, or removing packs. Includes dependency resolution, conflict detection, and page-level details.\";'),('en','messages:apihelp-labkipackspreview-example-basic','s:28:\"en:Preview installing a pack\";'),('en','messages:apihelp-labkipackspreview-summary','s:48:\"en:Preview pack operations before applying them.\";'),('en','messages:apihelp-labkipacksstate-description','s:153:\"en:Command-based API for managing pack selection sessions. Tracks user selections, auto-resolves dependencies, detects conflicts, and applies operations.\";'),('en','messages:apihelp-labkipacksstate-example-apply','s:53:\"en:Apply selected operations and queue background job\";'),('en','messages:apihelp-labkipacksstate-example-init','s:48:\"en:Initialize a session for a repository and ref\";'),('en','messages:apihelp-labkipacksstate-example-select','s:45:\"en:Select a pack (auto-resolves dependencies)\";'),('en','messages:apihelp-labkipacksstate-example-setpagetitle','s:33:\"en:Customize a page\'s final title\";'),('en','messages:apihelp-labkipacksstate-summary','s:58:\"en:Unified stateful API for pack selection and management.\";'),('en','messages:apihelp-labkireposadd-description','s:174:\"en:Adds a new Git-based content repository to the Labki registry, validates the URL, and schedules background setup operations. Returns an operation ID for tracking progress.\";'),('en','messages:apihelp-labkireposadd-example-basic','s:35:\"en:Add a new repository from GitHub\";'),('en','messages:apihelp-labkireposadd-summary','s:47:\"en:Add a new content repository from a Git URL.\";'),('en','messages:apihelp-labkireposlist-description','s:137:\"en:Returns information about configured content repositories, including their associated refs (branches/tags), sync status, and metadata.\";'),('en','messages:apihelp-labkireposlist-example-all','s:48:\"en:List all content repositories with their refs\";'),('en','messages:apihelp-labkireposlist-example-by-id','s:39:\"en:Get details for repository with ID 1\";'),('en','messages:apihelp-labkireposlist-example-by-url','s:36:\"en:Get details for repository by URL\";'),('en','messages:apihelp-labkireposlist-summary','s:39:\"en:List and query content repositories.\";'),('en','messages:apihelp-link','s:28:\"en:[[Special:ApiHelp/$1|$2]]\";'),('en','messages:apihelp-linkaccount-example-link','s:70:\"en:Start the process of linking to an account from <kbd>Example</kbd>.\";'),('en','messages:apihelp-linkaccount-summary','s:67:\"en:Link an account from a third-party provider to the current user.\";'),('en','messages:apihelp-login-example-login','s:10:\"en:Log in.\";'),('en','messages:apihelp-login-extended-description','s:256:\"en:This action should only be used in combination with [[Special:BotPasswords]]; use for main-account login is deprecated and may fail without warning. To safely log in to the main account, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('en','messages:apihelp-login-extended-description-nobotpasswords','s:143:\"en:This action is deprecated and may fail without warning. To safely log in, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('en','messages:apihelp-login-param-domain','s:21:\"en:Domain (optional).\";'),('en','messages:apihelp-login-param-name','s:12:\"en:Username.\";'),('en','messages:apihelp-login-param-password','s:12:\"en:Password.\";'),('en','messages:apihelp-login-param-token','s:41:\"en:Login token obtained in first request.\";'),('en','messages:apihelp-login-summary','s:41:\"en:Log in and get authentication cookies.\";'),('en','messages:apihelp-logout-example-logout','s:28:\"en:Log the current user out.\";'),('en','messages:apihelp-logout-summary','s:34:\"en:Log out and clear session data.\";'),('en','messages:apihelp-main-extended-description','s:1342:\"en:<div class=\"hlist plainlinks api-main-links\">\n* [[mw:Special:MyLanguage/API:Main_page|Documentation]]\n* [[mw:Special:MyLanguage/API:Etiquette|Etiquette & usage guidelines]]\n* [[mw:Special:MyLanguage/API:FAQ|FAQ]]\n* [https://lists.wikimedia.org/postorius/lists/mediawiki-api.lists.wikimedia.org/ Mailing list]\n* [https://lists.wikimedia.org/postorius/lists/mediawiki-api-announce.lists.wikimedia.org/ API Announcements]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Bugs & requests]\n</div>\n<strong>Status:</strong> The MediaWiki API is a mature and stable interface that is actively supported and improved. While we try to avoid it, we may occasionally need to make breaking changes; subscribe to [https://lists.wikimedia.org/hyperkitty/list/mediawiki-api-announce@lists.wikimedia.org/ the mediawiki-api-announce mailing list] for notice of updates.\n\n<strong>Erroneous requests:</strong> When erroneous requests are sent to the API, an HTTP header will be sent with the key \"MediaWiki-API-Error\" and then both the value of the header and the error code sent back will be set to the same value. For more information see [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Errors and warnings]].\n\n<p class=\"mw-apisandbox-link\"><strong>Testing:</strong> For ease of testing API requests, see [[Special:ApiSandbox]].</p>\";'),('en','messages:apihelp-main-param-action','s:27:\"en:Which action to perform.\";'),('en','messages:apihelp-main-param-assert','s:199:\"en:Verify that the user is logged in (including possibly as a temporary user) if set to <kbd>user</kbd>, <em>not</em> logged in if set to <kbd>anon</kbd>, or has the bot user right if <kbd>bot</kbd>.\";'),('en','messages:apihelp-main-param-assertuser','s:45:\"en:Verify the current user is the named user.\";'),('en','messages:apihelp-main-param-crossorigin','s:542:\"en:When accessing the API using a cross-domain AJAX request (CORS) and using a session provider that is safe against cross-site request forgery (CSRF) attacks (such as OAuth), use this instead of <code>origin=*</code> to make the request authenticated (i.e., not logged out). This must be included in any pre-flight request, and therefore must be part of the request URI (not the POST body).\n\nNote that most session providers, including standard cookie-based sessions, do not support authenticated CORS and cannot be used with this parameter.\";'),('en','messages:apihelp-main-param-curtimestamp','s:47:\"en:Include the current timestamp in the result.\";'),('en','messages:apihelp-main-param-errorformat','s:50:\"en:Format to use for warning and error text output\";'),('en','messages:apihelp-main-param-errorlang','s:311:\"en:Language to use for warnings and errors. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd> returns a list of language codes. Specify <kbd>content</kbd> to use this wiki\'s content language or <kbd>uselang</kbd> to use the same value as the <var>uselang</var> parameter.\";'),('en','messages:apihelp-main-param-errorsuselocal','s:98:\"en:If given, error texts will use locally-customized messages from the {{ns:MediaWiki}} namespace.\";'),('en','messages:apihelp-main-param-format','s:28:\"en:The format of the output.\";'),('en','messages:apihelp-main-param-maxage','s:104:\"en:Set the <code>max-age</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),('en','messages:apihelp-main-param-maxlag','s:491:\"en:Maximum lag can be used when MediaWiki is installed on a database replicated cluster. To save actions causing any more site replication lag, this parameter can make the client wait until the replication lag is less than the specified value. In case of excessive lag, error code <samp>maxlag</samp> is returned with a message like <samp>Waiting for $host: $lag seconds lagged</samp>.<br />See [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manual: Maxlag parameter]] for more information.\";'),('en','messages:apihelp-main-param-origin','s:1008:\"en:When accessing the API using a cross-domain AJAX request (CORS), set this to the originating domain. This must be included in any pre-flight request, and therefore must be part of the request URI (not the POST body).\n\nFor authenticated requests, this must match one of the origins in the <code>Origin</code> header exactly, so it has to be set to something like <kbd>https://en.wikipedia.org</kbd> or <kbd>https://meta.wikimedia.org</kbd>. If this parameter does not match the <code>Origin</code> header, a 403 response will be returned. If this parameter matches the <code>Origin</code> header and the origin is allowed, the <code>Access-Control-Allow-Origin</code> and <code>Access-Control-Allow-Credentials</code> headers will be set.\n\nFor non-authenticated requests, specify the value <kbd>*</kbd>. This will cause the <code>Access-Control-Allow-Origin</code> header to be set, but <code>Access-Control-Allow-Credentials</code> will be <code>false</code> and all user-specific data will be restricted.\";'),('en','messages:apihelp-main-param-requestid','s:94:\"en:Any value given here will be included in the response. May be used to distinguish requests.\";'),('en','messages:apihelp-main-param-responselanginfo','s:92:\"en:Include the languages used for <var>uselang</var> and <var>errorlang</var> in the result.\";'),('en','messages:apihelp-main-param-servedby','s:63:\"en:Include the hostname that served the request in the results.\";'),('en','messages:apihelp-main-param-smaxage','s:105:\"en:Set the <code>s-maxage</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),('en','messages:apihelp-main-param-uselang','s:305:\"en:Language to use for message translations. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd> returns a list of language codes. You can specify <kbd>user</kbd> to use the current user\'s language preference or <kbd>content</kbd> to use this wiki\'s content language.\";'),('en','messages:apihelp-main-param-variant','s:88:\"en:Variant of the language. Only works if the base language supports variant conversion.\";'),('en','messages:apihelp-main-paramvalue-errorformat-bc','s:103:\"en:Format used prior to MediaWiki 1.29. <var>errorlang</var> and <var>errorsuselocal</var> are ignored.\";'),('en','messages:apihelp-main-paramvalue-errorformat-html','s:7:\"en:HTML\";'),('en','messages:apihelp-main-paramvalue-errorformat-none','s:40:\"en:No text output, only the error codes.\";'),('en','messages:apihelp-main-paramvalue-errorformat-plaintext','s:57:\"en:Wikitext with HTML tags removed and entities replaced.\";'),('en','messages:apihelp-main-paramvalue-errorformat-raw','s:30:\"en:Message key and parameters.\";'),('en','messages:apihelp-main-paramvalue-errorformat-wikitext','s:21:\"en:Unparsed wikitext.\";'),('en','messages:apihelp-main-summary','s:3:\"en:\";'),('en','messages:apihelp-managetags-example-activate','s:93:\"en:Activate a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),('en','messages:apihelp-managetags-example-create','s:91:\"en:Create a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),('en','messages:apihelp-managetags-example-deactivate','s:87:\"en:Deactivate a tag named <kbd>spam</kbd> with the reason <kbd>No longer required</kbd>\";'),('en','messages:apihelp-managetags-example-delete','s:74:\"en:Delete the <kbd>vandlaism</kbd> tag with the reason <kbd>Misspelt</kbd>\";'),('en','messages:apihelp-managetags-param-ignorewarnings','s:71:\"en:Whether to ignore any warnings that are issued during the operation.\";'),('en','messages:apihelp-managetags-param-operation','s:30:\"en:Which operation to perform:\";'),('en','messages:apihelp-managetags-param-reason','s:81:\"en:An optional reason for creating, deleting, activating or deactivating the tag.\";'),('en','messages:apihelp-managetags-param-tag','s:280:\"en:Tag to create, delete, activate or deactivate. For tag creation, the tag must not exist. For tag deletion, the tag must exist. For tag activation, the tag must exist and not be in use by an extension. For tag deactivation, the tag must be currently active and manually defined.\";'),('en','messages:apihelp-managetags-param-tags','s:63:\"en:Change tags to apply to the entry in the tag management log.\";'),('en','messages:apihelp-managetags-paramvalue-operation-activate','s:62:\"en:Activate a change tag, allowing users to apply it manually.\";'),('en','messages:apihelp-managetags-paramvalue-operation-create','s:42:\"en:Create a new change tag for manual use.\";'),('en','messages:apihelp-managetags-paramvalue-operation-deactivate','s:71:\"en:Deactivate a change tag, preventing users from applying it manually.\";'),('en','messages:apihelp-managetags-paramvalue-operation-delete','s:147:\"en:Remove a change tag from the database, including removing the tag from all revisions, recent change entries and log entries on which it is used.\";'),('en','messages:apihelp-managetags-summary','s:52:\"en:Perform management tasks relating to change tags.\";'),('en','messages:apihelp-mergehistory-example-merge','s:74:\"en:Merge the entire history of <kbd>Oldpage</kbd> into <kbd>Newpage</kbd>.\";'),('en','messages:apihelp-mergehistory-example-merge-timestamp','s:119:\"en:Merge the page revisions of <kbd>Oldpage</kbd> dating up to <kbd>2015-12-31T04:37:41Z</kbd> into <kbd>Newpage</kbd>.\";'),('en','messages:apihelp-mergehistory-param-from','s:105:\"en:Title of the page from which history will be merged. Cannot be used together with <var>$1fromid</var>.\";'),('en','messages:apihelp-mergehistory-param-fromid','s:105:\"en:Page ID of the page from which history will be merged. Cannot be used together with <var>$1from</var>.\";'),('en','messages:apihelp-mergehistory-param-reason','s:32:\"en:Reason for the history merge.\";'),('en','messages:apihelp-mergehistory-param-timestamp','s:211:\"en:Timestamp up to which revisions will be moved from the source page\'s history to the destination page\'s history. If omitted, the entire page history of the source page will be merged into the destination page.\";'),('en','messages:apihelp-mergehistory-param-to','s:101:\"en:Title of the page to which history will be merged. Cannot be used together with <var>$1toid</var>.\";'),('en','messages:apihelp-mergehistory-param-toid','s:101:\"en:Page ID of the page to which history will be merged. Cannot be used together with <var>$1to</var>.\";'),('en','messages:apihelp-mergehistory-summary','s:24:\"en:Merge page histories.\";'),('en','messages:apihelp-move-example-move','s:79:\"en:Move <kbd>Badtitle</kbd> to <kbd>Goodtitle</kbd> without leaving a redirect.\";'),('en','messages:apihelp-move-param-from','s:81:\"en:Title of the page to rename. Cannot be used together with <var>$1fromid</var>.\";'),('en','messages:apihelp-move-param-fromid','s:81:\"en:Page ID of the page to rename. Cannot be used together with <var>$1from</var>.\";'),('en','messages:apihelp-move-param-ignorewarnings','s:23:\"en:Ignore any warnings.\";'),('en','messages:apihelp-move-param-movesubpages','s:34:\"en:Rename subpages, if applicable.\";'),('en','messages:apihelp-move-param-movetalk','s:38:\"en:Rename the talk page, if it exists.\";'),('en','messages:apihelp-move-param-noredirect','s:27:\"en:Don\'t create a redirect.\";'),('en','messages:apihelp-move-param-reason','s:25:\"en:Reason for the rename.\";'),('en','messages:apihelp-move-param-tags','s:102:\"en:Change tags to apply to the entry in the move log and to the null revision on the destination page.\";'),('en','messages:apihelp-move-param-to','s:31:\"en:Title to rename the page to.\";'),('en','messages:apihelp-move-param-unwatch','s:70:\"en:Remove the page and the redirect from the current user\'s watchlist.\";'),('en','messages:apihelp-move-param-watch','s:65:\"en:Add the page and the redirect to the current user\'s watchlist.\";'),('en','messages:apihelp-move-param-watchlist','s:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-move-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-move-summary','s:15:\"en:Move a page.\";'),('en','messages:apihelp-no-such-module','s:25:\"en:Module \"$1\" not found.\";'),('en','messages:apihelp-none-summary','s:18:\"en:Output nothing.\";'),('en','messages:apihelp-opensearch-example-te','s:43:\"en:Find pages beginning with <kbd>Te</kbd>.\";'),('en','messages:apihelp-opensearch-param-format','s:28:\"en:The format of the output.\";'),('en','messages:apihelp-opensearch-param-limit','s:39:\"en:Maximum number of results to return.\";'),('en','messages:apihelp-opensearch-param-namespace','s:93:\"en:Namespaces to search. Ignored if <var>$1search</var> begins with a valid namespace prefix.\";'),('en','messages:apihelp-opensearch-param-redirects','s:27:\"en:How to handle redirects:\";'),('en','messages:apihelp-opensearch-param-redirects-append','s:101:\"en:For historical reasons, the default is \"return\" for $1format=json and \"resolve\" for other formats.\";'),('en','messages:apihelp-opensearch-param-search','s:17:\"en:Search string.\";'),('en','messages:apihelp-opensearch-param-suggest','s:18:\"en:No longer used.\";'),('en','messages:apihelp-opensearch-param-warningsaserror','s:100:\"en:If warnings are raised with <kbd>format=json</kbd>, return an API error instead of ignoring them.\";'),('en','messages:apihelp-opensearch-paramvalue-redirects-resolve','s:65:\"en:Return the target page. May return fewer than $1limit results.\";'),('en','messages:apihelp-opensearch-paramvalue-redirects-return','s:30:\"en:Return the redirect itself.\";'),('en','messages:apihelp-opensearch-summary','s:49:\"en:Search the wiki using the OpenSearch protocol.\";'),('en','messages:apihelp-options-example-change','s:63:\"en:Change <kbd>skin</kbd> and <kbd>hideminor</kbd> preferences.\";'),('en','messages:apihelp-options-example-complex','s:75:\"en:Reset all preferences, then set <kbd>skin</kbd> and <kbd>nickname</kbd>.\";'),('en','messages:apihelp-options-example-reset','s:25:\"en:Reset all preferences.\";'),('en','messages:apihelp-options-extended-description','s:186:\"en:Only options which are registered in core or in one of installed extensions, or options with keys prefixed with <code>userjs-</code> (intended to be used by user scripts), can be set.\";'),('en','messages:apihelp-options-param-change','s:361:\"en:List of changes, formatted name=value (e.g. skin=vector). If no value is given (not even an equals sign), e.g., optionname|otheroption|..., the option will be reset to its default value. If any value passed contains the pipe character (<kbd>|</kbd>), use the [[Special:ApiHelp/main#main/datatypes|alternative multiple-value separator]] for correct operation.\";'),('en','messages:apihelp-options-param-global','s:255:\"en:What to do if the option was set globally using the GlobalPreferences extension.\n\n* <kbd>ignore</kbd>: Do nothing. The option remains with its previous value.\n* <kbd>override</kbd>: Add a local override.\n* <kbd>update</kbd>: Update the option globally.\";'),('en','messages:apihelp-options-param-optionname','s:92:\"en:The name of the option that should be set to the value given by <var>$1optionvalue</var>.\";'),('en','messages:apihelp-options-param-optionvalue','s:189:\"en:The value for the option specified by <var>$1optionname</var>. When <var>$1optionname</var> is set but <var>$1optionvalue</var> is omitted, the option will be reset to its default value.\";'),('en','messages:apihelp-options-param-reset','s:43:\"en:Resets preferences to the site defaults.\";'),('en','messages:apihelp-options-param-resetkinds','s:79:\"en:List of types of options to reset when the <var>$1reset</var> option is set.\";'),('en','messages:apihelp-options-summary','s:42:\"en:Change preferences of the current user.\";'),('en','messages:apihelp-paraminfo-example-1','s:272:\"en:Show info for <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, and <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('en','messages:apihelp-paraminfo-example-2','s:85:\"en:Show info for all submodules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),('en','messages:apihelp-paraminfo-param-formatmodules','s:104:\"en:List of format module names (value of <var>format</var> parameter). Use <var>$1modules</var> instead.\";'),('en','messages:apihelp-paraminfo-param-helpformat','s:26:\"en:Format of help strings.\";'),('en','messages:apihelp-paraminfo-param-mainmodule','s:100:\"en:Get information about the main (top-level) module as well. Use <kbd>$1modules=main</kbd> instead.\";'),('en','messages:apihelp-paraminfo-param-modules','s:244:\"en:List of module names (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>, or all submodules with <kbd>+*</kbd>, or all submodules recursively with <kbd>+**</kbd>.\";'),('en','messages:apihelp-paraminfo-param-pagesetmodule','s:84:\"en:Get information about the pageset module (providing titles= and friends) as well.\";'),('en','messages:apihelp-paraminfo-param-querymodules','s:180:\"en:List of query module names (value of <var>prop</var>, <var>meta</var> or <var>list</var> parameter). Use <kbd>$1modules=query+foo</kbd> instead of <kbd>$1querymodules=foo</kbd>.\";'),('en','messages:apihelp-paraminfo-summary','s:40:\"en:Obtain information about API modules.\";'),('en','messages:apihelp-parse-example-page','s:16:\"en:Parse a page.\";'),('en','messages:apihelp-parse-example-summary','s:19:\"en:Parse a summary.\";'),('en','messages:apihelp-parse-example-text','s:18:\"en:Parse wikitext.\";'),('en','messages:apihelp-parse-example-texttitle','s:45:\"en:Parse wikitext, specifying the page title.\";'),('en','messages:apihelp-parse-extended-description','s:503:\"en:See the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.\n\nThere are several ways to specify the text to parse:\n# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.\n# Specify content explicitly, using <var>$1text</var>, <var>$1title</var>, <var>$1revid</var>, and <var>$1contentmodel</var>.\n# Specify only a summary to parse. <var>$1prop</var> should be given an empty value.\";'),('en','messages:apihelp-parse-param-contentformat','s:90:\"en:Content serialization format used for the input text. Only valid when used with $1text.\";'),('en','messages:apihelp-parse-param-contentmodel','s:162:\"en:Content model of the input text. If omitted, $1title must be specified, and default will be the model of the specified title. Only valid when used with $1text.\";'),('en','messages:apihelp-parse-param-disableeditsection','s:50:\"en:Omit edit section links from the parser output.\";'),('en','messages:apihelp-parse-param-disablelimitreport','s:71:\"en:Omit the limit report (\"NewPP limit report\") from the parser output.\";'),('en','messages:apihelp-parse-param-disablepp','s:47:\"en:Use <var>$1disablelimitreport</var> instead.\";'),('en','messages:apihelp-parse-param-disablestylededuplication','s:62:\"en:Do not deduplicate inline stylesheets in the parser output.\";'),('en','messages:apihelp-parse-param-disabletoc','s:36:\"en:Omit table of contents in output.\";'),('en','messages:apihelp-parse-param-effectivelanglinks','s:93:\"en:Includes language links supplied by extensions (for use with <kbd>$1prop=langlinks</kbd>).\";'),('en','messages:apihelp-parse-param-generatexml','s:109:\"en:Generate XML parse tree (requires content model <code>$1</code>; replaced by <kbd>$2prop=parsetree</kbd>).\";'),('en','messages:apihelp-parse-param-oldid','s:91:\"en:Parse the content of this revision. Overrides <var>$1page</var> and <var>$1pageid</var>.\";'),('en','messages:apihelp-parse-param-onlypst','s:168:\"en:Do a pre-save transform (PST) on the input, but don\'t parse it. Returns the same wikitext, after a PST has been applied. Only valid when used with <var>$1text</var>.\";'),('en','messages:apihelp-parse-param-page','s:105:\"en:Parse the content of this page. Cannot be used together with <var>$1text</var> and <var>$1title</var>.\";'),('en','messages:apihelp-parse-param-pageid','s:63:\"en:Parse the content of this page. Overrides <var>$1page</var>.\";'),('en','messages:apihelp-parse-param-parsoid','s:101:\"en:Generate HTML conforming to the [[mw:Specs/HTML|MediaWiki DOM spec]] using [[mw:Parsoid|Parsoid]].\";'),('en','messages:apihelp-parse-param-preview','s:25:\"en:Parse in preview mode.\";'),('en','messages:apihelp-parse-param-prop','s:38:\"en:Which pieces of information to get:\";'),('en','messages:apihelp-parse-param-pst','s:90:\"en:Do a pre-save transform on the input before parsing it. Only valid when used with text.\";'),('en','messages:apihelp-parse-param-redirects','s:80:\"en:If <var>$1page</var> or <var>$1pageid</var> is set to a redirect, resolve it.\";'),('en','messages:apihelp-parse-param-revid','s:87:\"en:Revision ID, for <code><nowiki>{{REVISIONID}}</nowiki></code> and similar variables.\";'),('en','messages:apihelp-parse-param-section','s:243:\"en:Only parse the content of the section with this identifier.\n\nWhen <kbd>new</kbd>, parse <var>$1text</var> and <var>$1sectiontitle</var> as if adding a new section to the page.\n\n<kbd>new</kbd> is allowed only when specifying <var>text</var>.\";'),('en','messages:apihelp-parse-param-sectionpreview','s:60:\"en:Parse in section preview mode (enables preview mode too).\";'),('en','messages:apihelp-parse-param-sectiontitle','s:154:\"en:New section title when <var>section</var> is <kbd>new</kbd>.\n\nUnlike page editing, this does not fall back to <var>summary</var> when omitted or empty.\";'),('en','messages:apihelp-parse-param-showstrategykeys','s:74:\"en:Whether to include internal merge strategy information in jsconfigvars.\";'),('en','messages:apihelp-parse-param-summary','s:20:\"en:Summary to parse.\";'),('en','messages:apihelp-parse-param-text','s:99:\"en:Text to parse. Use <var>$1title</var> or <var>$1contentmodel</var> to control the content model.\";'),('en','messages:apihelp-parse-param-title','s:133:\"en:Title of page the text belongs to. If omitted, <var>$1contentmodel</var> must be specified, and [[API]] will be used as the title.\";'),('en','messages:apihelp-parse-param-usearticle','s:103:\"en:Use the ArticleParserOptions hook to ensure the options used match those used for article page views\";'),('en','messages:apihelp-parse-param-useskin','s:214:\"en:Apply the selected skin to the parser output. May affect the following properties: <kbd>text</kbd>, <kbd>langlinks</kbd>, <kbd>headitems</kbd>, <kbd>modules</kbd>, <kbd>jsconfigvars</kbd>, <kbd>indicators</kbd>.\";'),('en','messages:apihelp-parse-param-wrapoutputclass','s:46:\"en:CSS class to use to wrap the parser output.\";'),('en','messages:apihelp-parse-paramvalue-prop-categories','s:47:\"en:Gives the categories in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-categorieshtml','s:44:\"en:Gives the HTML version of the categories.\";'),('en','messages:apihelp-parse-paramvalue-prop-displaytitle','s:41:\"en:Adds the title of the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars','s:86:\"en:Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),('en','messages:apihelp-parse-paramvalue-prop-externallinks','s:51:\"en:Gives the external links in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-headhtml','s:144:\"en:Gives parsed doctype, opening <code>&lt;html&gt;</code>, <code>&lt;head&gt;</code> element and opening <code>&lt;body&gt;</code> of the page.\";'),('en','messages:apihelp-parse-paramvalue-prop-headitems','s:67:\"en:Gives items to put in the <code>&lt;head&gt;</code> of the page.\";'),('en','messages:apihelp-parse-paramvalue-prop-images','s:43:\"en:Gives the images in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-indicators','s:61:\"en:Gives the HTML of page status indicators used on the page.\";'),('en','messages:apihelp-parse-paramvalue-prop-iwlinks','s:48:\"en:Gives interwiki links in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-jsconfigvars','s:113:\"en:Gives the JavaScript configuration variables specific to the page. To apply, use <code>mw.config.set()</code>.\";'),('en','messages:apihelp-parse-paramvalue-prop-langlinks','s:51:\"en:Gives the language links in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-limitreportdata','s:106:\"en:Gives the limit report in a structured way. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('en','messages:apihelp-parse-paramvalue-prop-limitreporthtml','s:106:\"en:Gives the HTML version of the limit report. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('en','messages:apihelp-parse-paramvalue-prop-links','s:51:\"en:Gives the internal links in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-modules','s:214:\"en:Gives the ResourceLoader modules used on the page. To load, use <code>mw.loader.using()</code>. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('en','messages:apihelp-parse-paramvalue-prop-parsetree','s:82:\"en:The XML parse tree of revision content (requires content model <code>$1</code>)\";'),('en','messages:apihelp-parse-paramvalue-prop-parsewarnings','s:72:\"en:Gives the warnings that occurred while parsing content (as wikitext).\";'),('en','messages:apihelp-parse-paramvalue-prop-parsewarningshtml','s:68:\"en:Gives the warnings that occurred while parsing content (as HTML).\";'),('en','messages:apihelp-parse-paramvalue-prop-properties','s:59:\"en:Gives various properties defined in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-revid','s:43:\"en:Adds the revision ID of the parsed page.\";'),('en','messages:apihelp-parse-paramvalue-prop-sections','s:45:\"en:Gives the sections in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-subtitle','s:46:\"en:Adds the page subtitle for the parsed page.\";'),('en','messages:apihelp-parse-paramvalue-prop-templates','s:46:\"en:Gives the templates in the parsed wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-text','s:41:\"en:Gives the parsed text of the wikitext.\";'),('en','messages:apihelp-parse-paramvalue-prop-wikitext','s:47:\"en:Gives the original wikitext that was parsed.\";'),('en','messages:apihelp-parse-summary','s:44:\"en:Parses content and returns parser output.\";'),('en','messages:apihelp-patrol-example-rcid','s:26:\"en:Patrol a recent change.\";'),('en','messages:apihelp-patrol-example-revid','s:21:\"en:Patrol a revision.\";'),('en','messages:apihelp-patrol-param-rcid','s:30:\"en:Recentchanges ID to patrol.\";'),('en','messages:apihelp-patrol-param-revid','s:25:\"en:Revision ID to patrol.\";'),('en','messages:apihelp-patrol-param-tags','s:55:\"en:Change tags to apply to the entry in the patrol log.\";'),('en','messages:apihelp-patrol-summary','s:29:\"en:Patrol a page or revision.\";'),('en','messages:apihelp-pfautocomplete-param-base_cargo_field','s:68:\"en:The Cargo field for a previous field in the form to check against\";'),('en','messages:apihelp-pfautocomplete-param-base_cargo_table','s:68:\"en:The Cargo table for a previous field in the form to check against\";'),('en','messages:apihelp-pfautocomplete-param-baseprop','s:70:\"en:A previous Semantic MediaWiki property in the form to check against\";'),('en','messages:apihelp-pfautocomplete-param-basevalue','s:56:\"en:The value to check for the previous property or field\";'),('en','messages:apihelp-pfautocomplete-param-cargo_field','s:69:\"en:The field of the Cargo table whose values will be autocompleted on\";'),('en','messages:apihelp-pfautocomplete-param-cargo_table','s:90:\"en:A database table, defined by the Cargo extension, whose values will be autocompleted on\";'),('en','messages:apihelp-pfautocomplete-param-cargo_where','s:75:\"en:A filter to apply, if the cargo_table and cargo_field parameters are set\";'),('en','messages:apihelp-pfautocomplete-param-category','s:50:\"en:A category whose pages will be autocompleted on\";'),('en','messages:apihelp-pfautocomplete-param-concept','s:70:\"en:A Semantic MediaWiki \"concept\" whose pages will be autocompleted on\";'),('en','messages:apihelp-pfautocomplete-param-external_url','s:56:\"en:An alias for an external URL from which to get values\";'),('en','messages:apihelp-pfautocomplete-param-limit','s:44:\"en:A limit on the number of results returned\";'),('en','messages:apihelp-pfautocomplete-param-namespace','s:51:\"en:A namespace whose pages will be autocompleted on\";'),('en','messages:apihelp-pfautocomplete-param-property','s:70:\"en:A Semantic MediaWiki property whose values will be autocompleted on\";'),('en','messages:apihelp-pfautocomplete-param-semantic_query','s:68:\"en:A Semantic MediaWiki query whose results will be autocompleted on\";'),('en','messages:apihelp-pfautocomplete-param-substr','s:35:\"en:The substring to autocomplete on\";'),('en','messages:apihelp-pfautocomplete-param-wikidata','s:49:\"en:Search string for getting values from Wikidata\";'),('en','messages:apihelp-pfautocomplete-summary','s:51:\"en:Autocompletion used by the Page Forms extension.\";'),('en','messages:apihelp-pfautoedit-param-form','s:29:\"en:The Page Forms form to use\";'),('en','messages:apihelp-pfautoedit-param-preload','s:44:\"en:The name of a page to preload in the form\";'),('en','messages:apihelp-pfautoedit-param-query','s:19:\"en:The query string\";'),('en','messages:apihelp-pfautoedit-param-target','s:47:\"en:The name of the page to be created or edited\";'),('en','messages:apihelp-pfautoedit-summary','s:74:\"en:Create or edit a page using a form defined by the Page Forms extension.\";'),('en','messages:apihelp-php-param-formatversion','s:20:\"en:Output formatting\";'),('en','messages:apihelp-php-paramvalue-formatversion-1','s:97:\"en:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\";'),('en','messages:apihelp-php-paramvalue-formatversion-2','s:17:\"en:Modern format.\";'),('en','messages:apihelp-php-paramvalue-formatversion-latest','s:78:\"en:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('en','messages:apihelp-php-summary','s:40:\"en:Output data in serialized PHP format.\";'),('en','messages:apihelp-phpfm-summary','s:63:\"en:Output data in serialized PHP format (pretty-print in HTML).\";'),('en','messages:apihelp-protect-example-protect','s:18:\"en:Protect a page.\";'),('en','messages:apihelp-protect-example-unprotect','s:108:\"en:Unprotect a page by setting restrictions to <kbd>all</kbd> (i.e. everyone is allowed to take the action).\";'),('en','messages:apihelp-protect-example-unprotect2','s:47:\"en:Unprotect a page by setting no restrictions.\";'),('en','messages:apihelp-protect-param-cascade','s:163:\"en:Enable cascading protection (i.e. protect transcluded templates and images used in this page). Ignored if none of the given protection levels support cascading.\";'),('en','messages:apihelp-protect-param-expiry','s:209:\"en:Expiry timestamps. If only one timestamp is set, it\'ll be used for all protections. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd>, for a never-expiring protection.\";'),('en','messages:apihelp-protect-param-pageid','s:71:\"en:ID of the page to (un)protect. Cannot be used together with $1title.\";'),('en','messages:apihelp-protect-param-protections','s:265:\"en:List of protection levels, formatted <kbd>action=level</kbd> (e.g. <kbd>edit=sysop</kbd>). A level of <kbd>all</kbd> means everyone is allowed to take the action, i.e. no restriction.\n\n<strong>Note:</strong> Any actions not listed will have restrictions removed.\";'),('en','messages:apihelp-protect-param-reason','s:29:\"en:Reason for (un)protecting.\";'),('en','messages:apihelp-protect-param-tags','s:59:\"en:Change tags to apply to the entry in the protection log.\";'),('en','messages:apihelp-protect-param-title','s:75:\"en:Title of the page to (un)protect. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-protect-param-watch','s:76:\"en:If set, add the page being (un)protected to the current user\'s watchlist.\";'),('en','messages:apihelp-protect-param-watchlist','s:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-protect-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-protect-summary','s:41:\"en:Change the protection level of a page.\";'),('en','messages:apihelp-purge-example-generator','s:50:\"en:Purge the first 10 pages in the main namespace.\";'),('en','messages:apihelp-purge-example-simple','s:75:\"en:Purge <kbd>[[{{MediaWiki:Mainpage}}]]</kbd> and the <kbd>API</kbd> page.\";'),('en','messages:apihelp-purge-param-forcelinkupdate','s:63:\"en:Update the links tables and do other secondary data updates.\";'),('en','messages:apihelp-purge-param-forcerecursivelinkupdate','s:114:\"en:Same as <kbd>forcelinkupdate</kbd>, and update the links tables for any page that uses this page as a template.\";'),('en','messages:apihelp-purge-summary','s:40:\"en:Purge the cache for the given titles.\";'),('en','messages:apihelp-query+allcategories-example-generator','s:89:\"en:Retrieve info about the category page itself for categories beginning <kbd>List</kbd>.\";'),('en','messages:apihelp-query+allcategories-example-size','s:67:\"en:List categories with information on the number of pages in each.\";'),('en','messages:apihelp-query+allcategories-param-dir','s:24:\"en:Direction to sort in.\";'),('en','messages:apihelp-query+allcategories-param-from','s:42:\"en:The category to start enumerating from.\";'),('en','messages:apihelp-query+allcategories-param-limit','s:33:\"en:How many categories to return.\";'),('en','messages:apihelp-query+allcategories-param-max','s:57:\"en:Only return categories with at most this many members.\";'),('en','messages:apihelp-query+allcategories-param-min','s:58:\"en:Only return categories with at least this many members.\";'),('en','messages:apihelp-query+allcategories-param-prefix','s:61:\"en:Search for all category titles that begin with this value.\";'),('en','messages:apihelp-query+allcategories-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+allcategories-param-to','s:39:\"en:The category to stop enumerating at.\";'),('en','messages:apihelp-query+allcategories-paramvalue-prop-hidden','s:75:\"en:Tags categories that are hidden with <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('en','messages:apihelp-query+allcategories-paramvalue-prop-size','s:40:\"en:Adds number of pages in the category.\";'),('en','messages:apihelp-query+allcategories-summary','s:28:\"en:Enumerate all categories.\";'),('en','messages:apihelp-query+alldeletedrevisions-example-ns-main','s:61:\"en:List the first 50 deleted revisions in the main namespace.\";'),('en','messages:apihelp-query+alldeletedrevisions-example-user','s:69:\"en:List the last 50 deleted contributions by user <kbd>Example</kbd>.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-end','s:40:\"en:The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-excludeuser','s:37:\"en:Don\'t list revisions by this user.\";'),('en'