que).\";'),('en','messages:apihelp-query+alltransclusions-paramvalue-prop-title','s:38:\"en:Adds the title of the transclusion.\";'),('en','messages:apihelp-query+alltransclusions-summary','s:99:\"en:List all transclusions (pages embedded using &#123;&#123;x&#125;&#125;), including non-existing.\";'),('en','messages:apihelp-query+allusers-example-y','s:39:\"en:List users starting at <kbd>Y</kbd>.\";'),('en','messages:apihelp-query+allusers-param-activeusers','s:64:\"en:Only list users active in the last $1 {{PLURAL:$1|day|days}}.\";'),('en','messages:apihelp-query+allusers-param-attachedwiki','s:117:\"en:With <kbd>$1prop=centralids</kbd>, also indicate whether the user is attached with the wiki identified by this ID.\";'),('en','messages:apihelp-query+allusers-param-dir','s:24:\"en:Direction to sort in.\";'),('en','messages:apihelp-query+allusers-param-excludegroup','s:37:\"en:Exclude users in the given groups.\";'),('en','messages:apihelp-query+allusers-param-excludenamed','s:35:\"en:Exclude users of named accounts.\";'),('en','messages:apihelp-query+allusers-param-excludetemp','s:39:\"en:Exclude users of temporary accounts.\";'),('en','messages:apihelp-query+allusers-param-from','s:42:\"en:The username to start enumerating from.\";'),('en','messages:apihelp-query+allusers-param-group','s:124:\"en:Only include users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+allusers-param-limit','s:38:\"en:How many total usernames to return.\";'),('en','messages:apihelp-query+allusers-param-prefix','s:51:\"en:Search for all users that begin with this value.\";'),('en','messages:apihelp-query+allusers-param-prop','s:42:\"en:Which pieces of information to include:\";'),('en','messages:apihelp-query+allusers-param-rights','s:144:\"en:Only include users with the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messa