securitysensitiveoperation','s:118:\"en:Test whether the user\'s current authentication status is sufficient for the specified security-sensitive operation.\";'),('en','messages:apihelp-query+authmanagerinfo-summary','s:64:\"en:Retrieve information about the current authentication status.\";'),('en','messages:apihelp-query+backlinks-example-generator','s:69:\"en:Get information about pages linking to [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+backlinks-example-simple','s:44:\"en:Show links to [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+backlinks-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+backlinks-param-filterredir','s:146:\"en:How to filter for redirects. If set to <kbd>nonredirects</kbd> when <var>$1redirect</var> is enabled, this is only applied to the second level.\";'),('en','messages:apihelp-query+backlinks-param-limit','s:182:\"en:How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+backlinks-param-namespace','s:30:\"en:The namespace to enumerate.\";'),('en','messages:apihelp-query+backlinks-param-pageid','s:70:\"en:Page ID to search. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+backlinks-param-redirect','s:109:\"en:If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('en','messages:apihelp-query+backlinks-param-title','s:69:\"en:Title to search. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+backlinks-summary','s:46:\"en:Find all pages that link to the given page.\";'),('en','messages:apihelp-query+blocks-example-simple','s:15:\"en:List blocks.\";'),('en','messages:apihelp-query+blocks-example-users','s:60:\"en:List blocks of users <kbd>Alice</kbd> and <kbd>Bob</kbd>.\";'),('en','messages:apihelp-query+blocks-param-end','s:40:\"en:The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+blocks-param-ids','s:40:\"en:List of block IDs to list (optional).\";'),('en','messages:apihelp-query+blocks-param-ip','s:195:\"en:Get all blocks applying to this IP address or CIDR range, including range blocks.\nCannot be used together with <var>$3users</var>. CIDR ranges broader than IPv4/$1 or IPv6/$2 are not accepted.\";'),('en','messages:apihelp-query+blocks-param-limit','s:40:\"en:The maximum number of blocks to list.\";'),('en','messages:apihelp-query+blocks-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+blocks-param-show','s:136:\"en:Show only items that meet these criteria.\nFor example, to see only indefinite blocks on IP addresses, set <kbd>$1show=ip|!temp</kbd>.\";'),('en','messages:apihelp-query+blocks-param-start','s:43:\"en:The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+blocks-param-users','s:42:\"en:List of users to search for (optional).\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-by','s:42:\"en:Adds the username of the blocking user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-byid','s:41:\"en:Adds the user ID of the blocking user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-expiry','s:48:\"en:Adds the timestamp of when the block expires.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-flags','s:49:\"en:Tags the ban with (autoblock, anononly, etc.).\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-id','s:28:\"en:Adds the ID of the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-parsedreason','s:46:\"en:Adds the parsed reason given for the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-range','s:56:\"en:Adds the range of IP addresses affected by the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-reason','s:39:\"en:Adds the reason given for the block.\