help-query+categories-summary','s:43:\"en:List all categories the pages belong to.\";'),('en','messages:apihelp-query+categoryinfo-example-simple','s:77:\"en:Get information about <kbd>Category:Foo</kbd> and <kbd>Category:Bar</kbd>.\";'),('en','messages:apihelp-query+categoryinfo-summary','s:50:\"en:Returns information about the given categories.\";'),('en','messages:apihelp-query+categorymembers-example-generator','s:69:\"en:Get page info about first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+categorymembers-example-simple','s:53:\"en:Get first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-dir','s:30:\"en:In which direction to sort.\";'),('en','messages:apihelp-query+categorymembers-param-end','s:82:\"en:Timestamp to end listing at. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-endhexsortkey','s:120:\"en:Sortkey to end listing at, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkey','s:31:\"en:Use $1endhexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkeyprefix','s:195:\"en:Sortkey prefix to end listing <strong>before</strong> (not <strong>at</strong>; if this value occurs it will not be included!). Can only be used with $1sort=sortkey. Overrides $1endhexsortkey.\";'),('en','messages:apihelp-query+categorymembers-param-limit','s:41:\"en:The maximum number of pages to return.\";'),('en','messages:apihelp-query+categorymembers-param-namespace','s:169:\"en:Only include pages in these namespaces. Note that <kbd>$1type=subcat</kbd> or <kbd>$1type=file</kbd> may be used instead of <kbd>$1namespace=14</kbd> or <kbd>6</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-pageid','s:89:\"en:Page ID of the category to enumerate. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+categorymembers-param-prop','s:42:\"en:Which pieces of information to include:\";'),('en','messages:apihelp-query+categorymembers-param-sort','s:23:\"en:Property to sort by.\";'),('en','messages:apihelp-query+categorymembers-param-start','s:86:\"en:Timestamp to start listing from. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-starthexsortkey','s:124:\"en:Sortkey to start listing from, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkey','s:33:\"en:Use $1starthexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkeyprefix','s:129:\"en:Sortkey prefix to start listing from. Can only be used with <kbd>$1sort=sortkey</kbd>. Overrides <var>$1starthexsortkey</var>.\";'),('en','messages:apihelp-query+categorymembers-param-title','s:145:\"en:Which category to enumerate (required). Must include the <kbd>{{ns:category}}:</kbd> prefix. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+categorymembers-param-type','s:94:\"en:Which type of category members to include. Ignored when <kbd>$1sort=timestamp</kbd> is set.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-ids','s:20:\"en:Adds the page ID.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-sortkey','s:74:\"en:Adds the sortkey used for sorting in the category (hexadecimal string).\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-sortkeyprefix','s:97:\"en:Adds the sortkey prefix used for sorting in the category (human-readable part of the sortkey).\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-timestamp','s:52:\"en:Adds the timestamp of when the page was included.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-title','s:47:\"en:Adds the title and namespace ID of the page