butors to a page.\";'),('en','messages:apihelp-query+deletedrevisions-example-revids','s:63:\"en:List the information for deleted revision <kbd>123456</kbd>.\";'),('en','messages:apihelp-query+deletedrevisions-example-titles','s:101:\"en:List the deleted revisions of the pages [[{{MediaWiki:Mainpage}}]] and its talk page with content.\";'),('en','messages:apihelp-query+deletedrevisions-extended-description','s:239:\"en:May be used in several ways:\n# Get deleted revisions for a set of pages, by setting titles or pageids. Ordered by title and timestamp.\n# Get data about a set of deleted revisions by setting their IDs with revids. Ordered by revision ID.\";'),('en','messages:apihelp-query+deletedrevisions-param-end','s:88:\"en:The timestamp to stop enumerating at. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-excludeuser','s:37:\"en:Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-param-start','s:91:\"en:The timestamp to start enumerating from. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-tag','s:44:\"en:Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevisions-param-user','s:36:\"en:Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-summary','s:36:\"en:Get deleted revision information.\";'),('en','messages:apihelp-query+deletedrevs-example-mode1','s:128:\"en:List the last deleted revisions of the pages [[{{MediaWiki:Mainpage}}]] and <kbd>Talk:Main Page</kbd>, with content (mode 1).\";'),('en','messages:apihelp-query+deletedrevs-example-mode2','s:69:\"en:List the last 50 deleted contributions by <kbd>Bob</kbd> (mode 2).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-main','s:70:\"en:List the first 50 deleted revisions in the main namespace (mode 3).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-talk','s:73:\"en:List the first 50 deleted pages in the {{ns:talk}} namespace (mode 3).\";'),('en','messages:apihelp-query+deletedrevs-extended-description','s:381:\"en:Operates in three modes:\n# List deleted revisions for the given titles, sorted by timestamp.\n# List deleted contributions for the given user, sorted by timestamp (no titles specified).\n# List all deleted revisions in the given namespace, sorted by title and timestamp (no titles specified, $1user not set).\n\nCertain parameters only apply to some modes and are ignored in others.\";'),('en','messages:apihelp-query+deletedrevs-param-end','s:40:\"en:The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+deletedrevs-param-excludeuser','s:37:\"en:Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-param-from','s:31:\"en:Start listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-limit','s:98:\"en:The maximum amount of revisions to list. If <var>$2prop=content</var> is used, the limit is $1.\";'),('en','messages:apihelp-query+deletedrevs-param-namespace','s:37:\"en:Only list pages in this namespace.\";'),('en','messages:apihelp-query+deletedrevs-param-prefix','s:57:\"en:Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+deletedrevs-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+deletedrevs-param-start','s:43:\"en:The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+deletedrevs-param-tag','s:44:\"en:Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevs-param-to','s:30:\"en:Stop listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-unique','s:40:\"en:List only one revision for each page.\";'),('en','messages:apihelp-query+deletedrevs-param-user','s:36:\"en:Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-paraminfo-modes','s:31:\"en:{{PLURAL:$1|Mode|Modes}}: $2\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-comment','s:36:\"en:Adds the comment of the revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-content','s:123:\"en:Adds the content of the revision. For performance reasons, if this option is used, <var>$2limit</var> is enforced to $1.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-len','s:43:\"en:Adds the length (bytes) of the revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-minor','s:33:\"en:Tags if the revision is minor.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-parentid','s:61:\"en:Adds the revision ID of the previous revision to the page.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-parsedcomment','s:43:\"en:Adds the parsed comment of the revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-revid','s:48:\"en:Adds the revision ID of the deleted revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-sha1','s:44:\"en:Adds the SHA-1 (base 16) of the revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-tags','s:25:\"en:Tags for the revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-token','s:24:\"en:Gives the edit token.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-user','s:39:\"en:Adds the user who made the revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-userid','s:49:\"en:Adds the ID of the user who made the revision.\";'),('en','messages:apihelp-query+deletedrevs-summary','s:26:\"en:List deleted revisions.\";'),('en','messages:apihelp-query+disabled-summary','s:39:\"en:This query module has been disabled.\";'),('en','messages:apihelp-query+duplicatefiles-example-generated','s:36:\"en:Look for duplicates of all files.\";'),('en','messages:apihelp-query+duplicatefiles-example-simple','s:61:\"en:Look for duplicates of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+duplicatefiles-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+duplicatefiles-param-limit','s:38:\"en:How many duplicate files to return.\";'),('en','messages:apihelp-query+duplicatefiles-param-localonly','s:47:\"en:Look only for files in the local repository.\";'),('en','messages:apihelp-query+duplicatefiles-summary','s:78:\"en:List all files that are duplicates of the given files based on hash values.\";'),('en','messages:apihelp-query+embeddedin-example-generator','s:69:\"en:Get information about pages transcluding <kbd>Template:Stub</kbd>.\";'),('en','messages:apihelp-query+embeddedin-example-simple','s:52:\"en:Show pages transcluding <kbd>Template:Stub</kbd>.\";'),('en','messages:apihelp-query+embeddedin-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+embeddedin-param-filterredir','s:31:\"en:How to filter for redirects.\";'),('en','messages:apihelp-query+embeddedin-param-limit','s:34:\"en:How many total pages to return.\";'),('en','messages:apihelp-query+embeddedin-param-namespace','s:30:\"en:The namespace to enumerate.\";'),('en','messages:apihelp-query+embeddedin-param-pageid','s:59:\"en:Page ID to search. Cannot be used together with $1title.\";'),('en','messages:apihelp-query+embeddedin-param-title','s:58:\"en:Title to search. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-query+embeddedin-summary','s:58:\"en:Find all pages that embed (transclude) the given title.\";'),('en','messages:apihelp-query+extlinks-example-simple','s:71:\"en:Get a list of external links on the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+extlinks-param-expandurl','s:61:\"en:Expand protocol-relative URLs with the canonical protocol.\";'),('en','messages:apihelp-query+extlinks-param-limit','s:28:\"en:How many links to return.\";'),('en','messages:apihelp-query+extlinks-param-protocol','s:190:\"en:Protocol of the URL. If empty and <var>$1query</var> is set, the protocol is <kbd>http</kbd> and <kbd>https</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('en','messages:apihelp-query+extlinks-param-query','s:110:\"en:Search string without protocol. Useful for checking whether a certain page contains a certain external url.\";'),('en','messages:apihelp-query+extlinks-summary','s:67:\"en:Returns all external URLs (not interwikis) from the given pages.\";'),('en','messages:apihelp-query+exturlusage-example-simple','s:62:\"en:Show pages linking to <kbd>https://www.mediawiki.org</kbd>.\";'),('en','messages:apihelp-query+exturlusage-param-expandurl','s:61:\"en:Expand protocol-relative URLs with the canonical protocol.\";'),('en','messages:apihelp-query+exturlusage-param-limit','s:28:\"en:How many pages to return.\";'),('en','messages:apihelp-query+exturlusage-param-namespace','s:36:\"en:The page namespaces to enumerate.\";'),('en','messages:apihelp-query+exturlusage-param-prop','s:42:\"en:Which pieces of information to include:\";'),('en','messages:apihelp-query+exturlusage-param-protocol','s:190:\"en:Protocol of the URL. If empty and <var>$1query</var> is set, the protocol is <kbd>http</kbd> and <kbd>https</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('en','messages:apihelp-query+exturlusage-param-query','s:102:\"en:Search string without protocol. See [[Special:LinkSearch]]. Leave empty to list all external links.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-ids','s:23:\"en:Adds the ID of page.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-title','s:47:\"en:Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-url','s:33:\"en:Adds the URL used in the page.\";'),('en','messages:apihelp-query+exturlusage-summary','s:44:\"en:Enumerate pages that contain a given URL.\";'),('en','messages:apihelp-query+filearchive-example-simple','s:36:\"en:Show a list of all deleted files.\";