),('en','messages:apihelp-query+filearchive-paramvalue-prop-size','s:92:\"en:Adds the size of the image in bytes and the height, width and page count (if applicable).\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-timestamp','s:43:\"en:Adds timestamp for the uploaded version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-user','s:44:\"en:Adds user who uploaded the image version.\";'),('en','messages:apihelp-query+filearchive-summary','s:44:\"en:Enumerate all deleted files sequentially.\";'),('en','messages:apihelp-query+filerepoinfo-example-simple','s:43:\"en:Get information about file repositories.\";'),('en','messages:apihelp-query+filerepoinfo-param-prop','s:85:\"en:Which repository properties to get (properties available may vary on other wikis).\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-apiurl','s:76:\"en:URL to the repository API - helpful for getting image info from the host.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-articlepath','s:109:\"en:Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgArticlePath|$wgArticlePath]]</var> or equivalent.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-canUpload','s:93:\"en:Whether files can be uploaded to this repository, e.g. via CORS and shared authentication.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-displayname','s:50:\"en:The human-readable name of the repository wiki.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-favicon','s:105:\"en:Repository wiki\'s favicon URL, from <var>[[mw:Special:MyLanguage/Manual:$wgFavicon|$wgFavicon]]</var>.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-fetchDescription','s:109:\"en:Whether file description pages are fetched from this repository when viewing local file description pages.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-initialCapital','s:61:\"en:Whether file names implicitly start with a capital letter.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-local','s:51:\"en:Whether that repository is the local one or not.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-name','s:192:\"en:The key of the repository - used in e.g. <var>[[mw:Special:MyLanguage/Manual:$wgForeignFileRepos|$wgForeignFileRepos]]</var> and [[Special:ApiHelp/query+imageinfo|imageinfo]] return values.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-rootUrl','s:33:\"en:Root URL path for image paths.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-scriptDirUrl','s:66:\"en:Root URL path for the repository wiki\'s MediaWiki installation.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-server','s:99:\"en:Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgServer|$wgServer]]</var> or equivalent.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-thumbUrl','s:37:\"en:Root URL path for thumbnail paths.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-url','s:24:\"en:Public zone URL path.\";'),('en','messages:apihelp-query+filerepoinfo-summary','s:75:\"en:Return meta information about image repositories configured on the wiki.\";'),('en','messages:apihelp-query+fileusage-example-generator','s:59:\"en:Get information about pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-example-simple','s:51:\"en:Get a list of pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-param-limit','s:22:\"en:How many to return.\";'),('en','messages:apihelp-query+fileusage-param-namespace','s:42:\"en:Only include pages in these namespaces.\";'),('en','messages:apihelp-query+fileusage-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+fileusage-param-show','s:44:\"en:Show only items that meet these criteria:\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-pageid','s:24:\"en:Page ID of each page.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-redirect','s:34:\"en:Flag if the page is a redirect.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-title','s:22:\"en:Title of each page.\";'),('en','messages:apihelp-query+fileusage-paramvalue-show-!redirect','s:27:\"en:Only show non-redirects.\";'),('en','messages:apihelp-query+fileusage-paramvalue-show-redirect','s:23:\"en:Only show redirects.\";'),('en','messages:apihelp-query+fileusage-summary','s:43:\"en:Find all pages that use the given files.\";'),('en','messages:apihelp-query+imageinfo-example-dated','s:78:\"en:Fetch information about versions of [[:File:Test.jpg]] from 2008 and later.\";'),('en','messages:apihelp-query+imageinfo-example-simple','s:85:\"en:Fetch information about the current version of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageinfo-param-badfilecontexttitle','s:116:\"en:If <kbd>$2prop=badfile</kbd> is set, this is the page title used when evaluating the [[MediaWiki:Bad image list]]\";'),('en','messages:apihelp-query+imageinfo-param-end','s:32:\"en:Timestamp to stop listing at.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatafilter','s:87:\"en:If specified and non-empty, only these keys will be returned for $1prop=extmetadata.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatalanguage','s:183:\"en:What language to fetch extmetadata in. This affects both which translation to fetch, if multiple are available, as well as how things like numbers and various values are formatted.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatamultilang','s:77:\"en:If translations for extmetadata property are available, fetch all of them.\";'),('en','messages:apihelp-query+imageinfo-param-limit','s:46:\"en:How many file revisions to return per file.\";'),('en','messages:apihelp-query+imageinfo-param-localonly','s:47:\"en:Look only for files in the local repository.\";'),('en','messages:apihelp-query+imageinfo-param-metadataversion','s:139:\"en:Version of metadata to use. If <kbd>latest</kbd> is specified, use latest version. Defaults to <kbd>1</kbd> for backwards compatibility.\";'),('en','messages:apihelp-query+imageinfo-param-prop','s:33:\"en:Which file information to get:\";'),('en','messages:apihelp-query+imageinfo-param-start','s:35:\"en:Timestamp to start listing from.\";'),('en','messages:apihelp-query+imageinfo-param-urlheight','s:25:\"en:Similar to $1urlwidth.\";'),('en','messages:apihelp-query+imageinfo-param-urlparam','s:173:\"en:A handler specific parameter string. For example, PDFs might use <kbd>page15-100px</kbd>. <var>$1urlwidth</var> must be used and be consistent with <var>$1urlparam</var>.\";'),('en','messages:apihelp-query+imageinfo-param-urlwidth','s:177:\"en:If $2prop=url is set, a URL to an image scaled to this width will be returned.\nFor performance reasons if this option is used, no more than $1 scaled images will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-archivename','s:160:\"en:Adds the filename of the archive version for non-latest versions. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-badfile','s:63:\"en:Adds whether the file is on the [[MediaWiki:Bad image list]]\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-bitdepth','s:129:\"en:Adds the bit depth of the version. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-canonicaltitle','s:132:\"en:Adds the canonical title of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-comment','s:124:\"en:Comment on the version. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-commonmetadata','s:158:\"en:Lists file format generic metadata for the version of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-dimensions','s:18:\"en:Alias for size.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-extmetadata','s:179:\"en:Lists formatted metadata combined from multiple sources. Results are HTML formatted. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-mediatype','s:127:\"en:Adds the media type of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-metadata','s:143:\"en:Lists Exif metadata for the version of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-mime','s:122:\"en:Adds MIME type of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-parsedcomment','s:134:\"en:Parse the comment on the version. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-sha1','s:124:\"en:Adds SHA-1 hash for the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-size','s:91:\"en:Adds the size of the file in bytes and the height, width and page count (if applicable).\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-thumbmime','s:169:\"en:Adds MIME type of the image thumbnail (requires url and param $1urlwidth). If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-timestamp','s:43:\"en:Adds timestamp for the uploaded version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-uploadwarning','s:122:\"en:Used by the Special:Upload page to get information about an existing file. Not intended for use outside MediaWiki core.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-url','s:142:\"en:Gives URL to the file and the description page. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-user','s:140:\"en:Adds the user who uploaded each file version. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-userid','s:150:\"en:Add the ID of the user that uploaded each file version. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-summary','s:47:\"en:Returns file information and upload history.\";'),('en','messages:apihelp-query+images-example-generator','s:79:\"en:Get information about all files used on the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+images-example-simple','s:67:\"en:Get a list of files used on the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+images-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+images-param-images','s:88:\"en:Only list these files. Useful for checking whether a certain page has a certain file.\";'),('en','messages:apihelp-query+images-param-limit','s:28:\"en:How many files to return.\";'),('en','messages:apihelp-query+images-summary','s:50:\"en:Returns all files contained on the given pages.\";'),('en','messages:apihelp-query+imageusage-example-generator','s:72:\"en:Get information about pages using [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageusage-example-simple','s:55:\"en:Show pages using [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageusage-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+imageusage-param-filterredir','s:124:\"en:How to filter for redirects. If set to nonredirects when $1redirect is enabled, this is only applied to the second level.\";'),('en','messages:apihelp-query+imageusage-param-limit','s:182:\"en:How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+imageusage-param-namespace','s:30:\"en:The namespace to enumerate.\";'),('en','messages:apihelp-query+imageusage-param-pageid','s:59:\"en:Page ID to search. Cannot be used together with $1title.\";'),('en','messages:apihelp-query+imageusage-param-redirect','s:109:\"en:If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('en','messages:apihelp-query+imageusage-param-title','s:58:\"en:Title to search. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-query+imageusage-summary','s:49:\"en:Find all pages that use the given image title.\";'),('en','messages:apihelp-query+info-example-protection','s:84:\"en:Get general and protection information about the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+info-example-simple','s:61:\"en:Get information about the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+info-param-editintrocustom','s:64:\"en:Title of a custom page to use as an additional intro message.\";'),('en','messages:apihelp-query+info-param-editintroskip','s:169:\"en:List of intro messages to remove from the response. Use this if a specific message is not relevant to your tool, or if the information is conveyed in a different way.\";'),('en','messages:apihelp-query+info-param-editintrostyle','s:138:\"en:Some intro messages come with optional wrapper frames. Use <kbd>moreframes</kbd> to include them or <kbd>lessframes</kbd> to omit them.\";'),('en','messages:apihelp-query+info-param-linkcontext','s:137:\"en:The context title to use when determining extra CSS classes (e.g. link colors) when <var>$1prop</var> contains <var>linkclasses</var>.\";'),('en','messages:apihelp-query+info-param-preloadcustom','s:54:\"en:Title of a custom page to use as preloaded content.\";'),('en','messages:apihelp-query+info-param-preloadnewsection','s:82:\"en:Return preloaded content for a new section on the page, rather than a new page.\";'),('en','messages:apihelp-query+info-param-preloadparams','s:66:\"en:Parameters for the custom page being used as preloaded content.\";'),('en','messages:apihelp-query+info-param-prop','s:38:\"en:Which additional properties to get:\";'),('en','messages:apihelp-query+info-param-testactions','s:73:\"en:Test whether the current user can perform certain actions on the page.\";'),('en','messages:apihelp-query+info-param-testactionsautocreate','s:99:\"en:Test whether performing <var>$1testactions</var> would automatically create a temporary account.\";'),('en','messages:apihelp-query+info-param-testactionsdetail','s:199:\"en:Detail level for <var>$1testactions</var>. Use the [[Special:ApiHelp/main|main module]]\'s <var>errorformat</var> and <var>errorlang</var> parameters to control the format of the messages returned.\";'),('en','messages:apihelp-query+info-paraminfo-editintroonly','s:66:\"en:Only used when <var>$3prop</var> contains <var>editintro</var>.\";'),('en','messages:apihelp-query+info-paraminfo-preloadcontentonly','s:71:\"en:Only used when <var>$3prop</var> contains <var>preloadcontent</var>.\";'),('en','messages:apihelp-query+info-paramvalue-prop-associatedpage','s:110:\"en:The prefixed title of the [[:mw:Special:MyLanguage/Help:Associated_pages|associated subject or talk page]].\";'),('en','messages:apihelp-query+info-paramvalue-prop-displaytitle','s:66:\"en:Gives the manner in which the page title is actually displayed.\";'),('en','messages:apihelp-query+info-paramvalue-prop-editintro','s:106:\"en:Gives the intro messages that should be shown to the user while editing this page or revision, as HTML.\";'),('en','messages:apihelp-query+info-paramvalue-prop-linkclasses','s:152:\"en:Gives the additional CSS classes (e.g. link colors) used for links to this page if they were to appear on the page named by <var>$1linkcontext</var>.\";'),('en','messages:apihelp-query+info-paramvalue-prop-notificationtimestamp','s:53:\"en:The watchlist notification timestamp of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-preload','s:139:\"en:Gives the text returned by EditFormPreloadText. Use <kbd>preloadcontent</kbd> instead, which supports other kinds of preloaded text too.\";'),('en','messages:apihelp-query+info-paramvalue-prop-preloadcontent','s:106:\"en:Gives the content to be shown in the editor when the page does not exist or while adding a new section.\";'),('en','messages:apihelp-query+info-paramvalue-prop-protection','s:42:\"en:List the protection level of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-readable','s:82:\"en:Whether the user can read this page. Use <kbd>intestactions=read</kbd> instead.\";'),('en','messages:apihelp-query+info-paramvalue-prop-subjectid','s:53:\"en:The page ID of the parent page for each talk page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-talkid','s:55:\"en:The page ID of the talk page for each non-talk page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-url','s:70:\"en:Gives a full URL, an edit URL, and the canonical URL for each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-varianttitles','s:72:\"en:Gives the display title in all variants of the site content language.\";'),('en','messages:apihelp-query+info-paramvalue-prop-visitingwatchers','s:94:\"en:The number of watchers of each page who have visited recent edits to that page, if allowed.\";'),('en','messages:apihelp-query+info-paramvalue-prop-watched','s:40:\"en:List the watched status of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-watchers','s:38:\"en:The number of watchers, if allowed.\";'),('en','messages:apihelp-query+info-paramvalue-testactionsdetail-boolean','s:42:\"en:Return a boolean value for each action.\";'),('en','messages:apihelp-query+info-paramvalue-testactionsdetail-full','s:95:\"en:Return messages describing why the action is disallowed, or an empty array if it is allowed.\";'),('en','messages:apihelp-query+info-paramvalue-testactionsdetail-quick','s:54:\"en:Like <kbd>full</kbd> but skipping expensive checks.\";'),('en','messages:apihelp-query+info-summary','s:30:\"en:Get basic page information.\";'),('en','messages:apihelp-query+iwbacklinks-example-generator','s:61:\"en:Get information about pages linking to [[wikibooks:Test]].\";'),('en','messages:apihelp-query+iwbacklinks-example-simple','s:43:\"en:Get pages linking to [[wikibooks:Test]].\";'),('en','messages:apihelp-query+iwbacklinks-extended-description','s:156:\"en:Can be used to find all links with a prefix, or all links to a title (with a given prefix). Using neither parameter is effectively \"all interwiki links\".\";'),('en','messages:apihelp-query+iwbacklinks-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+iwbacklinks-param-limit','s:34:\"en:How many total pages to return.\";'),('en','messages:apihelp-query+iwbacklinks-param-prefix','s:28:\"en:Prefix for the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+iwbacklinks-param-title','s:73:\"en:Interwiki link to search for. Must be used with <var>$1blprefix</var>.\";'),('en','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwprefix','s:36:\"en:Adds the prefix of the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwtitle','s:35:\"en:Adds the title of the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-summary','s:56:\"en:Find all pages that link to the given interwiki link.\";'),('en','messages:apihelp-query+iwlinks-example-simple','s:64:\"en:Get interwiki links from the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+iwlinks-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+iwlinks-param-limit','s:38:\"en:How many interwiki links to return.\";'),('en','messages:apihelp-query+iwlinks-param-prefix','s:48:\"en:Only return interwiki links with this prefix.\";'),('en','messages:apihelp-query+iwlinks-param-prop','s:62:\"en:Which additional properties to get for each interwiki link:\";'),('en','messages:apihelp-query+iwlinks-param-title','s:71:\"en:Interwiki link to search for. Must be used with <var>$1prefix</var>.\";'),('en','messages:apihelp-query+iwlinks-param-url','s:60:\"en:Whether to get the full URL (cannot be used with $1prop).\";'),('en','messages:apihelp-query+iwlinks-paramvalue-prop-url','s:21:\"en:Adds the full URL.\";'),('en','messages:apihelp-query+iwlinks-summary','s:52:\"en:Returns all interwiki links from the given pages.\";'),('en','messages:apihelp-query+langbacklinks-example-generator','s:55:\"en:Get information about pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langbacklinks-example-simple','s:37:\"en:Get pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langbacklinks-extended-description','s:233:\"en:Can be used to find all links with a language code, or all links to a title (with a given language). Using neither parameter is effectively \"all language links\".\n\nNote that this may not consider language links added by extensions.\";'),('en','messages:apihelp-query+langbacklinks-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+langbacklinks-param-lang','s:34:\"en:Language for the language link.\";'),('en','messages:apihelp-query+langbacklinks-param-limit','s:34:\"en:How many total pages to return.\";'),('en','messages:apihelp-query+langbacklinks-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+langbacklinks-param-title','s:57:\"en:Language link to search for. Must be used with $1lang.\";'),('en','messages:apihelp-query+langbacklinks-paramvalue-prop-lllang','s:47:\"en:Adds the language code of the language link.\";'),('en','messages:apihelp-query+langbacklinks-paramvalue-prop-lltitle','s:39:\"en:Adds the title of the language link.\";'),('en','messages:apihelp-query+langbacklinks-summary','s:55:\"en:Find all pages that link to the given language link.\";'),('en','messages:apihelp-query+langlinks-example-simple','s:68:\"en:Get interlanguage links from the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+langlinks-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+langlinks-param-inlanguagecode','s:46:\"en:Language code for localised language names.\";'),('en','messages:apihelp-query+langlinks-param-lang','s:54:\"en:Only return language links with this language code.\";'),('en','messages:apihelp-query+langlinks-param-limit','s:32:\"en:How many langlinks to return.\";'),('en','messages:apihelp-query+langlinks-param-prop','s:66:\"en:Which additional properties to get for each interlanguage link:\";'),('en','messages:apihelp-query+langlinks-param-title','s:59:\"en:Link to search for. Must be used with <var>$1lang</var>.\";'),('en','messages:apihelp-query+langlinks-param-url','s:71:\"en:Whether to get the full URL (cannot be used with <var>$1prop</var>).\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-autonym','s:33:\"en:Adds the native language name.\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-langname','s:107:\"en:Adds the localised language name (best effort). Use <var>$1inlanguagecode</var> to control the language.\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-url','s:21:\"en:Adds the full URL.\";'),('en','messages:apihelp-query+langlinks-summary','s:56:\"en:Returns all interlanguage links from the given pages.\";'),('en','messages:apihelp-query+languageinfo-example-autonym-name-de','s:64:\"en:Get the autonyms and German names of all supported languages.\";'),('en','messages:apihelp-query+languageinfo-example-bcp47-dir','s:73:\"en:Get the BCP-47 language code and direction of all supported languages.\";'),('en','messages:apihelp-query+languageinfo-example-fallbacks-variants-oc','s:54:\"en:Get the fallback languages and variants of Occitan.\";'),('en','messages:apihelp-query+languageinfo-example-simple','s:53:\"en:Get the language codes of all supported languages.\";'),('en','messages:apihelp-query+languageinfo-extended-description','s:131:\"en:[[mw:Special:MyLanguage/API:Continue|Continuation]] may be applied if retrieving the information takes too long for one request.\";'),('en','messages:apihelp-query+languageinfo-param-code','s:96:\"en:Language codes of the languages that should be returned, or <code>*</code> for all languages.\";'),('en','messages:apihelp-query+languageinfo-param-prop','s:46:\"en:Which information to get for each language.\";'),('en','messages:apihelp-query+languageinfo-paramvalue-prop-autonym','s:67:\"en:The autonym of the language, that is, the name in that language.\";'),('en','messages:apihelp-query+languageinfo-paramvalue-prop-bcp47','s:28:\"en:The BCP-47 language code.\";'),('en','messages:apihelp-query+languageinfo-paramvalue-prop-code','s:104:\"en:The language code. (This code is MediaWiki-specific, though there are overlaps with other standards.)\";'),('en','messages:apihelp-query+languageinfo-paramvalue-prop-dir','s:87:\"en:The writing direction of the language (either <code>ltr</code> or <code>rtl</code>).\";'),('en','messages:apihelp-query+languageinfo-paramvalue-prop-fallbacks','s:184:\"en:The language codes of the fallback languages configured for this language. The implicit final fallback to \'en\' is not included (but some languages may fall back to \'en\' explicitly).\";'),('en','messages:apihelp-query+languageinfo-paramvalue-prop-name','s:136:\"en:The name of the language in the language specified by the <var>uselang</var> parameter, with language fallbacks applied if necessary.\";'),('en','messages:apihelp-query+languageinfo-paramvalue-prop-variantnames','s:76:\"en:The short names for language variants used for language conversion links.\";'),('en','messages:apihelp-query+languageinfo-paramvalue-prop-variants','s:65:\"en:The language codes of the variants supported by this language.\";'),('en','messages:apihelp-query+languageinfo-summary','s:48:\"en:Return information about available languages.\";'),('en','messages:apihelp-query+links-example-generator','s:79:\"en:Get information about the link pages in the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+links-example-namespaces','s:104:\"en:Get links from the page [[{{MediaWiki:Mainpage}}]] in the {{ns:user}} and {{ns:template}} namespaces.\";'),('en','messages:apihelp-query+links-example-simple','s:53:\"en:Get links from the page [[{{MediaWiki:Mainpage}}]]\";'),('en','messages:apihelp-query+links-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+links-param-limit','s:28:\"en:How many links to return.\";'),('en','messages:apihelp-query+links-param-namespace','s:39:\"en:Show links in these namespaces only.\";'),('en','messages:apihelp-query+links-param-titles','s:104:\"en:Only list links to these titles. Useful for checking whether a certain page links to a certain title.\";'),('en','messages:apihelp-query+links-summary','s:42:\"en:Returns all links from the given pages.\";'),('en','messages:apihelp-query+linkshere-example-generator','s:73:\"en:Get information about pages linking to the [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+linkshere-example-simple','s:65:\"en:Get a list of pages linking to the [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+linkshere-param-limit','s:22:\"en:How many to return.\";'),('en','messages:apihelp-query+linkshere-param-namespace','s:42:\"en:Only include pages in these namespaces.\";'),('en','messages:apihelp-query+linkshere-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+linkshere-param-show','s:44:\"en:Show only items that meet these criteria:\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-pageid','s:24:\"en:Page ID of each page.\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-redirect','s:34:\"en:Flag if the page is a redirect.\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-title','s:22:\"en:Title of each page.\";'),('en','messages:apihelp-query+linkshere-paramvalue-show-!redirect','s:27:\"en:Only show non-redirects.\";'),('en','messages:apihelp-query+linkshere-paramvalue-show-redirect','s:23:\"en:Only show redirects.\";'),('en','messages:apihelp-query+linkshere-summary','s:47:\"en:Find all pages that link to the given pages.\";'),('en','messages:apihelp-query+linterrors-example-1','s:51:\"en:Get all lint errors of the obsolete-tag category\";'),('en','messages:apihelp-query+linterrors-param-categories','s:28:\"en:Categories of lint errors\";'),('en','messages:apihelp-query+linterrors-param-from','s:33:\"en:Lint ID to start querying from\";'),('en','messages:apihelp-query+linterrors-param-invisible-categories','s:38:\"en:Invisible categories of lint errors\";'),('en','messages:apihelp-query+linterrors-param-limit','s:29:\"en:Number of results to query\";'),('en','messages:apihelp-query+linterrors-param-namespace','s:57:\"en:Only include lint errors from the specified namespaces\";'),('en','messages:apihelp-query+linterrors-param-pageid','s:55:\"en:Only include lint errors from the specified page IDs\";'),('en','messages:apihelp-query+linterrors-param-title','s:57:\"en:Only include lint errors from the specified page title\";'),('en','messages:apihelp-query+linterrors-summary','s:28:\"en:Get a list of lint errors\";'),('en','messages:apihelp-query+linterstats-example-1','s:45:\"en:Get number of lint errors in each category\";'),('en','messages:apihelp-query+linterstats-summary','s:45:\"en:Get number of lint errors in each category\";'),('en','messages:apihelp-query+logevents-example-simple','s:26:\"en:List recent log events.\";'),('en','messages:apihelp-query+logevents-param-action','s:213:\"en:Filter log actions to only this action. Overrides <var>$1type</var>. In the list of possible values, values with the asterisk wildcard such as <kbd>action/*</kbd> can have different strings after the slash (/).\";'),('en','messages:apihelp-query+logevents-param-end','s:36:\"en:The timestamp to end enumerating.\";'),('en','messages:apihelp-query+logevents-param-limit','s:42:\"en:How many total event entries to return.\";'),('en','messages:apihelp-query+logevents-param-namespace','s:50:\"en:Filter entries to those in the given namespace.\";'),('en','messages:apihelp-query+logevents-param-prefix','s:46:\"en:Filter entries that start with this prefix.\";'),('en','messages:apihelp-query+logevents-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+logevents-param-start','s:43:\"en:The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+logevents-param-tag','s:48:\"en:Only list event entries tagged with this tag.\";'),('en','messages:apihelp-query+logevents-param-title','s:45:\"en:Filter entries to those related to a page.\";'),('en','messages:apihelp-query+logevents-param-type','s:40:\"en:Filter log entries to only this type.\";'),('en','messages:apihelp-query+logevents-param-user','s:50:\"en:Filter entries to those made by the given user.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-comment','s:135:\"en:Adds the comment of the log event. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-details','s:148:\"en:Lists additional details about the log event. If the log event has been revision deleted, an <samp>actionhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-ids','s:32:\"en:Adds the ID of the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-parsedcomment','s:142:\"en:Adds the parsed comment of the log event. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-tags','s:32:\"en:Lists tags for the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-timestamp','s:40:\"en:Adds the timestamp for the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-title','s:48:\"en:Adds the title of the page for the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-type','s:30:\"en:Adds the type of log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-user','s:139:\"en:Adds the user responsible for the log event. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-userid','s:150:\"en:Adds the user ID who was responsible for the log event. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+logevents-summary','s:24:\"en:Get events from logs.\";'),('en','messages:apihelp-query+mathwbextracts-example-1','s:53:\"en:Requests a summary of mathematical Wikibase items.\";'),('en','messages:apihelp-query+mathwbextracts-param-qid','s:55:\"en:The QID of the Wikibase item that will be requested.\";'),('en','messages:apihelp-query+mathwbextracts-param-uselang','s:93:\"en:The language that should be requested for the Wikibase item. English is the default value.\";'),('en','messages:apihelp-query+mathwbextracts-summary','s:61:\"en:Returns a summary of a mathematical Wikibase item in HTML.\";'),('en','messages:apihelp-query+mystashedfiles-example-simple','s:90:\"en:Get the filekey, file size, and pixel size of files in the current user\'s upload stash.\";'),('en','messages:apihelp-query+mystashedfiles-param-limit','s:25:\"en:How many files to get.\";'),('en','messages:apihelp-query+mystashedfiles-param-prop','s:43:\"en:Which properties to fetch for the files.\";'),('en','messages:apihelp-query+mystashedfiles-paramvalue-prop-size','s:44:\"en:Fetch the file size and image dimensions.\";'),('en','messages:apihelp-query+mystashedfiles-paramvalue-prop-type','s:45:\"en:Fetch the file\'s MIME type and media type.\";'),('en','messages:apihelp-query+mystashedfiles-summary','s:58:\"en:Get a list of files in the current user\'s upload stash.\";'),('en','messages:apihelp-query+notifications-example-1','s:25:\"en:List web notifications\";'),('en','messages:apihelp-query+notifications-example-2','s:58:\"en:List web notifications, grouped by section, with counts\";'),('en','messages:apihelp-query+notifications-example-3','s:27:\"en:List email notifications\";'),('en','messages:apihelp-query+notifications-param-alertcontinue','s:63:\"en:When more alert results are available, use this to continue.\";'),('en','messages:apihelp-query+notifications-param-alertunreadfirst','s:91:\"en:Whether to show unread message notifications first (only used if groupbysection is set).\";'),('en','messages:apihelp-query+notifications-param-bundle','s:105:\"en:Whether to show bundle compatible unread notifications according to notification types bundling rules.\";'),('en','messages:apihelp-query+notifications-param-crosswikisummary','s:78:\"en:True to opt in to a summary notification of notifications on foreign wikis.\";'),('en','messages:apihelp-query+notifications-param-filter','s:33:\"en:Filter notifications returned.\";'),('en','messages:apihelp-query+notifications-param-format','s:67:\"en:If specified, notifications will be returned formatted this way.\";'),('en','messages:apihelp-query+notifications-param-groupbysection','s:85:\"en:Whether to group the result by section. Each section is fetched separately if set.\";'),('en','messages:apihelp-query+notifications-param-limit','s:49:\"en:The maximum number of notifications to return.\";'),('en','messages:apihelp-query+notifications-param-messagecontinue','s:65:\"en:When more message results are available, use this to continue.\";'),('en','messages:apihelp-query+notifications-param-messageunreadfirst','s:89:\"en:Whether to show unread alert notifications first (only used if groupbysection is set).\";'),('en','messages:apihelp-query+notifications-param-notifiertypes','s:52:\"en:Notifier types for which to return notifications.\";'),('en','messages:apihelp-query+notifications-param-prop','s:22:\"en:Details to request.\";'),('en','messages:apihelp-query+notifications-param-sections','s:87:\"en:The notification sections to query (i.e. some combination of \'alert\' and \'message\').\";'),('en','messages:apihelp-query+notifications-param-titles','s:115:\"en:Only return notifications for these pages. To get notifications not associated with any page, use [] as a title.\";'),('en','messages:apihelp-query+notifications-param-unreadfirst','s:87:\"en:Whether to show unread notifications first (only used if groupbysection is not set).\";'),('en','messages:apihelp-query+notifications-param-wikis','s:77:\"en:List of wikis to fetch notifications from (defaults to only current wiki).\";'),('en','messages:apihelp-query+notifications-paramvalue-format-flyout','s:97:\"en:<span class=\"apihelp-deprecated\">Deprecated</span>. Use <kbd>$1format=model</kbd> for raw data\";'),('en','messages:apihelp-query+notifications-paramvalue-format-html','s:97:\"en:<span class=\"apihelp-deprecated\">Deprecated</span>. Use <kbd>$1format=model</kbd> for raw data\";'),('en','messages:apihelp-query+notifications-paramvalue-format-model','s:24:\"en:Raw notification data\";'),('en','messages:apihelp-query+notifications-paramvalue-format-special','s:120:\"en:Formatted for Special:Notifications page (and only that!) Do not rely on the HTML as it may change at any given time.\";'),('en','messages:apihelp-query+notifications-summary','s:50:\"en:Get notifications waiting for the current user.\";'),('en','messages:apihelp-query+pagepropnames-example-simple','s:31:\"en:Get first 10 property names.\";'),('en','messages:apihelp-query+pagepropnames-param-limit','s:41:\"en:The maximum number of names to return.\";'),('en','messages:apihelp-query+pagepropnames-summary','s:51:\"en:List all page property names in use on the wiki.\";'),('en','messages:apihelp-query+pageprops-example-simple','s:91:\"en:Get properties for the pages <kbd>{{MediaWiki:Mainpage}}</kbd> and <kbd>MediaWiki</kbd>.\";'),('en','messages:apihelp-query+pageprops-param-prop','s:218:\"en:Only list these page properties (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use). Useful for checking whether pages use a certain page property.\";'),('en','messages:apihelp-query+pageprops-summary','s:59:\"en:Get various page properties defined in the page content.\";'),('en','messages:apihelp-query+pageswithprop-example-generator','s:92:\"en:Get additional information about the first 10 pages using <code>_&#95;NOTOC_&#95;</code>.\";'),('en','messages:apihelp-query+pageswithprop-example-simple','s:84:\"en:List the first 10 pages using <code>&#123;&#123;DISPLAYTITLE:&#125;&#125;</code>.\";'),('en','messages:apihelp-query+pageswithprop-param-dir','s:30:\"en:In which direction to sort.\";'),('en','messages:apihelp-query+pageswithprop-param-limit','s:41:\"en:The maximum number of pages to return.\";'),('en','messages:apihelp-query+pageswithprop-param-prop','s:42:\"en:Which pieces of information to include:\";'),('en','messages:apihelp-query+pageswithprop-param-propname','s:166:\"en:Page property for which to enumerate pages (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use).\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-ids','s:20:\"en:Adds the page ID.\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-title','s:47:\"en:Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-value','s:39:\"en:Adds the value of the page property.\";'),('en','messages:apihelp-query+pageswithprop-summary','s:46:\"en:List all pages using a given page property.\";'),('en','messages:apihelp-query+prefixsearch-example-simple','s:60:\"en:Search for page titles beginning with <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+prefixsearch-extended-description','s:511:\"en:Despite the similarity in names, this module is not intended to be equivalent to [[Special:PrefixIndex]]; for that, see <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd> with the <kbd>apprefix</kbd> parameter. The purpose of this module is similar to <kbd>[[Special:ApiHelp/opensearch|action=opensearch]]</kbd>: to take user input and provide the best-matching titles. Depending on the search engine backend, this might include typo correction, redirect avoidance, or other heuristics.\";'),('en','messages:apihelp-query+prefixsearch-param-limit','s:39:\"en:Maximum number of results to return.\";'),('en','messages:apihelp-query+prefixsearch-param-namespace','s:93:\"en:Namespaces to search. Ignored if <var>$1search</var> begins with a valid namespace prefix.\";'),('en','messages:apihelp-query+prefixsearch-param-offset','s:29:\"en:Number of results to skip.\";'),('en','messages:apihelp-query+prefixsearch-param-profile','s:25:\"en:Search profile to use.\";'),('en','messages:apihelp-query+prefixsearch-param-search','s:17:\"en:Search string.\";'),('en','messages:apihelp-query+prefixsearch-summary','s:43:\"en:Perform a prefix search for page titles.\";'),('en','messages:apihelp-query+protectedtitles-example-generator','s:56:\"en:Find links to protected titles in the main namespace.\";'),('en','messages:apihelp-query+protectedtitles-example-simple','s:25:\"en:List protected titles.\";'),('en','messages:apihelp-query+protectedtitles-param-end','s:45:\"en:Stop listing at this protection timestamp.\";'),('en','messages:apihelp-query+protectedtitles-param-level','s:49:\"en:Only list titles with these protection levels.\";'),('en','messages:apihelp-query+protectedtitles-param-limit','s:34:\"en:How many total pages to return.\";'),('en','messages:apihelp-query+protectedtitles-param-namespace','s:40:\"en:Only list titles in these namespaces.\";'),('en','messages:apihelp-query+protectedtitles-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+protectedtitles-param-start','s:46:\"en:Start listing at this protection timestamp.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-comment','s:39:\"en:Adds the comment for the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-expiry','s:60:\"en:Adds the timestamp of when the protection will be lifted.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-level','s:29:\"en:Adds the protection level.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-parsedcomment','s:46:\"en:Adds the parsed comment for the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-timestamp','s:51:\"en:Adds the timestamp of when protection was added.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-user','s:43:\"en:Adds the user that added the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-userid','s:46:\"en:Adds the user ID that added the protection.\";'),('en','messages:apihelp-query+protectedtitles-summary','s:43:\"en:List all titles protected from creation.\";'),('en','messages:apihelp-query+querypage-example-ancientpages','s:48:\"en:Return results from [[Special:Ancientpages]].\";'),('en','messages:apihelp-query+querypage-param-limit','s:31:\"en:Number of results to return.\";'),('en','messages:apihelp-query+querypage-param-page','s:62:\"en:The name of the special page. Note, this is case-sensitive.\";'),('en','messages:apihelp-query+querypage-summary','s:57:\"en:Get a list provided by a QueryPage-based special page.\";'),('en','messages:apihelp-query+random-example-generator','s:67:\"en:Return page info about two random pages from the main namespace.\";'),('en','messages:apihelp-query+random-example-minsize','s:102:\"en:Return page info about one random page from the main namespace that has at least 500 bytes of text.\";'),('en','messages:apihelp-query+random-example-simple','s:51:\"en:Return two random pages from the main namespace.\";'),('en','messages:apihelp-query+random-extended-description','s:301:\"en:Pages are listed in a fixed sequence, only the starting point is random. This means that if, for example, <samp>Main Page</samp> is the first random page in the list, <samp>List of fictional monkeys</samp> will <em>always</em> be second, <samp>List of people on stamps of Vanuatu</samp> third, etc.\";'),('en','messages:apihelp-query+random-param-contentmodel','s:54:\"en:Filter pages that have the specified content model.\";'),('en','messages:apihelp-query+random-param-filterredir','s:31:\"en:How to filter for redirects.\";'),('en','messages:apihelp-query+random-param-limit','s:48:\"en:Limit how many random pages will be returned.\";'),('en','messages:apihelp-query+random-param-maxsize','s:47:\"en:Limit to pages with at most this many bytes.\";'),('en','messages:apihelp-query+random-param-minsize','s:48:\"en:Limit to pages with at least this many bytes.\";'),('en','messages:apihelp-query+random-param-namespace','s:41:\"en:Return pages in these namespaces only.\";'),('en','messages:apihelp-query+random-param-redirect','s:50:\"en:Use <kbd>$1filterredir=redirects</kbd> instead.\";'),('en','messages:apihelp-query+random-summary','s:29:\"en:Get a set of random pages.\";'),('en','messages:apihelp-query+recentchanges-example-generator','s:50:\"en:Get page info about recent unpatrolled changes.\";'),('en','messages:apihelp-query+recentchanges-example-simple','s:23:\"en:List recent changes.\";'),('en','messages:apihelp-query+recentchanges-param-end','s:36:\"en:The timestamp to end enumerating.\";'),('en','messages:apihelp-query+recentchanges-param-excludeuser','s:35:\"en:Don\'t list changes by this user.\";'),('en','messages:apihelp-query+recentchanges-param-generaterevisions','s:177:\"en:When being used as a generator, generate revision IDs rather than titles. Recent change entries without associated revision IDs (e.g. most log entries) will generate nothing.\";'),('en','messages:apihelp-query+recentchanges-param-limit','s:36:\"en:How many total changes to return.\";'),('en','messages:apihelp-query+recentchanges-param-namespace','s:43:\"en:Filter changes to only these namespaces.\";'),('en','messages:apihelp-query+recentchanges-param-prop','s:44:\"en:Include additional pieces of information:\";'),('en','messages:apihelp-query+recentchanges-param-show','s:130:\"en:Show only items that meet these criteria. For example, to see only minor edits done by logged-in users, set $1show=minor|!anon.\";'),('en','messages:apihelp-query+recentchanges-param-slot','s:47:\"en:Only list changes that touch the named slot.\";'),('en','messages:apihelp-query+recentchanges-param-start','s:43:\"en:The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+recentchanges-param-tag','s:42:\"en:Only list changes tagged with this tag.\";'),('en','messages:apihelp-query+recentchanges-param-title','s:45:\"en:Filter entries to those related to a page.\";'),('en','messages:apihelp-query+recentchanges-param-toponly','s:51:\"en:Only list changes which are the latest revision.\";'),('en','messages:apihelp-query+recentchanges-param-type','s:34:\"en:Which types of changes to show.\";'),('en','messages:apihelp-query+recentchanges-param-user','s:34:\"en:Only list changes by this user.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-autopatrolled','s:56:\"en:Tags patrollable edits as being autopatrolled or not.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-comment','s:131:\"en:Adds the comment for the edit. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-flags','s:27:\"en:Adds flags for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-ids','s:71:\"en:Adds the page ID, recent changes ID and the new and old revision ID.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-loginfo','s:63:\"en:Adds log information (log ID, log type, etc) to log entries.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment','s:138:\"en:Adds the parsed comment for the edit. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-patrolled','s:60:\"en:Tags patrollable edits as being patrolled or unpatrolled.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-redirect','s:35:\"en:Tags edit if page is a redirect.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-sha1','s:163:\"en:Adds the content checksum for entries associated with a revision. If the content has been revision deleted, a <samp>sha1hidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-sizes','s:45:\"en:Adds the new and old page length in bytes.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-tags','s:28:\"en:Lists tags for the entry.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-timestamp','s:30:\"en:Adds timestamp of the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-title','s:35:\"en:Adds the page title of the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-user','s:161:\"en:Adds the user responsible for the edit and tags if they are an IP. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-userid','s:137:\"en:Adds the user ID responsible for the edit. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-summary','s:28:\"en:Enumerate recent changes.\";'),('en','messages:apihelp-query+redirects-example-generator','s:73:\"en:Get information about all redirects to the [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+redirects-example-simple','s:61:\"en:Get a list of redirects to the [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+redirects-param-limit','s:32:\"en:How many redirects to return.\";'),('en','messages:apihelp-query+redirects-param-namespace','s:42:\"en:Only include pages in these namespaces.\";'),('en','messages:apihelp-query+redirects-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+redirects-param-show','s:44:\"en:Show only items that meet these criteria:\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-fragment','s:37:\"en:Fragment of each redirect, if any.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-pageid','s:28:\"en:Page ID of each redirect.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-title','s:26:\"en:Title of each redirect.\";'),('en','messages:apihelp-query+redirects-paramvalue-show-!fragment','s:42:\"en:Only show redirects without a fragment.\";'),('en','messages:apihelp-query+redirects-paramvalue-show-fragment','s:39:\"en:Only show redirects with a fragment.\";'),('en','messages:apihelp-query+redirects-summary','s:44:\"en:Returns all redirects to the given pages.\";'),('en','messages:apihelp-query+revisions+base-param-contentformat','s:92:\"en:Serialization format used for <var>$1difftotext</var> and expected for output of content.\";'),('en','messages:apihelp-query+revisions+base-param-contentformat-slot','s:59:\"en:Content serialization format used for output of content.\";'),('en','messages:apihelp-query+revisions+base-param-diffto','s:308:\"en:Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Revision ID to diff each revision to. Use <kbd>prev</kbd>, <kbd>next</kbd> and <kbd>cur</kbd> for the previous, next and current revision respectively. For performance reasons, if this option is used, <var>$2limit</var> is enforced to $1.\";'),('en','messages:apihelp-query+revisions+base-param-difftotext','s:344:\"en:Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Text to diff each revision to. Only diffs a limited number of revisions. Overrides <var>$2diffto</var>. If <var>$2section</var> is set, only that section will be diffed against this text. For performance reasons, if this option is used, <var>$2limit</var> is enforced to $1.\";'),('en','messages:apihelp-query+revisions+base-param-difftotextpst','s:180:\"en:Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Perform a pre-save transform on the text before diffing it. Only valid when used with <var>$1difftotext</var>.\";'),('en','messages:apihelp-query+revisions+base-param-expandtemplates','s:149:\"en:Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> instead. Expand templates in revision content (requires $1prop=content).\";'),('en','messages:apihelp-query+revisions+base-param-generatexml','s:210:\"en:Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> or <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Generate XML parse tree for revision content (requires $1prop=content).\";'),('en','messages:apihelp-query+revisions+base-param-limit','s:225:\"en:Limit how many revisions will be returned. If <var>$3prop=content</var>, <var>$3prop=parsetree</var>, <var>$3diffto</var> or <var>$3difftotext</var> is used, the limit is $1. If <var>$3parse</var> is used, the limit is $2.\";'),('en','messages:apihelp-query+revisions+base-param-parse','s:213:\"en:Use <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Parse revision content (requires <var>$2prop=content</var>). For performance reasons, if this option is used, <var>$2limit</var> is enforced to $1.\";'),('en','messages:apihelp-query+revisions+base-param-prop','s:45:\"en:Which properties to get for each revision:\";'),('en','messages:apihelp-query+revisions+base-param-section','s:65:\"en:Only retrieve the content of the section with this identifier.\";'),('en','messages:apihelp-query+revisions+base-param-slots','s:206:\"en:Which revision slots to return data for, when slot-related properties are included in <var>$1props</var>. If omitted, data from the <kbd>main</kbd> slot will be returned in a backwards-compatible format.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-comment','s:138:\"en:Comment by the user for the revision. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-content','s:215:\"en:Content of each revision slot. If the content has been revision deleted, a <samp>texthidden</samp> property will be returned. For performance reasons, if this option is used, <var>$2limit</var> is enforced to $1.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-contentmodel','s:42:\"en:Content model ID of each revision slot.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-flags','s:26:\"en:Revision flags (minor).\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-ids','s:26:\"en:The ID of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-parsedcomment','s:145:\"en:Parsed comment by the user for the revision. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-parsetree','s:306:\"en:Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> or <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. The XML parse tree of revision content (requires content model <code>$1</code>). For performance reasons, if this option is used, <var>$3limit</var> is enforced to $2.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-roles','s:54:\"en:List content slot roles that exist in the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-sha1','s:130:\"en:SHA-1 (base 16) of the revision. If the content has been revision deleted, a <samp>sha1hidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-size','s:34:\"en:Length (bytes) of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-slotsha1','s:136:\"en:SHA-1 (base 16) of each revision slot. If the content has been revision deleted, a <samp>sha1hidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-slotsize','s:40:\"en:Length (bytes) of each revision slot.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-tags','s:25:\"en:Tags for the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-timestamp','s:33:\"en:The timestamp of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-user','s:123:\"en:User that made the revision. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-userid','s:127:\"en:User ID of the revision creator. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions-example-content','s:103:\"en:Get data with content for the last revision of titles <kbd>API</kbd> and [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+revisions-example-first5','s:59:\"en:Get first 5 revisions of the [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+revisions-example-first5-after','s:81:\"en:Get first 5 revisions of the [[{{MediaWiki:Mainpage}}]] made after 2006-05-01.\";'),('en','messages:apihelp-query+revisions-example-first5-not-localhost','s:117:\"en:Get first 5 revisions of the [[{{MediaWiki:Mainpage}}]] that were not made by anonymous user <kbd>127.0.0.1</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5-user','s:115:\"en:Get first 5 revisions of the [[{{MediaWiki:Mainpage}}]] that were made by the user <kbd>MediaWiki default</kbd>.\";'),('en','messages:apihelp-query+revisions-example-last5','s:58:\"en:Get last 5 revisions of the [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+revisions-extended-description','s:270:\"en:May be used in several ways:\n# Get data about a set of pages (last revision), by setting titles or pageids.\n# Get revisions for one given page, by using titles or pageids with start, end, or limit.\n# Get data about a set of revisions by setting their IDs with revids.\";'),('en','messages:apihelp-query+revisions-param-end','s:34:\"en:Enumerate up to this timestamp.\";'),('en','messages:apihelp-query+revisions-param-endid','s:125:\"en:Stop enumeration at the timestamp of the revision with this ID. The revision must exist, but need not belong to this page.\";'),('en','messages:apihelp-query+revisions-param-excludeuser','s:34:\"en:Exclude revisions made by user.\";'),('en','messages:apihelp-query+revisions-param-start','s:54:\"en:From which revision timestamp to start enumeration.\";'),('en','messages:apihelp-query+revisions-param-startid','s:128:\"en:Start enumeration from the timestamp of the revision with this ID. The revision must exist, but need not belong to this page.\";'),('en','messages:apihelp-query+revisions-param-tag','s:44:\"en:Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+revisions-param-user','s:39:\"en:Only include revisions made by user.\";'),('en','messages:apihelp-query+revisions-paraminfo-singlepageonly','s:49:\"en:May only be used with a single page (mode #2).\";'),('en','messages:apihelp-query+revisions-summary','s:28:\"en:Get revision information.\";'),('en','messages:apihelp-query+search-example-generator','s:78:\"en:Get page info about the pages returned for a search for <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+search-example-simple','s:33:\"en:Search for <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+search-example-text','s:39:\"en:Search texts for <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+search-param-backend','s:51:\"en:Which search backend to use, if not the default.\";'),('en','messages:apihelp-query+search-param-enablerewrites','s:179:\"en:Enable internal query rewriting. Some search backends can rewrite the query into another which is thought to provide better results, for instance by correcting spelling errors.\";'),('en','messages:apihelp-query+search-param-info','s:28:\"en:Which metadata to return.\";'),('en','messages:apihelp-query+search-param-interwiki','s:57:\"en:Include interwiki results in the search, if available.\";'),('en','messages:apihelp-query+search-param-limit','s:34:\"en:How many total pages to return.\";'),('en','messages:apihelp-query+search-param-namespace','s:39:\"en:Search only within these namespaces.\";'),('en','messages:apihelp-query+search-param-prop','s:30:\"en:Which properties to return:\";'),('en','messages:apihelp-query+search-param-qiprofile','s:64:\"en:Query independent profile to use (affects ranking algorithm).\";'),('en','messages:apihelp-query+search-param-search','s:178:\"en:Search for page titles or content matching this value. You can use the search string to invoke special search features, depending on what the wiki\'s search backend implements.\";'),('en','messages:apihelp-query+search-param-sort','s:42:\"en:Set the sort order of returned results.\";'),('en','messages:apihelp-query+search-param-what','s:35:\"en:Which type of search to perform.\";'),('en','messages:apihelp-query+search-paramvalue-prop-categorysnippet','s:72:\"en:Adds the matching category name, with query term highlighting markup.\";'),('en','messages:apihelp-query+search-paramvalue-prop-extensiondata','s:43:\"en:Adds extra data generated by extensions.\";'),('en','messages:apihelp-query+search-paramvalue-prop-hasrelated','s:11:\"en:Ignored.\";'),('en','messages:apihelp-query+search-paramvalue-prop-isfilematch','s:64:\"en:Adds a boolean indicating if the search matched file content.\";'),('en','messages:apihelp-query+search-paramvalue-prop-redirectsnippet','s:80:\"en:Adds the title of the matching redirect, with query term highlighting markup.\";'),('en','messages:apihelp-query+search-paramvalue-prop-redirecttitle','s:43:\"en:Adds the title of the matching redirect.\";'),('en','messages:apihelp-query+search-paramvalue-prop-score','s:11:\"en:Ignored.\";'),('en','messages:apihelp-query+search-paramvalue-prop-sectionsnippet','s:79:\"en:Adds the title of the matching section, with query term highlighting markup.\";'),('en','messages:apihelp-query+search-paramvalue-prop-sectiontitle','s:42:\"en:Adds the title of the matching section.\";'),('en','messages:apihelp-query+search-paramvalue-prop-size','s:38:\"en:Adds the size of the page in bytes.\";'),('en','messages:apihelp-query+search-paramvalue-prop-snippet','s:67:\"en:Adds a snippet of the page, with query term highlighting markup.\";'),('en','messages:apihelp-query+search-paramvalue-prop-timestamp','s:55:\"en:Adds the timestamp of when the page was last edited.\";'),('en','messages:apihelp-query+search-paramvalue-prop-titlesnippet','s:60:\"en:Adds the pag