:How many templates to return.\";'),('en','messages:apihelp-query+templates-param-namespace','s:43:\"en:Show templates in these namespaces only.\";'),('en','messages:apihelp-query+templates-param-templates','s:97:\"en:Only list these templates. Useful for checking whether a certain page uses a certain template.\";'),('en','messages:apihelp-query+templates-summary','s:52:\"en:Returns all pages transcluded on the given pages.\";'),('en','messages:apihelp-query+tokens-example-simple','s:39:\"en:Retrieve a csrf token (the default).\";'),('en','messages:apihelp-query+tokens-example-types','s:45:\"en:Retrieve a watch token and a patrol token.\";'),('en','messages:apihelp-query+tokens-param-type','s:29:\"en:Types of token to request.\";'),('en','messages:apihelp-query+tokens-summary','s:42:\"en:Gets tokens for data-modifying actions.\";'),('en','messages:apihelp-query+transcludedin-example-generator','s:71:\"en:Get information about pages transcluding [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+transcludedin-example-simple','s:63:\"en:Get a list of pages transcluding [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+transcludedin-param-limit','s:22:\"en:How many to return.\";'),('en','messages:apihelp-query+transcludedin-param-namespace','s:42:\"en:Only include pages in these namespaces.\";'),('en','messages:apihelp-query+transcludedin-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+transcludedin-param-show','s:44:\"en:Show only items that meet these criteria:\";'),('en','messages:apihelp-query+transcludedin-paramvalue-prop-pageid','s:24:\"en:Page ID of each page.\";'),('en','messages:apihelp-query+transcludedin-paramvalue-prop-redirect','s:34:\"en:Flag if the page is a redirect.\";'),('en','messages:apihelp-query+transcludedin-paramvalue-prop-title','s:22:\"en:Title of each page.\";'),('en','messages:apihelp-query+transcludedin-paramvalue-show-!redirect','s:27:\"en:Only show non-redirects.\";'),('en','messages:apihelp-query+transcludedin-paramvalue-show-redirect','s:23:\"en:Only show redirects.\";'),('en','messages:apihelp-query+transcludedin-summary','s:50:\"en:Find all pages that transclude the given pages.\";'),('en','messages:apihelp-query+unreadnotificationpages-example-1','s:57:\"en:List pages with (their amount of) unread notifications\";'),('en','messages:apihelp-query+unreadnotificationpages-param-grouppages','s:148:\"en:Group talk pages together with their subject page, and group notifications not associated with a page together with the current user\'s user page.\";'),('en','messages:apihelp-query+unreadnotificationpages-param-limit','s:41:\"en:The maximum number of pages to return.\";'),('en','messages:apihelp-query+unreadnotificationpages-param-wikis','s:95:\"en:List of wikis to fetch pages with unread notifications from (defaults to only current wiki).\";'),('en','messages:apihelp-query+unreadnotificationpages-summary','s:75:\"en:Get pages for which there are unread notifications for the current user.\";'),('en','messages:apihelp-query+usercontribs-example-ipprefix','s:76:\"en:Show contributions from all IP addresses with prefix <kbd>192.0.2.</kbd>.\";'),('en','messages:apihelp-query+usercontribs-example-user','s:49:\"en:Show contributions of user <kbd>Example</kbd>.\";'),('en','messages:apihelp-query+usercontribs-param-end','s:71:\"en:The end timestamp to return to, i.e. revisions after this timestamp.\";'),('en','messages:apihelp-query+usercontribs-param-iprange','s:137:\"en:The CIDR range to retrieve contributions for. Cannot be used with <var>$1user</var>, <var>$1userprefix</var>, or <var>$1userids</var>.\";'),('en','messages:apihelp-query+usercontribs-param-limit','s:49:\"en:The maximum number of contributions to return.\";'),('en','messages:apihelp-query+usercontribs-param-namespace','s:47:\"en:Only list contributions in these namespaces.\";'),('en','messages:apihelp-query+usercontribs-param-prop','s:44:\"en:Include additional pieces of informatio