','s:81:\"en:Tags if the user can and wants to receive email through [[Special:Emailuser]].\";'),('en','messages:apihelp-query+users-paramvalue-prop-gender','s:71:\"en:Tags the gender of the user. Returns \"male\", \"female\", or \"unknown\".\";'),('en','messages:apihelp-query+users-paramvalue-prop-groupmemberships','s:115:\"en:Lists groups that each user has been explicitly assigned to, including the expiry date of each group membership.\";'),('en','messages:apihelp-query+users-paramvalue-prop-groups','s:45:\"en:Lists all the groups each user belongs to.\";'),('en','messages:apihelp-query+users-paramvalue-prop-implicitgroups','s:60:\"en:Lists all the groups a user is automatically a member of.\";'),('en','messages:apihelp-query+users-paramvalue-prop-registration','s:42:\"en:Adds the user\'s registration timestamp.\";'),('en','messages:apihelp-query+users-paramvalue-prop-rights','s:38:\"en:Lists all the rights each user has.\";'),('en','messages:apihelp-query+users-summary','s:41:\"en:Get information about a list of users.\";'),('en','messages:apihelp-query+watchlist-example-allrev','s:87:\"en:Fetch information about all recent changes to pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-expiry','s:168:\"en:Fetch additional information about the top revision for recently changed pages on the current user\'s watchlist, including when temporarily watched items will expire.\";'),('en','messages:apihelp-query+watchlist-example-generator','s:78:\"en:Fetch page info for recently changed pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-generator-rev','s:83:\"en:Fetch revision info for recent changes to pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-props','s:114:\"en:Fetch additional information about the top revision for recently changed pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-simple','s:8