\"en:Adds comment of the edit. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-expiry','s:24:\"en:Adds the expiry time.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-flags','s:27:\"en:Adds flags for the edit.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-ids','s:34:\"en:Adds revision IDs and page IDs.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-loginfo','s:42:\"en:Adds log information where appropriate.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-notificationtimestamp','s:68:\"en:Adds timestamp of when the user was last notified about the edit.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-parsedcomment','s:133:\"en:Adds parsed comment of the edit. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-patrol','s:33:\"en:Tags edits that are patrolled.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-sizes','s:44:\"en:Adds the old and new lengths of the page.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-tags','s:28:\"en:Lists tags for the entry.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-timestamp','s:30:\"en:Adds timestamp of the edit.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-title','s:26:\"en:Adds title of the page.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-user','s:127:\"en:Adds the user who made the edit. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-userid','s:133:\"en:Adds user ID of whoever made the edit. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+watchlist-paramvalue-type-categorize','s:31:\"en:Category membership changes.\";'),('en','messages:apihelp-query+watchlist-paramvalue-type-edit','s:22:\"en:Regular page edits.\";'),('en','messages:apihelp-query+watchlist-paramvalue-type-external','s:20:\"en:External changes.\";'),('en','messages:apihelp-query+watchlist-paramvalue-type-log','s:15:\"en:Log entries.\";'),('en','messages:apihelp-query+watchlist-paramvalue-type-new','s:18:\"en:Page creations.\";'),('en','messages:apihelp-query+watchlist-summary','s:63:\"en:Get recent changes to pages in the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-example-generator','s:61:\"en:Fetch page info for pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-example-simple','s:46:\"en:List pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+watchlistraw-param-fromtitle','s:59:\"en:Title (with namespace prefix) to begin enumerating from.\";'),('en','messages:apihelp-query+watchlistraw-param-limit','s:48:\"en:How many total results to return per request.\";'),('en','messages:apihelp-query+watchlistraw-param-namespace','s:43:\"en:Only list pages in the given namespaces.\";'),('en','messages:apihelp-query+watchlistraw-param-owner','s:66:\"en:Used along with $1token to access a different user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-param-prop','s:38:\"en:Which additional properties to get:\";'),('en','messages:apihelp-query+watchlistraw-param-show','s:44:\"en:Only list items that meet these criteria.\";'),('en','messages:apihelp-query+watchlistraw-param-token','s:151:\"en:A security token (available in the user\'s [[Special:Preferences#mw-prefsection-watchlist|preferences]]) to allow access to another user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-param-totitle','s:56:\"en:Title (with namespace prefix) to stop enumerating at.\";'),('en','messages:apihelp-query+watchlistraw-paramvalue-prop-changed','s:68:\"en:Adds timestamp of when the user was last notified about the edit.\";'),('en','messages:apihelp-query+watchlistraw-summary','s:49:\"en:Get all pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query-example-allpages','s:59:\"en:Fetch revisions of pages beginning with <kbd>API/</kbd>.\";'),('en','messages:apihelp-query-example-revisions','s:134:\"en:Fetch [[Special:ApiHelp/query+siteinfo|site info]] and [[Special:ApiHelp/query+revisions|revisions]] of [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query-extended-description','s:112:\"en:All data modifications will first have to use query to acquire a token to prevent abuse from malicious sites.\";'),('en','messages:apihelp-query-param-export','s:64:\"en:Export the current revisions of all given or generated pages.\";'),('en','messages:apihelp-query-param-exportnowrap','s:130:\"en:Return the export XML without wrapping it in an XML result (same format as [[Special:Export]]). Can only be used with $1export.\";'),('en','messages:apihelp-query-param-exportschema','s:109:\"en:Target the given version of the XML dump format when exporting. Can only be used with <var>$1export</var>.\";'),('en','messages:apihelp-query-param-indexpageids','s:71:\"en:Include an additional pageids section listing all returned page IDs.\";'),('en','messages:apihelp-query-param-iwurl','s:65:\"en:Whether to get the full URL if the title is an interwiki link.\";'),('en','messages:apihelp-query-param-list','s:22:\"en:Which lists to get.\";'),('en','messages:apihelp-query-param-meta','s:25:\"en:Which metadata to get.\";'),('en','messages:apihelp-query-param-prop','s:49:\"en:Which properties to get for the queried pages.\";'),('en','messages:apihelp-query-param-rawcontinue','s:64:\"en:Return raw <samp>query-continue</samp> data for continuation.\";'),('en','messages:apihelp-query-summary','s:39:\"en:Fetch data from and about MediaWiki.\";'),('en','messages:apihelp-rawfm-summary','s:84:\"en:Output data, including debugging elements, in JSON format (pretty-print in HTML).\";'),('en','messages:apihelp-removeauthenticationdata-example-simple','s:85:\"en:Attempt to remove the current user\'s data for <kbd>FooAuthenticationRequest</kbd>.\";'),('en','messages:apihelp-removeauthenticationdata-summary','s:51:\"en:Remove authentication data for the current user.\";'),('en','messages:apihelp-resetpassword-example-email','s:92:\"en:Send a password reset email for all users with email address <kbd>user@example.com</kbd>.\";'),('en','messages:apihelp-resetpassword-example-user','s:58:\"en:Send a password reset email to user <kbd>Example</kbd>.\";'),('en','messages:apihelp-resetpassword-extended-description-noroutes','s:170:\"en:No password reset routes are available.\n\nEnable routes in <var>[[mw:Special:MyLanguage/Manual:$wgPasswordResetRoutes|$wgPasswordResetRoutes]]</var> to use this module.\";'),('en','messages:apihelp-resetpassword-param-email','s:41:\"en:Email address of the user being reset.\";'),('en','messages:apihelp-resetpassword-param-user','s:20:\"en:User being reset.\";'),('en','messages:apihelp-resetpassword-summary','s:41:\"en:Send a password reset email to a user.\";'),('en','messages:apihelp-revisiondelete-example-log','s:88:\"en:Hide all data on log entry <kbd>67890</kbd> with the reason <kbd>BLP violation</kbd>.\";'),('en','messages:apihelp-revisiondelete-example-revision','s:85:\"en:Hide content for revision <kbd>12345</kbd> on the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-revisiondelete-param-hide','s:34:\"en:What to hide for each revision.\";'),('en','messages:apihelp-revisiondelete-param-ids','s:47:\"en:Identifiers for the revisions to be deleted.\";'),('en','messages:apihelp-revisiondelete-param-reason','s:41:\"en:Reason for the deletion or undeletion.\";'),('en','messages:apihelp-revisiondelete-param-show','s:36:\"en:What to unhide for each revision.\";'),('en','messages:apihelp-revisiondelete-param-suppress','s:66:\"en:Whether to suppress data from administrators as well as others.\";'),('en','messages:apihelp-revisiondelete-param-tags','s:50:\"en:Tags to apply to the entry in the deletion log.\";'),('en','messages:apihelp-revisiondelete-param-target','s:66:\"en:Page title for the revision deletion, if required for the type.\";'),('en','messages:apihelp-revisiondelete-param-type','s:45:\"en:Type of revision deletion being performed.\";'),('en','messages:apihelp-revisiondelete-summary','s:33:\"en:Delete and undelete revisions.\";'),('en','messages:apihelp-rollback-example-simple','s:90:\"en:Roll back the last edits to page [[{{MediaWiki:Mainpage}}]] by user <kbd>Example</kbd>.\";'),('en','messages:apihelp-rollback-example-summary','s:189:\"en:Roll back the last edits to page [[{{MediaWiki:Mainpage}}]] by IP user <kbd>192.0.2.5</kbd> with summary <kbd>Reverting vandalism</kbd>, and mark those edits and the revert as bot edits.\";'),('en','messages:apihelp-rollback-extended-description','s:99:\"en:If the last user who edited the page made multiple edits in a row, they will all be rolled back.\";'),('en','messages:apihelp-rollback-param-markbot','s:55:\"en:Mark the reverted edits and the revert as bot edits.\";'),('en','messages:apihelp-rollback-param-pageid','s:85:\"en:Page ID of the page to roll back. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-rollback-param-summary','s:63:\"en:Custom edit summary. If empty, default summary will be used.\";'),('en','messages:apihelp-rollback-param-tags','s:33:\"en:Tags to apply to the rollback.\";'),('en','messages:apihelp-rollback-param-title','s:84:\"en:Title of the page to roll back. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-rollback-param-user','s:54:\"en:Name of the user whose edits are to be rolled back.\";'),('en','messages:apihelp-rollback-param-watchlist','s:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-rollback-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-rollback-summary','s:34:\"en:Undo the last edit to the page.\";'),('en','messages:apihelp-rsd-example-simple','s:25:\"en:Export the RSD schema.\";'),('en','messages:apihelp-rsd-summary','s:50:\"en:Export an RSD (Really Simple Discovery) schema.\";'),('en','messages:apihelp-setnotificationtimestamp-example-all','s:58:\"en:Reset the notification status for the entire watchlist.\";'),('en','messages:apihelp-setnotificationtimestamp-example-allpages','s:83:\"en:Reset the notification status for pages in the <kbd>{{ns:user}}</kbd> namespace.\";'),('en','messages:apihelp-setnotificationtimestamp-example-page','s:64:\"en:Reset the notification status for [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-setnotificationtimestamp-example-pagetimestamp','s:112:\"en:Set the notification timestamp for [[{{MediaWiki:Mainpage}}]] so all edits since 1 January 2012 are unviewed.\";'),('en','messages:apihelp-setnotificationtimestamp-extended-description','s:171:\"en:This affects the highlighting of changed pages in the watchlist and history, and the sending of email when the \"{{int:tog-enotifwatchlistpages}}\" preference is enabled.\";'),('en','messages:apihelp-setnotificationtimestamp-param-entirewatchlist','s:29:\"en:Work on all watched pages.\";'),('en','messages:apihelp-setnotificationtimestamp-param-newerthanrevid','s:73:\"en:Revision to set the notification timestamp newer than (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-param-timestamp','s:56:\"en:Timestamp to which to set the notification timestamp.\";'),('en','messages:apihelp-setnotificationtimestamp-param-torevid','s:65:\"en:Revision to set the notification timestamp to (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-summary','s:55:\"en:Update the notification timestamp for watched pages.\";'),('en','messages:apihelp-setpagelanguage-example-default','s:86:\"en:Change the language of the page with ID 123 to the wiki\'s default content language.\";'),('en','messages:apihelp-setpagelanguage-example-language','s:72:\"en:Change the language of the page [[{{MediaWiki:Mainpage}}]] to Basque.\";'),('en','messages:apihelp-setpagelanguage-extended-description-disabled','s:177:\"en:Changing the language of a page is not allowed on this wiki.\n\nEnable <var>[[mw:Special:MyLanguage/Manual:$wgPageLanguageUseDB|$wgPageLanguageUseDB]]</var> to use this action.\";'),('en','messages:apihelp-setpagelanguage-param-lang','s:136:\"en:Language code of the language to change the page to. Use <kbd>default</kbd> to reset the page to the wiki\'s default content language.\";'),('en','messages:apihelp-setpagelanguage-param-pageid','s:106:\"en:Page ID of the page whose language you wish to change. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-setpagelanguage-param-reason','s:25:\"en:Reason for the change.\";'),('en','messages:apihelp-setpagelanguage-param-tags','s:68:\"en:Change tags to apply to the log entry resulting from this action.\";'),('en','messages:apihelp-setpagelanguage-param-title','s:105:\"en:Title of the page whose language you wish to change. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-setpagelanguage-summary','s:33:\"en:Change the language of a page.\";'),('en','messages:apihelp-smwbrowse-summary','s:92:\"en:API module to support browse activities for different entity types in Semantic MediaWiki.\";'),('en','messages:apihelp-smwinfo-summary','s:101:\"en:API module to retrieve information about Semantic MediaWiki statistics and other meta information.\";'),('en','messages:apihelp-smwtask-param-params','s:72:\"en:JSON encoded parameters that match the selected task type requirement\";'),('en','messages:apihelp-smwtask-param-task','s:24:\"en:Defines the task type\";'),('en','messages:apihelp-smwtask-summary','s:102:\"en:API module to execute Semantic MediaWiki related tasks (for internal use only, not for public use).\";'),('en','messages:apihelp-stashedit-extended-description','s:103:\"en:This is intended to be used via AJAX from the edit form to improve the performance of the page save.\";'),('en','messages:apihelp-stashedit-param-baserevid','s:36:\"en:Revision ID of the base revision.\";'),('en','messages:apihelp-stashedit-param-contentformat','s:56:\"en:Content serialization format used for the input text.\";'),('en','messages:apihelp-stashedit-param-contentmodel','s:36:\"en:Content model of the new content.\";'),('en','messages:apihelp-stashedit-param-section','s:90:\"en:Section identifier. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('en','messages:apihelp-stashedit-param-sectiontitle','s:31:\"en:The title for a new section.\";'),('en','messages:apihelp-stashedit-param-stashedtexthash','s:55:\"en:Page content hash from a prior stash to use instead.\";'),('en','messages:apihelp-stashedit-param-summary','s:18:\"en:Change summary.\";'),('en','messages:apihelp-stashedit-param-text','s:16:\"en:Page content.\";'),('en','messages:apihelp-stashedit-param-title','s:34:\"en:Title of the page being edited.\";'),('en','messages:apihelp-stashedit-summary','s:35:\"en:Prepare an edit in shared cache.\";'),('en','messages:apihelp-summary','s:3:\"en:\";'),('en','messages:apihelp-tag-example-log','s:98:\"en:Remove the <kbd>spam</kbd> tag from log entry ID 123 with the reason <kbd>Wrongly applied</kbd>\";'),('en','messages:apihelp-tag-example-rev','s:82:\"en:Add the <kbd>vandalism</kbd> tag to revision ID 123 without specifying a reason\";'),('en','messages:apihelp-tag-param-add','s:56:\"en:Tags to add. Only manually defined tags can be added.\";'),('en','messages:apihelp-tag-param-logid','s:65:\"en:One or more log entry IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-rcid','s:70:\"en:One or more recent changes IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-reason','s:25:\"en:Reason for the change.\";'),('en','messages:apihelp-tag-param-remove','s:101:\"en:Tags to remove. Only tags that are either manually defined or completely undefined can be removed.\";'),('en','messages:apihelp-tag-param-revid','s:64:\"en:One or more revision IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-tags','s:82:\"en:Tags to apply to the log entry that will be created as a result of this action.\";'),('en','messages:apihelp-tag-summary','s:70:\"en:Add or remove change tags from individual revisions or log entries.\";'),('en','messages:apihelp-templatedata-example-1','s:125:\"en:Return TemplateData for [[Template:Foobar]], with results if the template does not exist or exists but has no TemplateData\";'),('en','messages:apihelp-templatedata-example-2','s:133:\"en:Return TemplateData for [[Template:Phabricator]], with no results if the template does not exist or exists but has no TemplateData\";'),('en','messages:apihelp-templatedata-param-doNotIgnoreMissingTitles','s:177:\"en:Return data about titles even if they are missing or lack TemplateData. By default (for backwards compatibility) titles are only returned if they exist and have TemplateData.\";'),('en','messages:apihelp-templatedata-param-includeMissingTitles','s:147:\"en:Return data about titles even if they are missing or lack TemplateData. By default titles are only returned if they exist and have TemplateData.\";'),('en','messages:apihelp-templatedata-param-lang','s:96:\"en:Return localized values in this language. By default all available translations are returned.\";'),('en','messages:apihelp-templatedata-summary','s:51:\"en:Fetch data stored by the TemplateData extension.\";'),('en','messages:apihelp-unblock-example-id','s:36:\"en:Unblock block ID #<kbd>105</kbd>.\";'),('en','messages:apihelp-unblock-example-user','s:64:\"en:Unblock user <kbd>Bob</kbd> with reason <kbd>Sorry Bob</kbd>.\";'),('en','messages:apihelp-unblock-param-id','s:120:\"en:ID of the block to unblock (obtained through <kbd>list=blocks</kbd>). Cannot be used together with <var>$1user</var>.\";'),('en','messages:apihelp-unblock-param-reason','s:22:\"en:Reason for unblock.\";'),('en','messages:apihelp-unblock-param-tags','s:54:\"en:Change tags to apply to the entry in the block log.\";'),('en','messages:apihelp-unblock-param-user','s:65:\"en:User to unblock. Cannot be used together with <var>$1id</var>.\";'),('en','messages:apihelp-unblock-param-userid','s:52:\"en:Specify <kbd>$1user=#<var>ID</var></kbd> instead.\";'),('en','messages:apihelp-unblock-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-unblock-param-watchuser','s:56:\"en:Watch the user\'s or IP address\'s user and talk pages.\";'),('en','messages:apihelp-unblock-summary','s:18:\"en:Unblock a user.\";'),('en','messages:apihelp-undelete-example-page','s:44:\"en:Undelete page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-undelete-example-revisions','s:61:\"en:Undelete two revisions of page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-undelete-extended-description','s:256:\"en:A list of deleted revisions (including timestamps) can be retrieved through [[Special:ApiHelp/query+deletedrevisions|prop=deletedrevisions]], and a list of deleted file IDs can be retrieved through [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('en','messages:apihelp-undelete-param-fileids','s:130:\"en:IDs of the file revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-reason','s:24:\"en:Reason for restoring.\";'),('en','messages:apihelp-undelete-param-tags','s:57:\"en:Change tags to apply to the entry in the deletion log.\";'),('en','messages:apihelp-undelete-param-timestamps','s:134:\"en:Timestamps of the revisions to undelete. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be undeleted.\";'),('en','messages:apihelp-undelete-param-title','s:33:\"en:Title of the page to undelete.\";'),('en','messages:apihelp-undelete-param-undeletetalk','s:62:\"en:Undelete all revisions of the associated talk page, if any.\";'),('en','messages:apihelp-undelete-param-watchlist','s:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-undelete-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-undelete-summary','s:40:\"en:Undelete revisions of a deleted page.\";'),('en','messages:apihelp-unlinkaccount-example-simple','s:114:\"en:Attempt to remove the current user\'s link for the provider associated with <kbd>FooAuthenticationRequest</kbd>.\";'),('en','messages:apihelp-unlinkaccount-summary','s:61:\"en:Remove a linked third-party account from the current user.\";'),('en','messages:apihelp-upload-example-filekey','s:50:\"en:Complete an upload that failed due to warnings.\";'),('en','messages:apihelp-upload-example-url','s:21:\"en:Upload from a URL.\";'),('en','messages:apihelp-upload-extended-description','s:550:\"en:Several methods are available:\n* Upload file contents directly, using the <var>$1file</var> parameter.\n* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.\n* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.\n* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.\nNote that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.\";'),('en','messages:apihelp-upload-param-async','s:69:\"en:Make potentially large file operations asynchronous when possible.\";'),('en','messages:apihelp-upload-param-checkstatus','s:55:\"en:Only fetch the upload status for the given file key.\";'),('en','messages:apihelp-upload-param-chunk','s:18:\"en:Chunk contents.\";'),('en','messages:apihelp-upload-param-comment','s:106:\"en:Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),('en','messages:apihelp-upload-param-file','s:17:\"en:File contents.\";'),('en','messages:apihelp-upload-param-filekey','s:70:\"en:Key that identifies a previous upload that was stashed temporarily.\";'),('en','messages:apihelp-upload-param-filename','s:19:\"en:Target filename.\";'),('en','messages:apihelp-upload-param-filesize','s:29:\"en:Filesize of entire upload.\";'),('en','messages:apihelp-upload-param-ignorewarnings','s:23:\"en:Ignore any warnings.\";'),('en','messages:apihelp-upload-param-offset','s:28:\"en:Offset of chunk in bytes.\";'),('en','messages:apihelp-upload-param-sessionkey','s:60:\"en:Same as $1filekey, maintained for backward compatibility.\";'),('en','messages:apihelp-upload-param-stash','s:93:\"en:If set, the server will stash the file temporarily instead of adding it to the repository.\";'),('en','messages:apihelp-upload-param-tags','s:71:\"en:Change tags to apply to the upload log entry and file page revision.\";'),('en','messages:apihelp-upload-param-text','s:35:\"en:Initial page text for new files.\";'),('en','messages:apihelp-upload-param-url','s:30:\"en:URL to fetch the file from.\";'),('en','messages:apihelp-upload-param-watch','s:18:\"en:Watch the page.\";'),('en','messages:apihelp-upload-param-watchlist','s:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-upload-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-upload-summary','s:55:\"en:Upload a file, or get the status of pending uploads.\";'),('en','messages:apihelp-userrights-example-expiry','s:75:\"en:Add user <kbd>SometimeSysop</kbd> to group <kbd>sysop</kbd> for 1 month.\";'),('en','messages:apihelp-userrights-example-user','s:121:\"en:Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-example-userid','s:130:\"en:Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-param-add','s:118:\"en:Add the user to these groups, or if they are already a member, update the expiry of their membership in that group.\";'),('en','messages:apihelp-userrights-param-expiry','s:363:\"en:Expiry timestamps. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If only one timestamp is set, it will be used for all groups passed to the <var>$1add</var> parameter. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd> for a never-expiring user group.\";'),('en','messages:apihelp-userrights-param-reason','s:25:\"en:Reason for the change.\";'),('en','messages:apihelp-userrights-param-remove','s:37:\"en:Remove the user from these groups.\";'),('en','messages:apihelp-userrights-param-tags','s:60:\"en:Change tags to apply to the entry in the user rights log.\";'),('en','messages:apihelp-userrights-param-user','s:8:\"en:User.\";'),('en','messages:apihelp-userrights-param-userid','s:52:\"en:Specify <kbd>$1user=#<var>ID</var></kbd> instead.\";'),('en','messages:apihelp-userrights-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-userrights-param-watchuser','s:40:\"en:Watch the user\'s user and talk pages.\";'),('en','messages:apihelp-userrights-summary','s:36:\"en:Change a user\'s group membership.\";'),('en','messages:apihelp-validatepassword-example-1','s:64:\"en:Validate the password <kbd>foobar</kbd> for the current user.\";'),('en','messages:apihelp-validatepassword-example-2','s:80:\"en:Validate the password <kbd>qwerty</kbd> for creating user <kbd>Example</kbd>.\";'),('en','messages:apihelp-validatepassword-extended-description','s:209:\"en:Validity is reported as <samp>Good</samp> if the password is acceptable, <samp>Change</samp> if the password may be used for login but must be changed, or <samp>Invalid</samp> if the password is not usable.\";'),('en','messages:apihelp-validatepassword-param-email','s:56:\"en:Email address, for use when testing account creation.\";'),('en','messages:apihelp-validatepassword-param-password','s:24:\"en:Password to validate.\";'),('en','messages:apihelp-validatepassword-param-realname','s:52:\"en:Real name, for use when testing account creation.\";'),('en','messages:apihelp-validatepassword-param-user','s:82:\"en:Username, for use when testing account creation. The named user must not exist.\";'),('en','messages:apihelp-validatepassword-summary','s:60:\"en:Validate a password against the wiki\'s password policies.\";'),('en','messages:apihelp-visualeditor-param-badetag','s:90:\"en:If RESTBase query returned a seemingly invalid ETag, pass it here for logging purposes.\";'),('en','messages:apihelp-visualeditor-param-basetimestamp','s:105:\"en:When saving, set this to the timestamp of the revision that was edited. Used to detect edit conflicts.\";'),('en','messages:apihelp-visualeditor-param-cachekey','s:113:\"en:For serialize or diff, use the result of a previous serializeforcache request with this key. Overrides $1html.\";'),('en','messages:apihelp-visualeditor-param-editintro','s:32:\"en:Edit intro to add to notices.\";'),('en','messages:apihelp-visualeditor-param-etag','s:16:\"en:ETag to send.\";'),('en','messages:apihelp-visualeditor-param-format','s:28:\"en:The format of the output.\";'),('en','messages:apihelp-visualeditor-param-html','s:50:\"en:HTML to send to Parsoid to convert to wikitext.\";'),('en','messages:apihelp-visualeditor-param-oldid','s:60:\"en:The revision number to use (defaults to latest revision).\";'),('en','messages:apihelp-visualeditor-param-paction','s:21:\"en:Action to perform.\";'),('en','messages:apihelp-visualeditor-param-page','s:34:\"en:The page to perform actions on.\";'),('en','messages:apihelp-visualeditor-param-preload','s:71:\"en:The page to use content from if the fetched page has no content yet.\";'),('en','messages:apihelp-visualeditor-param-preloadparams','s:62:\"en:Parameters to substitute into the preload page, if present.\";'),('en','messages:apihelp-visualeditor-param-pst','s:84:\"en:Pre-save transform wikitext before sending it to Parsoid (paction=parsefragment).\";'),('en','messages:apihelp-visualeditor-param-section','s:31:\"en:The section on which to act.\";'),('en','messages:apihelp-visualeditor-param-starttimestamp','s:101:\"en:When saving, set this to the timestamp of when the page was loaded. Used to detect edit conflicts.\";'),('en','messages:apihelp-visualeditor-param-stash','s:66:\"en:When saving, set this true if you want to use the stashing API.\";'),('en','messages:apihelp-visualeditor-param-wikitext','s:74:\"en:Wikitext to send to Parsoid to convert to HTML (paction=parsefragment).\";'),('en','messages:apihelp-visualeditor-summary','s:53:\"en:Returns HTML5 for a page from the Parsoid service.\";'),('en','messages:apihelp-visualeditoredit-param-basetimestamp','s:105:\"en:When saving, set this to the timestamp of the revision that was edited. Used to detect edit conflicts.\";'),('en','messages:apihelp-visualeditoredit-param-cachekey','s:90:\"en:Use the result of a previous serializeforcache request with this key. Overrides $1html.\";'),('en','messages:apihelp-visualeditoredit-param-captchaid','s:52:\"en:Captcha ID (when saving with a captcha response).\";'),('en','messages:apihelp-visualeditoredit-param-captchaword','s:63:\"en:Answer to the captcha (when saving with a captcha response).\";'),('en','messages:apihelp-visualeditoredit-param-data-{plugin}','s:56:\"en:Arbitrary data sent by a plugin with the API request.\";'),('en','messages:apihelp-visualeditoredit-param-etag','s:16:\"en:ETag to send.\";'),('en','messages:apihelp-visualeditoredit-param-html','s:52:\"en:HTML to send to Parsoid in exchange for wikitext.\";'),('en','messages:apihelp-visualeditoredit-param-minor','s:23:\"en:Flag for minor edit.\";'),('en','messages:apihelp-visualeditoredit-param-needcheck','s:124:\"en:When saving, set this parameter if the revision might have roundtrip problems. This will result in the edit being tagged.\";'),('en','messages:apihelp-visualeditoredit-param-nocontent','s:61:\"en:Omit the HTML content of the new revision in the response.\";'),('en','messages:apihelp-visualeditoredit-param-oldid','s:59:\"en:The revision number to use. Defaults to latest revision.\";'),('en','messages:apihelp-visualeditoredit-param-paction','s:21:\"en:Action to perform.\";'),('en','messages:apihelp-visualeditoredit-param-page','s:34:\"en:The page to perform actions on.\";'),('en','messages:apihelp-visualeditoredit-param-plugins','s:43:\"en:Plugins associated with the API request.\";'),('en','messages:apihelp-visualeditoredit-param-section','s:31:\"en:The section on which to act.\";'),('en','messages:apihelp-visualeditoredit-param-sectiontitle','s:25:\"en:Title for new section.\";'),('en','messages:apihelp-visualeditoredit-param-starttimestamp','s:101:\"en:When saving, set this to the timestamp of when the page was loaded. Used to detect edit conflicts.\";'),('en','messages:apihelp-visualeditoredit-param-summary','s:16:\"en:Edit summary.\";'),('en','messages:apihelp-visualeditoredit-param-tags','s:36:\"en:Change tags to apply to the edit.\";'),('en','messages:apihelp-visualeditoredit-param-watchlist','s:39:\"en:{{int:apihelp-edit-param-watchlist}}\";'),('en','messages:apihelp-visualeditoredit-param-wikitext','s:28:\"en:The wikitext to act with.\";'),('en','messages:apihelp-visualeditoredit-summary','s:83:\"en:Save an HTML5 page to MediaWiki (converted to wikitext via the Parsoid service).\";'),('en','messages:apihelp-watch-example-generator','s:51:\"en:Watch the first few pages in the main namespace.\";'),('en','messages:apihelp-watch-example-unwatch','s:47:\"en:Unwatch the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-watch-example-watch','s:45:\"en:Watch the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-watch-example-watch-expiry','s:96:\"en:Watch the pages [[{{MediaWiki:Mainpage}}]], <kbd>Foo</kbd>, and <kbd>Bar</kbd> for one month.\";'),('en','messages:apihelp-watch-param-expiry','s:123:\"en:Expiry timestamp to be applied to all given pages. Omit this parameter entirely to leave any current expiries unchanged.\";'),('en','messages:apihelp-watch-param-title','s:58:\"en:The page to (un)watch. Use <var>$1titles</var> instead.\";'),('en','messages:apihelp-watch-param-unwatch','s:57:\"en:If set the page will be unwatched rather than watched.\";'),('en','messages:apihelp-watch-summary','s:57:\"en:Add or remove pages from the current user\'s watchlist.\";'),('en','messages:apihelp-xml-param-includexmlnamespace','s:39:\"en:If specified, adds an XML namespace.\";'),('en','messages:apihelp-xml-param-xslt','s:147:\"en:If specified, adds the named page as an XSL stylesheet. The value must be a title in the {{ns:MediaWiki}} namespace ending in <code>.xsl</code>.\";'),('en','messages:apihelp-xml-summary','s:29:\"en:Output data in XML format.\";'),('en','messages:apihelp-xmlfm-summary','s:52:\"en:Output data in XML format (pretty-print in HTML).\";'),('en','messages:apisandbox','s:14:\"en:API sandbox\";'),('en','messages:apisandbox-add-multi','s:6:\"en:Add\";'),('en','messages:apisandbox-alert-field','s:40:\"en:The value of this field is not valid.\";'),('en','messages:apisandbox-alert-page','s:37:\"en:Fields on this page are not valid.\";'),('en','messages:apisandbox-continue','s:11:\"en:Continue\";'),('en','messages:apisandbox-continue-clear','s:8:\"en:Clear\";'),('en','messages:apisandbox-continue-help','s:221:\"en:{{int:apisandbox-continue}} will [https://www.mediawiki.org/wiki/Special:MyLanguage/API:Query#Continuing_queries continue] the last request; {{int:apisandbox-continue-clear}} will clear continuation-related parameters.\";'),('en','messages:apisandbox-deprecated-parameters','s:24:\"en:Deprecated parameters\";'),('en','messages:apisandbox-dynamic-error-exists','s:41:\"en:A parameter named \"$1\" already exists.\";'),('en','messages:apisandbox-dynamic-parameters','s:24:\"en:Additional parameters\";'),('en','messages:apisandbox-dynamic-parameters-add-label','s:17:\"en:Add parameter:\";'),('en','messages:apisandbox-dynamic-parameters-add-placeholder','s:17:\"en:Parameter name\";'),('en','messages:apisandbox-examples','s:11:\"en:Examples\";'),('en','messages:apisandbox-fetch-token','s:22:\"en:Auto-fill the token\";'),('en','messages:apisandbox-helpurls','s:13:\"en:Help links\";'),('en','messages:apisandbox-intro','s:489:\"en:Use this page to experiment with the <strong>MediaWiki web service API</strong>.\nRefer to [https://www.mediawiki.org/wiki/Special:MyLanguage/API:Main_page the API documentation] for further details of API usage. Example: [https://www.mediawiki.org/wiki/Special:MyLanguage/API:Tutorial#A_simple_query search for page titles matching a certain keyword]. Select an action to see more examples.\n\nNote that, although this is a sandbox, actions you carry out on this page may modify the wiki.\";'),('en','messages:apisandbox-jsonly','s:49:\"en:JavaScript is required to use the API sandbox.\";'),('en','messages:apisandbox-load-error','s:70:\"en:An error occurred while loading information for API module \"$1\": $2\";'),