r-bademail','s:45:\"en:You have entered an invalid email address.\";'),('en','messages:config-admin-error-password','s:92:\"en:Internal error when setting a password for the admin \"<nowiki>$1</nowiki>\": <pre>$2</pre>\";'),('en','messages:config-admin-error-password-invalid','s:34:\"en:Invalid wiki admin password: $1\";'),('en','messages:config-admin-error-user','s:77:\"en:Internal error when creating an admin with the name \"<nowiki>$1</nowiki>\".\";'),('en','messages:config-admin-help','s:117:\"en:Enter your preferred username here, for example \"Joe Bloggs\".\nThis is the name you will use to log in to the wiki.\";'),('en','messages:config-admin-name','s:17:\"en:Your username:\";'),('en','messages:config-admin-name-blank','s:35:\"en:Enter an administrator username.\";'),('en','messages:config-admin-name-invalid','s:89:\"en:The specified username \"<nowiki>$1</nowiki>\" is invalid.\nSpecify a different username.\";'),('en','messages:config-admin-password','s:12:\"en:Password:\";'),('en','messages:config-admin-password-blank','s:50:\"en:Enter a password for the administrator account.\";'),('en','messages:config-admin-password-confirm','s:18:\"en:Password again:\";'),('en','messages:config-admin-password-mismatch','s:46:\"en:The two passwords you entered do not match.\";'),('en','messages:config-advanced-settings','s:25:\"en:Advanced configuration\";'),('en','messages:config-almost-done','s:100:\"en:You are almost done!\nYou can now skip the remaining configuration and install the wiki right now.\";'),('en','messages:config-apc','s:45:\"en:[https://www.php.net/apc APC] is installed\";'),('en','messages:config-apcu','s:47:\"en:[https://www.php.net/apcu APCu] is installed\";'),('en','messages:config-back','s:11:\"en: Back\";'),('en','messages:config-cache-accel','s:35:\"en:PHP object caching (APC or APCu)\";'),('en','messages:config-cache-help','s:195:\"en:Object caching is used to improve the speed of MediaWiki by caching frequently used data.\nMedium to large sites are highly encouraged to enable this, and small sites will see benefits as well.\";'),('en','messages:config-cache-memcached','s:62:\"en:Use Memcached (requires additional setup and configuration)\";'),('en','messages:config-cache-none','s:91:\"en:No caching (no functionality is removed, but speed may be impacted on larger wiki sites)\";'),('en','messages:config-cache-options','s:31:\"en:Settings for object caching:\";'),('en','messages:config-can-upgrade','s:113:\"en:There are MediaWiki tables in this database.\nTo upgrade them to MediaWiki $1, click <strong>Continue</strong>.\";'),('en','messages:config-connection-error','s:150:\"en:$1.\n\nCheck the host, username and password and try again. If using \"localhost\" as the database host, try using \"127.0.0.1\" instead (or vice versa).\";'),('en','messages:config-continue','s:15:\"en:Continue \";'),('en','messages:config-db-account-lock','s:61:\"en:Use the same username and password during normal operation\";'),('en','messages:config-db-host','s:17:\"en:Database host:\";'),('en','messages:config-db-host-help','s:432:\"en:If your database server is on a different server, enter the host name or IP address here.\n\nIf you are using shared web hosting, your hosting provider should give you the correct host name in their documentation.\n\nIf you are using MySQL, using \"localhost\" may not work for the server name. If it does not, try \"127.0.0.1\" for the local IP address.\n\nIf you are using PostgreSQL, leave this field blank to connect via a Unix socket.\";'),('en','messages:config-db-install-account','s:32:\"en:User account for installation\";'),('en','messages:config-db-install-help','s:112:\"en:Enter the username and password that will be used to connect to the database during the installation process.\";'),('en','messages:config-db-install-password','s:191:\"en:Enter the password that will be used to connect to the database during the installation process.\nThis is not the password for the MediaWiki account; this is the password for your database.\";'),('en','messages:config-db-install-username','s:190:\"en:Enter the username that will be used to connect to the database during the installation process.\nThis is not the username of the MediaWiki account; this is the username for your database.\";'),('en','messages:config-db-name','s:30:\"en:Database name (no hyphens):\";'),('en','messages:config-db-name-help','s:235:\"en:Choose a name that identifies your wiki.\nIt should not contain spaces.\n\nIf you are using shared web hosting, your hosting provider will either give you a specific database name to use or let you create databases via a control panel.\";'),('en','messages:config-db-password','s:21:\"en:Database password:\";'),('en','messages:config-db-port','s:17:\"en:Database port:\";'),('en','messages:config-db-prefix','s:38:\"en:Database table prefix (no hyphens):\";'),('en','messages:config-db-prefix-help','s:238:\"en:If you need to share one database between multiple wikis, or between MediaWiki and another web application, you may choose to add a prefix to all the table names to avoid conflicts.\nDo not use spaces.\n\nThis field is usually left empty.\";'),('en','messages:config-db-schema','s:37:\"en:Schema for MediaWiki (no hyphens):\";'),('en','messages:config-db-schema-help','s:76:\"en:This schema will usually be fine.\nOnly change it if you know you need to.\";'),('en','messages:config-db-ssl','s:19:\"en:Connect over SSL\";'),('en','messages:config-db-type','s:17:\"en:Database type:\";'),('en','messages:config-db-username','s:21:\"en:Database username:\";'),('en','messages:config-db-web-account','s:34:\"en:Database account for web access\";'),('en','messages:config-db-web-account-same','s:43:\"en:Use the same account as for installation\";'),('en','messages:config-db-web-create','s:50:\"en:Create the account if it does not already exist\";'),('en','messages:config-db-web-help','s:138:\"en:Select the username and password that the web server will use to connect to the database server, during ordinary operation of the wiki.\";'),('en','messages:config-db-web-no-create-privs','s:148:\"en:The account you specified for installation does not have enough privileges to create an account.\nThe account you specify here must already exist.\";'),('en','messages:config-db-wiki-account','s:36:\"en:User account for normal operation\";'),('en','messages:config-db-wiki-help','s:288:\"en:Enter the username and password that will be used to connect to the database during normal wiki operation.\nIf the account does not exist, and the installation account has sufficient privileges, this user account will be created with the minimum privileges required to operate the wiki.\";'),('en','messages:config-db-wiki-settings','s:21:\"en:Identify this wiki\";'),('en','messages:config-dbsupport-mysql','s:346:\"en:* [{{int:version-db-mariadb-url}} MariaDB] is the primary target for MediaWiki and is best supported. MediaWiki also works with [{{int:version-db-mysql-url}} MySQL] and [{{int:version-db-percona-url}} Percona Server], which are MariaDB compatible. ([https://www.php.net/manual/en/mysqli.installation.php How to compile PHP with MySQL support])\";'),('en','messages:config-dbsupport-postgres','s:218:\"en:* [{{int:version-db-postgres-url}} PostgreSQL] is a popular open source database system as an alternative to MySQL. ([https://www.php.net/manual/en/pgsql.installation.php How to compile PHP with PostgreSQL support])\";'),('en','messages:config-dbsupport-sqlite','s:209:\"en:* [{{int:version-db-sqlite-url}} SQLite] is a lightweight database system that is very well supported. ([https://www.php.net/manual/en/pdo.installation.php How to compile PHP with SQLite support], uses PDO)\";'),('en','messages:config-desc','s:30:\"en:The installer for MediaWiki\";'),('en','messages:config-diff3-bad','s:127:\"en:GNU diff3 text comparison utility not found. You can ignore this for now, but might run into edit conflicts more frequently.\";'),('en','messages:config-download-localsettings','s:42:\"en:Download <code>LocalSettings.php</code>\";'),('en','messages:config-email-auth','s:30:\"en:Enable email authentication\";'),('en','messages:config-email-auth-help','s:350:\"en:If this option is enabled, users have to confirm their email address using a link sent to them whenever they set or change it.\nOnly authenticated email addresses can receive emails from other users or change notification emails.\nSetting this option is <strong>recommended</strong> for public wikis because of potential abuse of the email features.\";'),('en','messages:config-email-sender','s:24:\"en:Return email address:\";'),('en','messages:config-email-sender-help','s:179:\"en:Enter the email address to use as the return address on outbound email.\nThis is where bounces will be sent.\nMany mail servers require at least the domain name part to be valid.\";'),('en','messages:config-email-settings','s:17:\"en:Email settings\";'),('en','messages:config-email-user','s:28:\"en:Enable user-to-user email\";'),('en','messages:config-email-user-help','s:89:\"en:Allow all users to send each other email if they have enabled it in their preferences.\";'),('en','messages:config-email-usertalk','s:37:\"en:Enable user talk page notification\";'),('en','messages:config-email-usertalk-help','s:112:\"en:Allow users to receive notifications on user talk page changes, if they have enabled it in their preferences.\";'),('en','messages:config-email-watchlist','s:32:\"en:Enable watchlist notification\";'),('en','messages:config-email-watchlist-help','s:111:\"en:Allow users to receive notifications about their watched pages if they have enabled it in their preferences.\";'),('en','messages:config-enable-email','s:24:\"en:Enable outbound email\";'),('en','messages:config-enable-email-help','s:203:\"en:If you want email to work, [https://www.php.net/manual/en/mail.configuration.php PHP\'s mail settings] need to be configured correctly.\nIf you do not want any email features, you can disable them here.\";'),('en','messages:config-env-bad','s:66:\"en:The environment has been checked.\nYou cannot install MediaWiki.\";'),('en','messages:config-env-good','s:63:\"en:The environment has been checked.\nYou can install MediaWiki.\";'),('en','messages:config-env-icu','s:45:\"en:ICU $1 is installed (supports Unicode $2).\";'),('en','messages:config-env-php','s:23:\"en:PHP $1 is installed.\";'),('en','messages:config-ext-skins-more-info','s:19:\"en:more information\";'),('en','messages:config-extension-dependency','s:77:\"en:A dependency error was encountered while installing the extension \"$1\": $2\";'),('en','messages:config-extension-link','s:245:\"en:Did you know that your wiki supports [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Extensions extensions]?\n\nYou can browse [https://www.mediawiki.org/wiki/Special:MyLanguage/Category:Extensions_by_category extensions by category].\";'),('en','messages:config-extension-not-found','s:62:\"en:Could not find the registration file for the extension \"$1\"\";'),('en','messages:config-extensions','s:13:\"en:Extensions\";'),('en','messages:config-extensions-help','s:162:\"en:The extensions listed above were detected in your <code>./extensions</code> directory.\n\nThey may require additional configuration, but you can enable them now.\";'),('en','messages:config-extensions-requires','s:19:\"en:$1 (requires $2)\";'),('en','messages:config-gd','s:96:\"en:Found GD graphics library built-in.\nImage thumbnailing will be enabled if you enable uploads.\";'),('en','messages:config-git','s:59:\"en:Found the Git version control software: <code>$1</code>.\";'),('en','messages:config-git-bad','s:124:\"en:Git version control software not found. You can ignore this for now. Note Special:Version will not display commit hashes.\";'),('en','messages:config-header-mysql','s:25:\"en:MariaDB/MySQL settings\";'),('en','messages:config-header-postgres','s:22:\"en:PostgreSQL settings\";'),('en','messages:config-header-sqlite',