ed a <code>LocalSettings.php</code> file.\nIt contains all your configuration.\n\nYou will need to download it and put it at <code>$4</code>. The download should have started automatically.\n\nIf the download was not offered, or if you cancelled it, you can restart the download by clicking the link below:\n\n$3\n\n<strong>Note:</strong> If you do not do this now, this generated configuration file will not be available to you later if you exit the installation without downloading it.\n\nWhen that has been done, you can <strong>[$2 enter your wiki]</strong>.\";'),('en','messages:config-install-extension-tables','s:41:\"en:Creating tables for enabled extensions\";'),('en','messages:config-install-extensions','s:23:\"en:Including extensions\";'),('en','messages:config-install-external-domains','s:30:\"en:Creating external databases\";'),('en','messages:config-install-generic','s:20:\"en:Running task \"$1\"\";'),('en','messages:config-install-interwiki','s:37:\"en:Populating default interwiki table\";'),('en','messages:config-install-interwiki-exists','s:102:\"en:<strong>Warning:</strong> The interwiki table seems to already have entries.\nSkipping default list.\";'),('en','messages:config-install-interwiki-list','s:51:\"en:Could not read file <code>interwiki.list</code>.\";'),('en','messages:config-install-logo-blank','s:26:\"en:Enter a valid logo URL.\";'),('en','messages:config-install-mainpage','s:42:\"en:Creating main page with default content\";'),('en','messages:config-install-mainpage-exists','s:37:\"en:Main page already exists, skipping\";'),('en','messages:config-install-mainpage-failed','s:33:\"en:Could not insert main page: $1\";'),('en','messages:config-install-pg-plpgsql','s:33:\"en:Checking for language PL/pgSQL\";'),('en','messages:config-install-pg-schema-failed','s:85:\"en:Tables creation failed.\nMake sure that the user \"$1\" can write to the schema \"$2\".\";'),('en','messages:config-install-pg-schema-not-exist','s:36:\"en:PostgreSQL schema does not exist.\";'),('en','messages:config-install-restore-services','s:31:\"en:Restoring MediaWiki services\";'),('en','messages:config-install-schema','s:18:\"en:Creating schema\";'),('en','messages:config-install-search','s:24:\"en:Creating search index\";'),('en','messages:config-install-stats','s:26:\"en:Initializing statistics\";'),('en','messages:config-install-step-done','s:7:\"en:done\";'),('en','messages:config-install-step-failed','s:9:\"en:failed\";'),('en','messages:config-install-subscribe','s:36:\"en:Subscribing to mediawiki-announce\";'),('en','messages:config-install-subscribe-alreadypending','s:145:\"en:A request to subscribe to mediawiki-announce had already been submitted. Please reply to the confirmation email that had previously been sent.\";'),('en','messages:config-install-subscribe-alreadysubscribed','s:177:\"en:You are already subscribed to mediawiki-announce. [https://lists.wikimedia.org/postorius/accounts/per-subscription-preferences/ View or change your subscription preferences].\";'),('en','messages:config-install-subscribe-fail','s:134:\"en:Unable to subscribe to [https://lists.wikimedia.org/postorius/lists/mediawiki-announce.lists.wikimedia.org/ mediawiki-announce]: $1\";'),('en','messages:config-install-subscribe-notpossible','s:75:\"en:cURL is not installed and <code>allow_url_fopen</code> is not available.\";'),('en','messages:config-install-subscribe-possiblefail','s:293:\"en:Your request to subscribe to mediawiki-announce might not have gone through. If you don\'t receive a confirmation email within a few minutes, go to [https://lists.wikimedia.org/postorius/lists/mediawiki-announce.lists.wikimedia.org/ lists.wikimedia.org] to try submitting your request again.\";'),('en','messages:config-install-success','s:276:\"en:MediaWiki has been successfully installed. You can now visit <$1$2> to view your wiki.\nIf you have questions, check out our frequently asked questions list:\n<https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ> or use one of the\nsupport forums linked on that page.\";'),('en','messages:config-install-sysop','s:38:\"en:Creating administrator user account\";'),('en','messages:config-install-tables','s:18:\"en:Creating tables\";'),('en','messages:config-install-tables-exist','s:87:\"en:<strong>Warning:</strong> MediaWiki tables seem to already exist.\nSkipping creation.\";'),('en','messages:config-install-tables-failed','s:77:\"en:<strong>Error:</strong> Table creation failed with the following error: $1\";'),('en','messages:config-install-updates','s:35:\"en:Prevent running unneeded updates\";'),('en','messages:config-install-updates-failed','s:96:\"en:<strong>Error:</strong> Inserting update keys into tables failed with the following error: $1\";'),('en','messages:config-install-user','s:25:\"en:Creating database user\";'),('en','messages:config-install-user-alreadyexists','s:27:\"en:User \"$1\" already exists\";'),('en','messages:config-install-user-create-failed','s:32:\"en:Creating user \"$1\" failed: $2\";'),('en','messages:config-install-user-grant-failed','s:46:\"en:Granting permission to user \"$1\" failed: $2\";'),('en','messages:config-install-user-missing','s:42:\"en:The specified user \"$1\" does not exist.\";'),('en','messages:config-install-user-missing-create','s:117:\"en:The specified user \"$1\" does not exist.\nPlease click the \"create account\" checkbox below if you want to create it.\";'),('en','messages:config-instantcommons','s:25:\"en:Enable Instant Commons\";'),('en','messages:config-instantcommons-help','s:513:\"en:[https://www.mediawiki.org/wiki/Special:MyLanguage/InstantCommons Instant Commons] is a feature that allows wikis to use images, sounds and other media found on the [https://commons.wikimedia.org/ Wikimedia Commons] site.\nIn order to do this, MediaWiki requires access to the Internet.\n\nFor more information on this feature, including instructions on how to set it up for wikis other than the Wikimedia Commons, consult [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgForeignFileRepos the manual].\";'),('en','messages:config-invalid-db-name','s:113:\"en:Invalid database name \"$1\".\nUse only ASCII letters (a-z, A-Z), numbers (0-9), underscores (_) and hyphens (-).\";'),('en','messages:config-invalid-db-prefix','s:115:\"en:Invalid database prefix \"$1\".\nUse only ASCII letters (a-z, A-Z), numbers (0-9), underscores (_) and hyphens (-).\";'),('en','messages:config-invalid-db-type','s:25:\"en:Invalid database type.\";'),('en','messages:config-invalid-key','s:53:\"en:Invalid MediaWiki configuration parameter \"$1\": $2\";'),('en','messages:config-invalid-schema','s:107:\"en:Invalid schema for MediaWiki \"$1\".\nUse only ASCII letters (a-z, A-Z), numbers (0-9) and underscores (_).\";'),('en','messages:config-license','s:25:\"en:Copyright and license:\";'),('en','messages:config-license-cc-0','s:40:\"en:Creative Commons Zero (Public Domain)\";'),('en','messages:config-license-cc-by','s:31:\"en:Creative Commons Attribution\";');
INSERT INTO `l10n_cache` VALUES ('en','messages:config-license-cc-by-nc-sa','s:56:\"en:Creative Commons Attribution-NonCommercial-ShareAlike\";'),('en','messages:config-license-cc-by-sa','s:42:\"en:Creative Commons Attribution-ShareAlike\";'),('en','messages:config-license-gfdl','s:46:\"en:GNU Free Documentation License 1.3 or later\";'),('en','messages:config-license-help','s:640:\"en:Many public wikis put all contributions under a [https://freedomdefined.org/Definition free license].\nThis helps to create a sense of community ownership and encourages long-term contribution.\nIt is not generally necessary for a private or corporate wiki.\n\nIf you want to be able to use text from Wikipedia, and you want Wikipedia to be able to accept text copied from your wiki, you should choose <strong>{{int:config-license-cc-by-sa}}</strong>.\n\nWikipedia previously used the GNU Free Documentation License.\nThe GFDL is a valid license, but it is difficult to understand.\nIt is also difficult to reuse content licensed under the GFDL.\";'),('en','messages:config-license-none','s:20:\"en:No license footer\";'),('en','messages:config-license-pd','s:16:\"en:Public Domain\";'),('en','messages:config-localsettings-badkey','s:45:\"en:The upgrade key you provided is incorrect.\";'),('en','messages:config-localsettings-cli-upgrade','s:132:\"en:A <code>LocalSettings.php</code> file has been detected.\nTo upgrade this installation, please run <code>update.php</code> instead\";'),('en','messages:config-localsettings-connection-error','s:168:\"en:An error was encountered when connecting to the database using the settings specified in <code>LocalSettings.php</code>. Please fix these settings and try again.\n\n$1\";'),('en','messages:config-localsettings-incomplete','s:212:\"en:The existing <code>LocalSettings.php</code> appears to be incomplete.\nThe $1 variable is not set.\nPlease change <code>LocalSettings.php</code> so that this variable is set, and click \"{{int:Config-continue}}\".\";'),('en','messages:config-localsettings-key','s:15:\"en:Upgrade key:\";'),('en','messages:config-localsettings-upgrade','s:212:\"en:A <code>LocalSettings.php</code> file has been detected.\nTo upgrade this installation, please enter the value of <code>$wgUpgradeKey</code> in the box below.\nYou will find it in <code>LocalSettings.php</code>.\";'),('en','messages:config-logo-filedrop','s:26:\"en:Drop an image file here\";'),('en','messages:config-logo-icon','s:15:\"en:Logo (icon):\";'),('en','messages:config-logo-icon-help','s:72:\"en:Your logo icon should be square and ideally more than 50px or an SVG.\";'),('en','messages:config-logo-preview-main','s:12:\"en:Main page\";'),('en','messages:config-logo-sidebar','s:27:\"en:Sidebar logo (optional):\";'),('en','messages:config-logo-sidebar-help','s:221:\"en:Some MediaWiki skins include a logo with 160 pixel height as part of the sidebar menu. If undefined, this is the same as the icon defined above. You may want to have a dedicated graphic that combines wordmark and icon.\";'),('en','messages:config-logo-summary','s:273:\"en:For each of these fields, you will need to upload an image of the appropriate size, and enter the URL in the boxes below. You can use <code>$wgStylePath</code> or <code>$wgScriptPath</code> if your logo is relative to those paths. You can leave any of these boxes blank.\";'),('en','messages:config-logo-tagline','s:22:\"en:Tagline (optional):\";'),('en','messages:config-logo-tagline-help','s:220:\"en:The tagline of your site. Use only if you have defined a wordmark above. If not defined, this will generally fall back to text. The combined height of the tagline and wordmark as a general rule should not exceed 50px.\";'),('en','messages:config-logo-wordmark','s:23:\"en:Wordmark (optional):\";'),('en','messages:config-logo-wordmark-help','s:135:\"en:The name of your site. If not defined, this will generally fall back to text. Ideally an SVG with height less than or equal to 30px.\";'),('en','messages:config-mariadb-old','s:48:\"en:MariaDB $1 or later is required. You have $2.\";'),('en','messages:config-memcache-badip','s:60:\"en:You have entered an invalid IP address for Memcached: $1.\";'),('en','messages:config-memcache-badport','s:54:\"en:Memcached port numbers should be between $1 and $2.\";'),('en','messages:config-memcache-needservers','s:77:\"en:You selected Memcached as your cache type but did not specify any servers.\";'),('en','messages:config-memcache-noport','s:113:\"en:You did not specify a port to use for Memcached server: $1.\nIf you do not know the port, the default is 11211.\";'),('en','messages:config-memcached-help','s:155:\"en:List of IP addresses to use for Memcached.\nShould specify one per line and specify the port to be used. For example:\n 127.0.0.1:11211\n 192.168.1.25:1234\";'),('en','messages:config-memcached-servers','s:21:\"en:Memcached servers:\";'),('en','messages:config-memory-bad','s:120:\"en:<strong>Warning:</strong> PHP\'s <code>memory_limit</code> is $1.\nThis is probably too low.\nThe installation may fail!\";'),('en','messages:config-memory-raised','s:55:\"en:PHP\'s <code>memory_limit</code> is $1, raised to $2.\";'),('en','messages:config-missing-db-host','s:55:\"en:You must enter a value for \"{{int:config-db-host}}\".\";'),('en','messages:config-missing-db-name','s:55:\"en:You must enter a value for \"{{int:config-db-name}}\".\";'),('en','messages:config-missing-key','s:49:\"en:Missing MediaWiki configuration parameter \"$1\"\";'),('en','messages:config-mod-security','s:433:\"en:<strong>Warning:</strong> Your web server has [https://modsecurity.org/ mod_security]/mod_security2 enabled. Many common configurations of this will cause problems for MediaWiki and other software that allows users to post arbitrary content.\nIf possible, this should be disabled. Otherwise, refer to [https://modsecurity.org/documentation/ mod_security documentation] or contact your host\'s support if you encounter random errors.\";'),('en','messages:config-mysql-engine','s:18:\"en:Storage engine:\";'),('en','messages:config-mysql-engine-help','s:254:\"en:<strong>InnoDB</strong> is almost always the best option, since it has good concurrency support.\n\n<strong>MyISAM</strong> may be faster in single-user or read-only installations.\nMyISAM databases tend to get corrupted more often than InnoDB databases.\";'),('en','messages:config-mysql-innodb','s:23:\"en:InnoDB (recommended)\";'),('en','messages:config-mysql-old','s:46:\"en:MySQL $1 or later is required. You have $2.\";'),('en','messages:config-no-cache-apcu','s:107:\"en:<strong>Warning:</strong> Could not find [https://www.php.net/apcu APCu].\nObject caching is not enabled.\";'),('en','messages:config-no-cli-uploads-check','s:168:\"en:<strong>Warning:</strong> Your default directory for uploads (<code>$1</code>) is not checked for vulnerability\nto arbitrary script execution during the CLI install.\";'),('en','messages:config-no-cli-uri','s:100:\"en:<strong>Warning:</strong> No <code>--scriptpath</code> specified, using default: <code>$1</code>.\";'),('en','messages:config-no-db','s:433:\"en:Could not find a suitable database driver! You need to install a database driver for PHP.\nThe following database {{PLURAL:$2|type is|types are}} supported: $1.\n\nIf you compiled PHP yourself, reconfigure it with a database client enabled, for example, using <code>./configure --with-mysqli</code>.\nIf you installed PHP from a Debian or Ubuntu package, then you also need to install, for example, the <code>php-mysql</code> package.\";'),('en','messages:config-no-fts3','s:150:\"en:<strong>Warning:</strong> SQLite is compiled without the [//sqlite.org/fts3.html FTS3 module], search features will be unavailable on this backend.\";'),('en','messages:config-no-scaling','s:81:\"en:Could not find GD library or ImageMagick.\nImage thumbnailing will be disabled.\";'),('en','messages:config-no-session','s:130:\"en:Your session data was lost!\nCheck your php.ini and make sure <code>session.save_path</code> is set to an appropriate directory.\";'),('en','messages:config-no-uri','s:85:\"en:<strong>Error:</strong> Could not determine the current URI.\nInstallation aborted.\";'),('en','messages:config-nofile','s:53:\"en:File \"$1\" could not be found. Has it been deleted?\";'),('en','messages:config-ns-conflict','s:133:\"en:The specified namespace \"<nowiki>$1</nowiki>\" conflicts with a default MediaWiki namespace.\nSpecify a different project namespace.\";'),('en','messages:config-ns-generic','s:10:\"en:Project\";'),('en','messages:config-ns-invalid','s:99:\"en:The specified namespace \"<nowiki>$1</nowiki>\" is invalid.\nSpecify a different project namespace.\";'),('en','messages:config-ns-other','s:18:\"en:Other (specify)\";'),('en','messages:config-ns-other-default','s:9:\"en:MyWiki\";'),('en','messages:config-ns-site-name','s:28:\"en:Same as the wiki name: $1\";'),('en','messages:config-optional-continue','s:25:\"en:Ask me more questions.\";'),('en','messages:config-optional-skip','s:44:\"en:I\'m bored already, just install the wiki.\";'),('en','messages:config-outdated-sqlite','s:125:\"en:<strong>Warning:</strong> you have SQLite $2, which is lower than minimum required version $1. SQLite will be unavailable.\";'),('en','messages:config-page-complete','s:12:\"en:Complete!\";'),('en','messages:config-page-copying','s:10:\"en:Copying\";'),('en','messages:config-page-dbconnect','s:22:\"en:Connect to database\";'),('en','messages:config-page-dbsettings','s:20:\"en:Database settings\";'),('en','messages:config-page-existingwiki','s:16:\"en:Existing wiki\";'),('en','messages:config-page-install','s:10:\"en:Install\";'),('en','messages:config-page-language','s:11:\"en:Language\";'),('en','messages:config-page-name','s:7:\"en:Name\";'),('en','messages:config-page-options','s:10:\"en:Options\";'),('en','messages:config-page-releasenotes','s:16:\"en:Release notes\";'),('en','messages:config-page-restart','s:23:\"en:Restart installation\";'),('en','messages:config-page-upgrade','s:32:\"en:Upgrade existing installation\";'),('en','messages:config-page-upgradedoc','s:12:\"en:Upgrading\";'),('en','messages:config-page-welcome','s:24:\"en:Welcome to MediaWiki!\";'),('en','messages:config-pcre-invalid-newline','s:161:\"en:<strong>Fatal:</strong> The PCRE2 library seems to be compiled with <code>--enable-newline-is-any</code>.\nMediaWiki is not compatible with this configuration.\";'),('en','messages:config-personalization-settings','s:18:\"en:Personalization\";'),('en','messages:config-pg-no-create-privs','s:99:\"en:The account you specified for installation does not have enough privileges to create an account.\";'),('en','messages:config-pg-no-plpgsql','s:63:\"en:You need to install the language PL/pgSQL in the database $1\";'),('en','messages:config-pg-not-in-role','s:401:\"en:The account you specified for the web user already exists.\nThe account you specified for installation is not a superuser and is not a member of the web user\'s role, so it is unable to create objects owned by the web user.\n\nMediaWiki currently requires that the tables be owned by the web user. Please specify another web account name, or click \"back\" and specify a suitably privileged install user.\";'),('en','messages:config-pg-test-error','s:53:\"en:Cannot connect to database <strong>$1</strong>: $2\";'),('en','messages:config-pingback','s:157:\"en:Share data about this installation with MediaWiki developers. [https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement Privacy policy].\";'),('en','messages:config-pingback-help','s:721:\"en:If you select this option, MediaWiki will periodically ping https://www.mediawiki.org with basic data about this MediaWiki instance. This data includes, for example, the type of system, PHP version, and chosen database backend. The Wikimedia Foundation shares this data with MediaWiki developers to help guide future development efforts. The following data will be sent for your system:\n<pre>$1</pre>\n\nThe privacy policy for this feature can be seen at https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement.\n\nFor more general information about this feature, see https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgPingback.\n\nFor aggregated pingback data, see https://pingback.wmcloud.org/.\";'),('en','messages:config-postgres-old','s:51:\"en:PostgreSQL $1 or later is required. You have $2.\";'),('en','messages:config-profile','s:23:\"en:User rights profile:\";'),('en','messages:config-profile-fishbowl','s:26:\"en:Authorized editors only\";'),('en','messages:config-profile-help','s:1059:\"en:Wikis work best when you let as many people edit them as possible.\nIn MediaWiki, it is easy to review the recent changes, and to revert any damage that is done by naive or malicious users.\n\nHowever, many have found MediaWiki to be useful in a wide variety of roles, and sometimes it is not easy to convince everyone of the benefits of the wiki way.\nSo you have the choice.\n\nThe <strong>{{int:config-profile-wiki}}</strong> model allows anyone to edit, without even logging in.\nA wiki with <strong>{{int:config-profile-no-anon}}</strong> provides extra accountability, but may deter casual contributors.\n\nThe <strong>{{int:config-profile-fishbowl}}</strong> scenario allows approved users to edit, but the public can view the pages, including history.\nA <strong>{{int:config-profile-private}}</strong> only allows approved users to view pages, with the same group allowed to edit.\n\nMore complex user rights configurations are available after installation, see the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:User_rights relevant manual entry].\";'),('en','messages:config-profile-no-anon','s:28:\"en:Account creation required\";'),('en','messages:config-profile-private','s:15:\"en:Private wiki\";'),('en','messages:config-profile-wiki','s:12:\"en:Open wiki\";'),('en','messages:config-project-namespace','s:21:\"en:Project namespace:\";'),('en','messages:config-project-namespace-help','s:348:\"en:Following Wikipedia\'s example, many wikis keep their policy pages separate from their content pages, in a \'\'\'project namespace\'\'\'.\nAll page titles in this namespace start with a certain prefix, which you can specify here.\nUsually, this prefix is derived from the name of the wiki, but it cannot contain punctuation characters such as \"#\" or \":\".\";'),('en','messages:config-regenerate','s:35:\"en:Regenerate LocalSettings.php \";'),('en','messages:config-restart','s:18:\"en:Yes, restart it\";'),('en','messages:config-screenshot','s:13:\"en:screenshot\";'),('en','messages:config-server','s:17:\"en:URL host name:\";'),('en','messages:config-server-help','s:126:\"en:The protocol and host name part of the URL used to access your wiki. The automatically detected default is usually correct.\";'),('en','messages:config-session-error','s:29:\"en:Error starting session: $1\";'),('en','messages:config-session-expired','s:204:\"en:Your session data seems to have expired.\nSessions are configured for a lifetime of $1.\nYou can increase this by setting <code>session.gc_maxlifetime</code> in php.ini.\nRestart the installation process.\";'),('en','messages:config-show-table-status','s:47:\"en:<code>SHOW TABLE STATUS</code> query failed!\";'),('en','messages:config-sidebar','s:501:\"en:* [https://www.mediawiki.org MediaWiki home]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents User\'s Guide]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Contents Administrator\'s Guide]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ FAQ]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Communication Seek help]\n* [https://phabricator.wikimedia.org/ Bug tracker]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/How_to_contribute Contribute]\";'),('en','messages:config-sidebar-license','s:10:\"en:Copying\";'),('en','messages:config-sidebar-relnotes','s:16:\"en:Release notes\";'),('en','messages:config-sidebar-upgrade','s:12:\"en:Upgrading\";'),('en','messages:config-site-name','s:16:\"en:Name of wiki:\";'),('en','messages:config-site-name-blank','s:21:\"en:Enter a site name.\";'),('en','messages:config-site-name-help','s:80:\"en:This will appear in the title bar of the browser and in various other places.\";'),('en','messages:config-skins','s:8:\"en:Skins\";'),('en','messages:config-skins-help','s:133:\"en:The skins listed above were detected in your <code>./skins</code> directory. You must enable at least one, and choose the default.\";'),('en','messages:config-skins-missing','s:94:\"en:No skins were found; MediaWiki will use a fallback skin until you install some proper ones.\";'),('en','messages:config-skins-must-enable-default','s:46:\"en:The skin chosen as default must be enabled.\";'),('en','messages:config-skins-must-enable-some','s:47:\"en:You must choose at least one skin to enable.\";'),('en','messages:config-skins-screenshot','s:10:\"en:$1 ($2)\";'),('en','messages:config-skins-screenshots','s:23:\"en:$1 (screenshots: $2)\";'),('en','messages:config-skins-use-as-default','s:27:\"en:Use this skin as default\";'),('en','messages:config-skip-shared-domain','s:42:\"en:Skipping potentially shared domain \"$1\"\";'),('en','messages:config-sqlite-cant-create-db','s:50:\"en:Could not create database file <code>$1</code>.\";'),('en','messages:config-sqlite-connection-error','s:71:\"en:$1.\n\nCheck the data directory and database name below and try again.\";'),('en','messages:config-sqlite-dir','s:25:\"en:SQLite data directory:\";'),('en','messages:config-sqlite-dir-help','s:625:\"en:SQLite stores all data in a single file.\n\nThe directory you provide must be writable by the webserver during installation.\n\nIt should <strong>not</strong> be accessible via the web; this is why we\'re not putting it where your PHP files are.\n\nThe installer will write a <code>.htaccess</code> file along with it, but if that fails someone can gain access to your raw database.\nThat includes raw user data (email addresses, hashed passwords) as well as deleted revisions and other restricted data on the wiki.\n\nConsider putting the database somewhere else altogether, for example in <code>/var/lib/mediawiki/yourwiki</code>.\";'),('en','messages:config-sqlite-dir-unwritable','s:118:\"en:Unable to write to the directory \"$1\".\nChange its permissions so that the webserver can write to it, and try again.\";'),('en','messages:config-sqlite-fts3-downgrade','s:51:\"en:PHP is missing FTS3 support, downgrading tables.\";'),('en','messages:config-sqlite-mkdir-error','s:76:\"en:Error creating the data directory \"$1\".\nCheck the location and try again.\";'),('en','messages:config-sqlite-name-help','s:121:\"en:Choose a name that identifies your wiki.\nDo not use spaces or hyphens.\nThis will be used for the SQLite data filename.\";'),('en','messages:config-sqlite-parent-unwritable-group','s:393:\"en:Cannot create the data directory <code><nowiki>$1</nowiki></code>, because the parent directory <code><nowiki>$2</nowiki></code> is not writable by the webserver.\n\nThe installer has determined the user your webserver is running as.\nMake the <code><nowiki>$3</nowiki></code> directory writable by it to continue.\nOn a Unix/Linux system do:\n\n<pre>cd $2\nmkdir $3\nchgrp $4 $3\nchmod g+w $3</pre>\";'),('en','messages:config-sqlite-parent-unwritable-nogroup','s:409:\"en:Cannot create the data directory <code><nowiki>$1</nowiki></code>, because the parent directory <code><nowiki>$2</nowiki></code> is not writable by the webserver.\n\nThe installer could not determine the user your webserver is running as.\nMake the <code><nowiki>$3</nowiki></code> directory globally writable by it (and others!) to continue.\nOn a Unix/Linux system do:\n\n<pre>cd $2\nmkdir $3\nchmod a+w $3</pre>\";'),('en','messages:config-sqlite-readonly','s:45:\"en:The file <code>$1</code> is not writeable.\";'),('en','messages:config-subscribe','s:141:\"en:Subscribe to the [https://lists.wikimedia.org/postorius/lists/mediawiki-announce.lists.wikimedia.org/ release announcements mailing list].\";'),('en','messages:config-subscribe-help','s:206:\"en:This is a low-volume mailing list used for release announcements, including important security announcements.\nYou should subscribe to it and update your MediaWiki installation when new versions come out.\";'),('en','messages:config-subscribe-noemail','s:181:\"en:You tried to subscribe to the release announcements mailing list without providing an email address.\nPlease provide an email address if you wish to subscribe to the mailing list.\";'),('en','messages:config-support-info','s:193:\"en:MediaWiki supports the following database systems:\n\n$1\n\nIf you do not see the database system you are trying to use listed below, then follow the instructions linked above to enable support.\";'),('en','messages:config-title','s:28:\"en:MediaWiki $1 installation\";'),('en','messages:config-type-mysql','s:32:\"en:MariaDB, MySQL, or compatible\";'),('en','messages:config-type-postgres','s:13:\"en:PostgreSQL\";'),('en','messages:config-type-sqlite','s:9:\"en:SQLite\";'),('en','messages:config-unknown-collation','s:70:\"en:<strong>Warning:</strong> Database is using unrecognized collation.\";'),('en','messages:config-upgrade-done','s:242:\"en:Upgrade complete.\n\nYou can now [$1 start using your wiki].\n\nIf you want to regenerate your <code>LocalSettings.php</code> file, click the button below.\nThis is <strong>not recommended</strong> unless you are having problems with your wiki.\";'),('en','messages:config-upgrade-done-no-regenerate','s:61:\"en:Upgrade complete.\n\nYou can now [$1 start using your wiki].\";'),('en','messages:config-upgrade-error','s:165:\"en:There was an error while upgrading the MediaWiki tables in your database.\n\nFor more information look into the log above, to retry click <strong>Continue</strong>.\";'),('en','messages:config-upgrade-key-missing','s:177:\"en:An existing installation of MediaWiki has been detected.\nTo upgrade this installation, please put the following line at the bottom of your <code>LocalSettings.php</code>:\n\n$1\";'),('en','messages:config-upload-deleted','s:31:\"en:Directory for deleted files:\";'),('en','messages:config-upload-deleted-help','s:109:\"en:Choose a directory in which to archive deleted files.\nIdeally, this should not be accessible from the web.\";'),('en','messages:config-upload-enable','s:22:\"en:Enable file uploads\";'),('en','messages:config-upload-help','s:375:\"en:File uploads potentially expose your server to security risks.\nFor more information, read the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security security section] in the manual.\n\nTo enable file uploads, change the mode on the <code>images</code> subdirectory under MediaWiki\'s root directory so that the web server can write to it.\nThen enable this option.\";'),('en','messages:config-upload-settings','s:26:\"en:Images and file uploads\";'),('en','messages:config-uploads-not-safe','s:363:\"en:<strong>Warning:</strong> Your default directory for uploads <code>$1</code> is vulnerable to arbitrary scripts execution.\nAlthough MediaWiki checks all uploaded files for security threats, it is highly recommended to [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security#Upload_security close this security vulnerability] before enabling uploads.\";'),('en','messages:config-uploads-security-headers','s:370:\"en:<strong>Warning:</strong> Requests for images in your uploads directory should answer with the HTTP header <code>$1</code> to protect browsers from potentially unsafe files.\nIt is highly recommended to [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security#Upload_security configure appropriate response headers on your webserver] before enabling uploads.\";'),('en','messages:config-uploads-security-requesterror','s:418:\"en:<strong>Warning:</strong> Because of a connection error, it