unt really does belong to you and activate\nemail features on {{SITENAME}}, open this link in your browser:\n\n$3\n\nIf the account does *not* belong to you, follow this link\nto cancel the email address confirmation:\n\n$5\n\nThis confirmation code will expire at $4.\";'),('en','messages:confirmemail_invalid','s:56:\"en:Invalid confirmation code.\nThe code may have expired.\";'),('en','messages:confirmemail_invalid_format','s:117:\"en:Invalid confirmation code.\nCheck your email, the confirmation link might have been truncated by your email client.\";'),('en','messages:confirmemail_invalidated','s:38:\"en:Email address confirmation canceled\";'),('en','messages:confirmemail_loggedin','s:45:\"en:Your email address has now been confirmed.\";'),('en','messages:confirmemail_needlogin','s:43:\"en:Please $1 to confirm your email address.\";'),('en','messages:confirmemail_noemail','s:94:\"en:You do not have a valid email address set in your [[Special:Preferences|user preferences]].\";'),('en','messages:confirmemail_oncreate','s:177:\"en:A confirmation code was sent to your email address.\nThis code is not required to log in, but you will need to provide it before enabling any email-based features in the wiki.\";'),('en','messages:confirmemail_pending','s:182:\"en:A confirmation code has already been emailed to you;\nif you recently created your account, you may wish to wait a few minutes for it to arrive before trying to request a new code.\";'),('en','messages:confirmemail_send','s:27:\"en:Mail a confirmation code\";'),('en','messages:confirmemail_sendfailed','s:131:\"en:{{SITENAME}} could not send your confirmation mail.\nPlease check your email address for invalid characters.\n\nMailer returned: $1\";'),('en','messages:confirmemail_sent','s:27:\"en:Confirmation email sent.\";'),('en','messages:confirmemail_subject','s:42:\"en:{{SITENAME}} email address confirmation\";'),('en','messages:confirmemail_success','s:102:\"en:Your email address has been confirmed.\nYou may no