erences.\";'),('en','messages:discussiontools-autotopicsubpopup-dismiss','s:17:\"en:Okay, I got it\";'),('en','messages:discussiontools-autotopicsubpopup-preferences','s:19:\"en:Edit preferences\";'),('en','messages:discussiontools-autotopicsubpopup-title','s:39:\"en:{{GENDER:|You}} have been subscribed\";'),('en','messages:discussiontools-comments-before-first-heading-category','s:4:\"en:-\";'),('en','messages:discussiontools-comments-before-first-heading-category-desc','s:206:\"en:The discussion page contains comments in the lede section (before first heading). This may cause the lede or the comments to be displayed incorrectly, especially in the mobile version and in mobile apps.\";'),('en','messages:discussiontools-defaultsummary-reply','s:8:\"en:Reply\";'),('en','messages:discussiontools-desc','s:37:\"en:Tools to enhance discussion pages.\";'),('en','messages:discussiontools-emptystate-button','s:21:\"en:Start a discussion\";'),('en','messages:discussiontools-emptystate-desc','s:274:\"en:[[{{MediaWiki:discussiontools-emptystate-link-talkpages}}|Talk pages]] are where people discuss how to make content on {{SITENAME}} the best that it can be. {{GENDER:|You}} can use this page to start a discussion with others about how to improve [[:{{SUBJECTPAGENAME}}]].\";'),('en','messages:discussiontools-emptystate-desc-self','s:192:\"en:People on {{SITENAME}} can use this [[{{MediaWiki:discussiontools-emptystate-link-userpage}}|talk page]] to post a public message for {{GENDER:|you}}, and you will be notified when they do.\";'),('en','messages:discussiontools-emptystate-desc-self-anon','s:440:\"en:People on {{SITENAME}} can use this [[{{MediaWiki:discussiontools-emptystate-link-userpage-anon}}|talk page]] to post a public message about edits made from the IP address {{GENDER:|you}} are currently using.\n\nMany IP addresses change periodically, and are often shared by several people. You may [$1 create an account] or [$2 log in] to avoid future confusion with other logged out users. Creating an account also hides your IP address.\";'),('en','messages:discussiontools-emptystate-desc-self-temp','s:331:\"en:People on {{SITENAME}} can use this [[{{MediaWiki:discussiontools-emptystate-link-userpage}}|talk page]] to post a public message for {{GENDER:|you}}.\n\nEventually, [[{{MediaWiki:tempuser-helppage}}|this page will expire]]. To continue receiving notifications, and to access other features, [$1 create an account] or [$2 log in].\";'),('en','messages:discussiontools-emptystate-desc-user','s:340:\"en:[[{{MediaWiki:discussiontools-emptystate-link-userpage}}|Talk pages]] are where people discuss how to make content on {{SITENAME}} the best that it can be. Start a new discussion to connect and collaborate {{GENDER:{{PAGENAME}}|with}} [[:{{SUBJECTPAGENAME}}|{{PAGENAME}}]]. What {{GENDER:|you}} say here will be public for others to see.\";'),('en','messages:discussiontools-emptystate-desc-user-anon','s:385:\"en:[[{{MediaWiki:discussiontools-emptystate-link-userpage-anon}}|Talk pages]] are where people discuss how to make content on {{SITENAME}} the best that it can be. Use this page to start a discussion about the edits made from this IP address. What {{GENDER:|you}} say here will be public for others to see. Many IP addresses change periodically, and are often shared by several people.\";'),('en','messages:discussiontools-emptystate-desc-user-temp','s:469:\"en:Use this [[{{MediaWiki:discussiontools-emptystate-link-userpage-temp}}|talk page]] to start a discussion {{GENDER:{{PAGENAME}}|with}} [[:{{SUBJECTPAGENAME}}|{{PAGENAME}}]] about how to improve {{SITENAME}}. What {{GENDER:|you}} say will be publicly visible for others to see. Since [[:{{SUBJECTPAGENAME}}|{{PAGENAME}}]] is a [[{{MediaWiki:tempuser-helppage}}|temporary account]], this talk page will eventually expire. [[{{MediaWiki:tempuser-helppage}}|Learn more]].\";'),('en','messages:discussiontools-emptystate-link-talkpages','s:51:\"en:mediawikiwiki:Special:MyLanguage/Help:Talk_pages\"