ematypes','s:15:\"en:Schema types\";'),('en','messages:smw-admin-configutation-tab-settings','s:11:\"en:Settings\";'),('en','messages:smw-admin-db','s:17:\"en:Database setup\";'),('en','messages:smw-admin-db-preparation','s:140:\"en:The table initialization is ongoing and may take a moment before results are displayed pending the size and possible table optimizations.\";'),('en','messages:smw-admin-dbbutton','s:31:\"en:Initialize or upgrade tables\";'),('en','messages:smw-admin-dbdocu','s:319:\"en:Semantic MediaWiki requires its own database structure (and is independent from MediaWiki hence do not affect the rest of the MediaWiki installation) in order to store the semantic data.\nThis setup function can be executed multiple times without doing any harm, but it is needed only once on installation or upgrade.\";'),('en','messages:smw-admin-deprecation-notice-config-notice','s:108:\"en:<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> is deprecated and will be removed in $2\";'),('en','messages:smw-admin-deprecation-notice-config-notice-option','s:137:\"en:<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> will remove (or replace) the following {{PLURAL:$2|option|options}}:\";'),('en','messages:smw-admin-deprecation-notice-config-notice-option-list','s:58:\"en:<code>$1</code> is deprecated and will be removed in $2\";'),('en','messages:smw-admin-deprecation-notice-config-removal','s:86:\"en:<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> was removed in $2\";'),('en','messages:smw-admin-deprecation-notice-config-replacement','s:150:\"en:<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> was replaced by <code>[https://www.semantic-mediawiki.org/wiki/Help:$2 $2]</code>\";'),('en','messages:smw-admin-deprecation-notice-config-replacement-option','s:98:\"en:<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> {{PLURAL:$2|option|options}}:\";'),('en','messages:smw-admin-deprecation-notice-config-replacement-option-list','s:55:\"en:<code>$1</code> is being replaced by <code>$2</code>\";'),('en','messages:smw-admin-deprecation-notice-config-replacement-other','s:100:\"en:<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> was replaced by <code>$2</code>\";'),('en','messages:smw-admin-deprecation-notice-docu','s:209:\"en:The following section contains settings that have been deprecated or removed but were detected to be active on this wiki. It is expected that any future release will remove support for these configurations.\";'),('en','messages:smw-admin-deprecation-notice-section','s:21:\"en:Semantic MediaWiki\";'),('en','messages:smw-admin-deprecation-notice-section-legend','s:9:\"en:Legend\";'),('en','messages:smw-admin-deprecation-notice-title','s:22:\"en:Deprecation notices\";'),('en','messages:smw-admin-deprecation-notice-title-notice','s:22:\"en:Deprecated settings\";'),('en','messages:smw-admin-deprecation-notice-title-notice-explanation','s:154:\"en:<b>Deprecated settings</b> shows settings that have been detected to be used on this wiki and are planned to be removed or changed in a future release.\";'),('en','messages:smw-admin-deprecation-notice-title-removal','s:19:\"en:Removed settings\";'),('en','messages:smw-admin-deprecation-notice-title-removal-explanation','s:134:\"en:<b>Removed settings</b> identifies settings that were removed in a previous release but have been detected to be used on this wiki.\";'),('en','messages:smw-admin-deprecation-notice-title-replacement','s:31:\"en:Replaced or renamed settings\";'),('en','messages:smw-admin-deprecation-notice-title-replacement-explanation','s:160:\"en:<b>Replaced or renamed settings</b> contains settings that were renamed or otherwise modified and it is recommended to forthwith update their name or format.\";'),('en','messages:smw-admin-docu','s:314:\"en:This special page helps you during installation, upgrade, maintenance and usage of <a href=\"https://www.semantic-mediawiki.org\">Semantic MediaWiki</a> and also provides further administrative functions and tasks as well as statistics.\nRemember to back up valuable data before executing administrative functions.\";'),('en','messages:smw-admin-environment','s:23:\"en:Software environment\";'),('en','messages:smw-admin-feature-disabled','s:200:\"en:This feature has been disabled on this wiki, please consult the <a href=\"https://www.semantic-mediawiki.org/wiki/Help:$smwgAdminFeatures\">settings</a> help page or contact the system administrator.\";'),('en','messages:smw-admin-fulltext-active','s:53:\"en:A full-text search rebuild job has been scheduled.\";'),('en','messages:smw-admin-fulltext-button','s:29:\"en:Schedule full-text rebuild\";'),('en','messages:smw-admin-fulltext-intro','s:283:\"en:Rebuilds the search index from property tables with an enabled [https://www.semantic-mediawiki.org/wiki/Full-text full-text search] datatype. Changes to the index rules (altered stopwords, new stemmer etc.) and/or a newly added or altered table does require to run this job again.\";'),('en','messages:smw-admin-fulltext-title','s:27:\"en:Full-text search rebuild\";'),('en','messages:smw-admin-helplink','s:73:\"en:https://www.semantic-mediawiki.org/wiki/Help:Special:SemanticMediaWiki\";'),('en','messages:smw-admin-iddispose-docu','s:345:\"en:It should be noted that the disposal operation is unrestricted and will remove the entity from the storage engine together with all its references in pending tables, if confirmed. Please perform this task with \'\'\'caution\'\'\' and only after the [https://www.semantic-mediawiki.org/wiki/Help:Object_ID_disposal documentation] has been consulted.\";'),('en','messages:smw-admin-iddispose-done','s:48:\"en:ID \"$1\" was removed from the storage backend.\";'),('en','messages:smw-admin-iddispose-no-references','s:56:\"en:The search was unable to match \"$1\" to a table entry.\";'),('en','messages:smw-admin-iddispose-references','s:62:\"en:ID \"$1\" has {{PLURAL:$2|no|at least one}} active reference:\";'),('en','messages:smw-admin-iddispose-references-multiple','s:61:\"en:List of matches with at least one active reference record.\";'),('en','messages:smw-admin-iddispose-title','s:11:\"en:Disposal\";'),('en','messages:smw-admin-idlookup-docu','s:306:\"en:This section shows technical details about an individual entity (wikipage, subobject, property, etc.) in Semantic MediaWiki. The input can be a numeric ID or a string value to match the relevant search field, yet any ID reference relates to Semantic MediaWiki and not to MediaWiki\'s page or revision ID.\";'),('en','messages:smw-admin-idlookup-input','s:10:\"en:Search:\";'),('en','messages:smw-admin-idlookup-title','s:9:\"en:Lookup\";'),('en','messages:smw-admin-installfile','s:302:\"en:If you experience problems with your installation, start by checking the guidelines in the <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/blob/master/docs/INSTALL.md\">INSTALL file</a> and the <a href=\"https://www.semantic-mediawiki.org/wiki/Help:Installation\">installation page</a>.\";'),('en','messages:smw-admin-job-scheduler-note','s:407:\"en:Tasks (those enabled) in this section are performed via the job queue to avoid deadlock situations during their execution. The [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue job queue] is responsible for the processing and it is critical that the <code>runJobs.php</code> maintenance script has an appropriate capacity (see also configuration parameter <code>$wgRunJobsAsync</code>).\";'),('en','messages:smw-admin-main-title','s:27:\"en:Semantic MediaWiki  $1\";'),('en','messages:smw-admin-maintenance-no-description','s:18:\"en:No description.\";'),('en','messages:smw-admin-maintenance-script-description-disposeoutdatedentities','s:48:\"en:Dispose of outdated entities and query links.\";'),('en','messages:smw-admin-maintenance-script-description-dumprdf','s:34:\"en:RDF export of existing triples.\";'),('en','messages:smw-admin-maintenance-script-description-populatehashfield','s:72:\"en:Populates the <code>smw_hash</code> field for rows missing the value.\";'),('en','messages:smw-admin-maintenance-script-description-purgeentitycache','s:68:\"en:Purge cache entries for known entities and their associated data.\";'),('en','messages:smw-admin-maintenance-script-description-rebuildconceptcache','s:127:\"en:This script is used to manage concept caches for Semantic MediaWiki where it can create, remove, and update selected caches.\";'),('en','messages:smw-admin-maintenance-script-description-rebuilddata','s:115:\"en:Recreates all the semantic data in the database, by cycling through all the pages that might have semantic data.\";'),('en','messages:smw-admin-maintenance-script-description-rebuildelasticindex','s:157:\"en:Rebuilds the Elasticsearch index (only for installations that use the <code>ElasticStore</code>), by cycling through all entities that have semantic data.\";'),('en','messages:smw-admin-maintenance-script-description-rebuildelasticmissingdocuments','s:143:\"en:Find missing entities in Elasticsearch (only for installations that use the <code>ElasticStore</code>) and schedule appropriate update jobs.\";'),('en','messages:smw-admin-maintenance-script-description-rebuildfulltextsearchtable','s:115:\"en:Rebuilds the <code>SQLStore</code> fulltext search index (for installations where the setting has been enabled).\";'),('en','messages:smw-admin-maintenance-script-description-rebuildpropertystatistics','s:59:\"en:Rebuilds the usage statistics for all property entities.\";'),('en','messages:smw-admin-maintenance-script-description-removeduplicateentities','s:86:\"en:Removes duplicate entities found in selected tables that have no active references.\";'),('en','messages:smw-admin-maintenance-script-description-runimport','s:139:\"en:Populate and import auto-discovered content from [https://www.semantic-mediawiki.org/wiki/Help:$smwgImportFileDirs $smwgImportFileDirs].\";'),('en','messages:smw-admin-maintenance-script-description-setupstore','s:86:\"en:Sets up the storage and query backend as defined in <code>LocalSettings.php</code>.\";'),('en','messages:smw-admin-maintenance-script-description-updateentitycollation','s:194:\"en:Updates the <code>smw_sort</code> field in the <code>SQLStore</code> (in accordance with the [https://www.semantic-mediawiki.org/wiki/Help:$smwgEntityCollation $smwgEntityCollation] setting).\";'),('en','messages:smw-admin-maintenance-script-description-updatequerydependencies','s:182:\"en:Update queries and query dependencies (see the [https://www.semantic-mediawiki.org/wiki/Help:$smwgEnabledQueryDependencyLinksStore $smwgEnabledQueryDependencyLinksStore] setting).\";'),('en','messages:smw-admin-maintenance-script-section-intro','s:130:\"en:The following maintenance scripts require an administrator and access to the command line to be able to execute listed scripts.\";'),('en','messages:smw-admin-maintenance-script-section-rebuild','s:18:\"en:Rebuild scripts\";'),('en','messages:smw-admin-maintenance-script-section-title','s:40:\"en:List of available maintenance scripts\";'),('en','messages:smw-admin-maintenance-script-section-update','s:17:\"en:Update scripts\";'),('en','messages:smw-admin-maintenance-tab-scripts','s:22:\"en:Maintenance scripts\";'),('en','messages:smw-admin-maintenance-tab-tasks','s:8:\"en:Tasks\";'),('en','messages:smw-admin-maintenancealerts-invalidentities-alert','s:461:\"en:The system matched $1 [https://www.semantic-mediawiki.org/wiki/Invalid_entities {{PLURAL:$1|entity|entities}}] to an [https://www.semantic-mediawiki.org/wiki/Unmaintained_namespace unmaintained namespace] and it is recommended to run the [https://www.semantic-mediawiki.org/wiki/disposeOutdatedEntities.php <code>disposeOutdatedEntities.php</code>] or [https://www.semantic-mediawiki.org/wiki/rebuildData.php <code>rebuildData.php</code>] maintenance script.\";'),('en','messages:smw-admin-maintenancealerts-invalidentities-alert-title','s:19:\"en:Invalid entities\";'),('en','messages:smw-admin-maintenancealerts-lastoptimizationrun-alert','s:404:\"en:The system has found that the last [https://www.semantic-mediawiki.org/wiki/Table_optimization table optimization] was run $2 days ago (record from $1) which exceeds the $3 days maintenance threshold. As mentioned in the documentation, running optimizations will allow the query planner to make better decisions about queries therefore it is suggested to run the table optimization on a regular basis.\";'),('en','messages:smw-admin-maintenancealerts-lastoptimizationrun-alert-title','s:21:\"en:Table optimization\";'),('en','messages:smw-admin-maintenancealerts-outdatedentitiesmaxcount-alert','s:355:\"en:The system has counted $1 [https://www.semantic-mediawiki.org/wiki/Outdated_entities outdated entities] and reached a critical level of unattended maintenance by exceeding the threshold of $2. It is recommended to run the [https://www.semantic-mediawiki.org/wiki/disposeOutdatedEntities.php <code>disposeOutdatedEntities.php</code>] maintenance script.\";'),('en','messages:smw-admin-maintenancealerts-outdatedentitiesmaxcount-alert-title','s:20:\"en:Outdated entities\";'),('en','messages:smw-admin-maintenancealerts-section-intro','s:149:\"en:The following alerts and notices should be resolved and while not essential it is expected to help improve system and operational maintainability.\";'),('en','messages:smw-admin-objectid','s:6:\"en:ID:\";'),('en','messages:smw-admin-operational-statistics','s:197:\"en:This page contains operational statistics collected in or from Semantic MediaWiki related functions. An extended list of wiki specific statistics can be found [[Special:Statistics|<b>here</b>]].\";'),('en','messages:smw-admin-other-functions','s:18:\"en:Other functions\";'),('en','messages:smw-admin-outdateddisposal-active','s:56:\"en:An outdated entities disposal job has been scheduled.\";'),('en','messages:smw-admin-outdateddisposal-button','s:20:\"en:Schedule disposal\";'),('en','messages:smw-admin-outdateddisposal-intro','s:282:\"en:Some activities (a change to a property type, the removal of wikipages, or the correction of error values) will result in [https://www.semantic-mediawiki.org/wiki/Outdated_entities outdated entities] and it is suggested to remove them periodically to free associated table space.\";'),('en','messages:smw-admin-outdateddisposal-title','s:29:\"en:Outdated entities disposal\";'),('en','messages:smw-admin-permission-missing','s:213:\"en:The access to this page has been blocked due to missing permissions, please consult the [https://www.semantic-mediawiki.org/wiki/Help:Permissions permissions] help page for details about the necessary settings.\";'),('en','messages:smw-admin-permissionswarn','s:435:\"en:If the operation fails with SQL errors, the database user employed by your wiki (check your \"LocalSettings.php\" file) probably does not have sufficient permissions.\nEither grant this user additional permissions to create and delete tables, temporarily enter the login of your database root in the \"LocalSettings.php\" file, or use the maintenance script <code>setupStore.php</code>, which can use the credentials of an administrator.\";'),('en','messages:smw-admin-propertystatistics-active','s:56:\"en:A property statistics rebuild job has been scheduled.\";'),('en','messages:smw-admin-propertystatistics-button','s:30:\"en:Schedule statistics rebuild\";'),('en','messages:smw-admin-propertystatistics-intro','s:180:\"en:Rebuilds the entire property usage statistics and therein updates and corrects the [https://www.semantic-mediawiki.org/wiki/Help:Property_usage_count usage count] of properties.\";'),('en','messages:smw-admin-propertystatistics-title','s:30:\"en:Property statistics rebuild\";'),('en','messages:smw-admin-questions','s:191:\"en:If you have further questions or suggestions, join the discussion on the Semantic MediaWiki <a href=\"https://sourceforge.net/p/semediawiki/mailman/semediawiki-user/\">user mailing list</a>.\";'),('en','messages:smw-admin-settings-docu','s:254:\"en:Displays a list of all default and localized settings that are relevant to the Semantic MediaWiki environment. For details on individual settings, please consult the [https://www.semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),('en','messages:smw-admin-setupsuccess','s:33:\"en:The storage engine was set up.\";'),('en','messages:smw-admin-smwhomepage','s:142:\"en:The complete user documentation to Semantic MediaWiki is at <b><a href=\"https://www.semantic-mediawiki.org\">semantic-mediawiki.org</a></b>.\";'),('en','messages:smw-admin-statistics','s:13:\"en:Statistics\";'),('en','messages:smw-admin-statistics-extra','s:22:\"en:Statistic functions\";'),('en','messages:smw-admin-statistics-job-docu','s:309:\"en:The job statistics displays information about scheduled Semantic MediaWiki jobs that have not yet been executed. The number of jobs may be slightly inaccurate or contain failed attempts. Please consult the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue manual] for further information.\";'),('en','messages:smw-admin-statistics-job-title','s:17:\"en:Job statistics\";'),('en','messages:smw-admin-statistics-querycache-disabled','s:147:\"en:The [https://www.semantic-mediawiki.org/wiki/QueryCache QueryCache] has not been enabled on this wiki and therefore no statistics are available.\";'),('en','messages:smw-admin-statistics-querycache-legend','s:866:\"en:The cache statistics is to contain provisional cumulative as well as derived data including:\n* \"misses\" as the total attempts to retrieve data from the cache with unattainable responses, forcing a direct repository (DB, triple-store etc.) retrieval\n* \"deletes\" as the total amount of cache eviction operations (either through a purge or query dependency)\n* \"hits\" contains the amount of cache retrievals from either embedded (queries called from within a wiki page) or non-embedded (if enabled, requested by pages like Special:Ask or the API) sources\n* \"medianRetrievalResponseTime\" is an orientation value of the median response time (in sec.) for cached and non-cached retrieval requests over the time span of the collection process\n* \"noCache\" indicates the amount of no attempt requests (limit=0 queries, \'no-cache\' option etc.) to retrieve results from cache\";'),('en','messages:smw-admin-statistics-querycache-title','s:14:\"en:Query cache\";'),('en','messages:smw-admin-statistics-section-explain','s:65:\"en:The section provides additional statistics for administrators.\";'),('en','messages:smw-admin-statistics-semanticdata-overview','s:11:\"en:Overview\";'),('en','messages:smw-admin-supplementary-duplookup-docu','s:301:\"en:This page lists entries from selected tables that have been categorized as [https://www.semantic-mediawiki.org/wiki/Help:Duplicate_entities duplicates]. Duplicate entries should (if at all) only occur on rare occasions potentially caused by a terminated update or unsuccessful rollback transaction.\";'),('en','messages:smw-admin-supplementary-duplookup-helplink','s:66:\"en:https://www.semantic-mediawiki.org/wiki/Help:Duplicate_entities\";'),('en','messages:smw-admin-supplementary-duplookup-intro','s:94:\"en:<u>$1</u> to find entities that are categorized as duplicates for the selected table matrix\";'),('en','messages:smw-admin-supplementary-duplookup-title','s:28:\"en:Duplicate entities lookup\";'),('en','messages:smw-admin-supplementary-elastic-config','s:17:\"en:Configurations\";'),('en','messages:smw-admin-supplementary-elastic-docu','s:259:\"en:This page contains information about settings, mappings, health, and index statistics related to an Elasticsearch cluster that is connected to Semantic MediaWiki and its [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore <code>ElasticStore</code>].\";'),('en','messages:smw-admin-supplementary-elastic-endpoints','s:12:\"en:Endpoints\";'),('en','messages:smw-admin-supplementary-elastic-functions','s:22:\"en:Supported functions\";'),('en','messages:smw-admin-supplementary-elastic-indices-intro','s:75:\"en:<u>$1</u> provides an overview of available indices and their statistics\";'),('en','messages:smw-admin-supplementary-elastic-indices-title','s:10:\"en:Indices\";'),('en','messages:smw-admin-supplementary-elastic-intro','s:62:\"en:<u>$1</u> shows details about settings and index statistics\";'),('en','messages:smw-admin-supplementary-elastic-mappings-docu','s:243:\"en:This page contains field mapping details used by the current index. It is recommended to monitor the mappings in connection with the <code>index.mapping.total_fields.limit</code> (specifies the maximum number of fields in an index allowed).\";'),('en','messages:smw-admin-supplementary-elastic-mappings-docu-extra','s:240:\"en:The <code>property_fields</code> refers to the count of indexed core fields while the <code>nested_fields</code> refers to an accumulated count of additional fields assigned to a core field to support specific structured search patterns.\";'),('en','messages:smw-admin-supplementary-elastic-mappings-fields','s:17:\"en:Field mappings\";'),('en','messages:smw-admin-supplementary-elastic-mappings-intro','s:47:\"en:<u>$1</u> to list indices and field mappings\";'),('en','messages:smw-admin-supplementary-elastic-mappings-summary','s:10:\"en:Summary\";'),('en','messages:smw-admin-supplementary-elastic-mappings-title','s:11:\"en:Mappings\";'),('en','messages:smw-admin-supplementary-elastic-no-connection','s:219:\"en:The wiki is currently \'\'\'unable\'\'\' to establish a connection to the Elasticsearch cluster, please contact the wiki administrator to investigate the issue as it incapacitates the index and query ability of the system.\";'),('en','messages:smw-admin-supplementary-elastic-nodes-intro','s:34:\"en:<u>$1</u> shows node statistics\";'),('en','messages:smw-admin-supplementary-elastic-nodes-title','s:8:\"en:Nodes\";'),('en','messages:smw-admin-supplementary-elastic-replication-docu','s:327:\"en:This page provides information about the [https://www.semantic-mediawiki.org/wiki/Help:Replication_monitoring replication status] of entities that were reported to have issues with the Elasticsearch cluster. It is recommended to review listed entities and purge the content in order to confirm that it was a temporary issue.\";'),('en','messages:smw-admin-supplementary-elastic-replication-files','s:8:\"en:Files\";'),('en','messages:smw-admin-supplementary-elastic-replication-files-docu','s:211:\"en:It should be noted that for the list of files, the [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore/File_ingestion file ingest] job is required to be executed first and has to finish its processing.\";'),('en','messages:smw-admin-supplementary-elastic-replication-function-title','s:14:\"en:Replication\";'),('en','messages:smw-admin-supplementary-elastic-replication-header-title','s:21:\"en:Replication status\";'),('en','messages:smw-admin-supplementary-elastic-replication-intro','s:56:\"en:<u>$1</u> shows information about failed replications\";'),('en','messages:smw-admin-supplementary-elastic-replication-pages','s:8:\"en:Pages\";'),('en','messages:smw-admin-supplementary-elastic-section-subtitle','s:16:\"en:Elasticsearch\";'),('en','messages:smw-admin-supplementary-elastic-settings-intro','s:71:\"en:<u>$1</u> used by Elasticsearch to manage Semantic MediaWiki indices\";'),('en','messages:smw-admin-supplementary-elastic-settings-title','s:21:\"en:Settings (indices)\";'),('en','messages:smw-admin-supplementary-elastic-statistics-docu','s:349:\"en:This page provides an insight on indices statistics for different operations that are happening on an index level, the returned stats are aggregated with primaries and total aggregations. The [https://www.elastic.co/guide/en/elasticsearch/reference/current/indices-stats.html help page] contains a detailed description of available indices stats.\";'),('en','messages:smw-admin-supplementary-elastic-statistics-intro','s:41:\"en:<u>$1</u> shows index level statistics\";'),('en','messages:smw-admin-supplementary-elastic-statistics-title','s:13:\"en:Statistics\";'),('en','messages:smw-admin-supplementary-elastic-status-file-ingest-job-count','s:45:\"en:Ingest (file) job backlog: $1 (estimation)\";'),('en','messages:smw-admin-supplementary-elastic-status-last-active-replication','s:30:\"en:Last active replication: $1\";'),('en','messages:smw-admin-supplementary-elastic-status-rebuild-lock','s:47:\"en:Replication locked: $1 (rebuild in-progress)\";'),('en','messages:smw-admin-supplementary-elastic-status-recovery-job-count','s:40:\"en:Recovery job backlog: $1 (estimation)\";'),('en','messages:smw-admin-supplementary-elastic-status-refresh-interval','s:23:\"en:Refresh interval: $1\";'),('en','messages:smw-admin-supplementary-elastic-status-replication','s:21:\"en:Replication status\";'),('en','messages:smw-admin-supplementary-elastic-status-replication-monitoring','s:38:\"en:Replication monitoring (active): $1\";'),('en','messages:smw-admin-supplementary-elastic-title','s:16:\"en:Elasticsearch\";'),('en','messages:smw-admin-supplementary-elastic-version-info','s:10:\"en:Version\";'),('en','messages:smw-admin-supplementary-idlookup-intro','s:39:\"en:Supports a simple <u>$1</u> function\";'),('en','messages:smw-admin-supplementary-idlookup-short-title','s:29:\"en:entity lookup and disposal\";'),('en','messages:smw-admin-supplementary-idlookup-title','s:29:\"en:Entity lookup and disposal\";'),('en','messages:smw-admin-supplementary-operational-statistics-cache-intro','s:61:\"en:<u>$1</u> shows a selected set of cache related statistics\";'),('en','messages:smw-admin-supplementary-operational-statistics-cache-title','s:19:\"en:Cache statistics\";'),('en','messages:smw-admin-supplementary-operational-statistics-intro','s:40:\"en:Displays an extended set of <u>$1</u>\";'),('en','messages:smw-admin-supplementary-operational-statistics-short-title','s:25:\"en:operational statistics\";'),('en','messages:smw-admin-supplementary-operational-statistics-title','s:25:\"en:Operational statistics\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-explain','s:175:\"en:This section contains selected table statistics to help administrators and data curators to make informed decisions about that state of the back-end and the storage engine.\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-intro','s:51:\"en:Generates <u>$1</u> for a selected set of tables\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-legend','s:84:\"en:The legend describes some of the keys used for the table statistics and includes:\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-legend-blob-table','s:393:\"en:* <code>unique_terms_occurrence_in_percent</code> percentage of terms that are unique (a low percentage rate indicates that repetitive terms occupy the table content and index)\n* <code>rows.terms_occurrence.single_occurrence_total_count</code> number of terms that only appear once\n* <code>rows.terms_occurrence.multi_occurrence_total_count</code> number of terms that appear more than once\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-legend-general','s:65:\"en:* <code>total_row_count</code> total number of rows in a table\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-legend-id-table','s:690:\"en:* <code>last_id</code> last ID currently in use\n* <code>duplicate_count</code> number of duplicates found in the id_table (see also [[Special:SemanticMediaWiki/duplicate-lookup|Duplicate entities lookup]])\n* <code>rows.rev_count</code> number of rows that have a revision_id assigned indicating a direct wikipage link\n* <code>rows.smw_namespace_group_by_count</code> numbers of aggregated rows for namespaces used in the table\n* <code>rows.smw_proptable_hash.query_match_count</code> number of query subobjects with a corresponding table reference\n* <code>rows.smw_proptable_hash.query_null_count</code> number of query subobjects without a table reference (unlinked, floating reference)\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-short-title','s:19:\"en:table statistics\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-title','s:19:\"en:Table statistics\";'),('en','messages:smw-admin-supplementary-section-intro','s:336:\"en:This section provides additional functions beyond the scope of maintenance activities and it is possible that some functions which are listed (see the [https://www.semantic-mediawiki.org/wiki/Help:Special:SemanticMediaWiki/Supplementary_functions documentation]) are restricted or unavailable and therefore inaccessible on this wiki.\";'),('en','messages:smw-admin-supplementary-section-subtitle','s:27:\"en:Supported core functions\";'),('en','messages:smw-admin-supplementary-section-title','s:26:\"en:Supplementary functions\";'),('en','messages:smw-admin-supplementary-settings-intro','s:77:\"en:<u>$1</u> shows parameters that define the behaviour of Semantic MediaWiki\";'),('en','messages:smw-admin-supplementary-settings-title','s:29:\"en:Configuration and settings\";'),('en','messages:smw-admin-support','s:18:\"en:Getting support\";'),('en','messages:smw-admin-supportdocu','s:66:\"en:Various resources are provided to help you in case of problems:\";'),('en','messages:smw-admin-tab-alerts','s:9:\"en:Alerts\";'),('en','messages:smw-admin-tab-general','s:11:\"en:Overview\";'),('en','messages:smw-admin-tab-maintenance','s:14:\"en:Maintenance\";'),('en','messages:smw-admin-tab-notices','s:22:\"en:Deprecation notices\";'),('en','messages:smw-admin-tab-registry','s:11:\"en:Registry\";'),('en','messages:smw-admin-tab-supplement','s:26:\"en:Supplementary functions\";'),('en','messages:smw-api-invalid-parameters','s:27:\"en:Invalid parameters, \"$1\"\";'),('en','messages:smw-apihelp-smwtask-example-update','s:61:\"en:Example of running a update task for a particular subject:\";'),('en','messages:smw-ask-condition-change-info','s:127:\"en:The condition was altered and the search engine needs to rerun the query to produce results that match the new requirements.\";'),('en','messages:smw-ask-condition-input-assistance','s:203:\"en:[https://www.semantic-mediawiki.org/wiki/Help:Input_assistance Input assistance] is provided for the printout, sort, and condition field. The condition field requires to use one of following prefixes:\";'),('en','messages:smw-ask-condition-input-assistance-category','s:48:\"en:<code>c:</code> to fetch category suggestions\";'),('en','messages:smw-ask-condition-input-assistance-concept','s:49:\"en:<code>con:</code> to fetch concept suggestions\";'),('en','messages:smw-ask-condition-input-assistance-property','s:80:\"en:<code>p:</code> to fetch property suggestions (e.g. <code>[[p:Has ...</code>)\";'),('en','messages:smw-ask-debug','s:8:\"en:Debug\";'),('en','messages:smw-ask-debug-desc','s:36:\"en:Generates query debug information\";'),('en','messages:smw-ask-delete','s:9:\"en:Remove\";'),('en','messages:smw-ask-download-link-desc','s:40:\"en:Download queried results in $1 format\";'),('en','messages:smw-ask-empty','s:20:\"en:Clear all entries\";'),('en','messages:smw-ask-extra-other','s:8:\"en:Other\";'),('en','messages:smw-ask-extra-query-log','s:12:\"en:Query log\";'),('en','messages:smw-ask-format','s:9:\"en:Format\";'),('en','messages:smw-ask-format-change-info','s:123:\"en:The format was modified and it is required to execute the query again to match new parameters and visualization options.\";'),('en','messages:smw-ask-format-export-info','s:126:\"en:The selected format is an export format which has no visual representation therefore results are only provided as download.\";'),('en','messages:smw-ask-format-help-link','s:69:\"en:[https://www.semantic-mediawiki.org/wiki/Help:$1_format $1] format\";'),('en','messages:smw-ask-format-options','s:21:\"en:Format and options\";'),('en','messages:smw-ask-format-selection-help','s:36:\"en:Help with the selected format: $1\";'),('en','messages:smw-ask-help','s:548:\"en:This section contains some links to help explain how to use the <code>#ask</code> syntax.\n\n* [https://www.semantic-mediawiki.org/wiki/Help:Selecting_pages Selecting pages] describes how to select pages and build conditions\n\n* [https://www.semantic-mediawiki.org/wiki/Help:Search_operators Search operators] lists available search operators including those for range and wildcard queries\n\n* [https://www.semantic-mediawiki.org/wiki/Help:Displaying_information Displaying information] outlines the use of printout statements and formatting options\";'),('en','messages:smw-ask-input-assistance','s:19:\"en:Input assistance\";'),('en','messages:smw-ask-message-keyword-type','s:70:\"en:This search matches the <code><nowiki>$1</nowiki></code> condition.\";'),('en','messages:smw-ask-no-cache','s:22:\"en:Disable query cache\";'),('en','messages:smw-ask-no-cache-desc','s:30:\"en:Results without query cache\";'),('en','messages:smw-ask-options','s:10:\"en:Options\";'),('en','messages:smw-ask-options-sort','s:15:\"en:Sort options\";'),('en','messages:smw-ask-order-rand','s:9:\"en:Random\";'),('en','messages:smw-ask-otheroptions-collapsed-info','s:57:\"en:Please use the plus icon to view all available options\";'),('en','messages:smw-ask-otheroptions-info','s:124:\"en:This section contains options that alter printout statements. Parameter descriptions can be viewed by hovering over them.\";'),('en','messages:smw-ask-parameters','s:13:\"en:Parameters\";'),('en','messages:smw-ask-query-search-info','s:191:\"en:The query <code><nowiki>$1</nowiki></code> was answered by the {{PLURAL:$3|1=<code>$2</code> (from cache)|<code>$2</code> (from cache)|<code>$2</code>}} in $4 {{PLURAL:$4|second|seconds}}.\";'),('en','messages:smw-ask-result','s:9:\"en:Result\";'),('en','messages:smw-ask-search','s:9:\"en:Sear