to-update','s:102:\"en:Semantic MediaWiki has updated the protection status according to the \"Is edit protected\" property.\";'),('en','messages:smw-edit-protection-disabled','s:121:\"en:The edit protection has been disabled therefore \"$1\" cannot be used to protect entity pages from unauthorized editing.\";'),('en','messages:smw-edit-protection-enabled','s:38:\"en:Edit protected (Semantic MediaWiki)\";'),('en','messages:smw-editpage-annotation-disabled','s:239:\"en:This page is not enabled for semantic in-text annotations due to namespace restrictions. Details about how to enable the namespace can be found on the [https://www.semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),('en','messages:smw-editpage-annotation-enabled','s:562:\"en:This page supports semantic in-text annotations (e.g. <nowiki>\"[[Is specified as::World Heritage Site]]\"</nowiki>) to build structured and queryable content provided by Semantic MediaWiki. For a comprehensive description on how to use annotations or the #ask parser function, please have a look at the [https://www.semantic-mediawiki.org/wiki/Help:Getting_started getting started], [https://www.semantic-mediawiki.org/wiki/Help:In-text_annotation in-text annotation], or [https://www.semantic-mediawiki.org/wiki/Help:Inline_queries inline queries] help pages.\";'),('en','messages:smw-editpage-concept-annotation-enabled','s:192:\"en:This concept can be extended using the #concept parser function. For a description on how to use #concept, see the [https://www.semantic-mediawiki.org/wiki/Help:Concepts concept] help page.\";'),('en','messages:smw-editpage-property-annotation-disabled','s:262:\"en:This property cannot be extended with a datatype annotation (e.g. <nowiki>\"[[Has type::Page]]\"</nowiki>) as it is already predefined (see the [https://www.semantic-mediawiki.org/wiki/Help:Special_properties special properties] help page for more information).\";'),('en','messages:smw-editpage-property-annotation-enabled','s:475:\"en:This property can be extended using semantic annotations to specify a datatype (e.g. <nowiki>\"[[Has type::Page]]\"</nowiki>) or other supporting declarations (e.g. <nowiki>\"[[Subproperty of::dc:date]]\"</nowiki>). For a description on how to augment this page, see the [https://www.semantic-mediawiki.org/wiki/Help:Property_declaration declaration of a property] or the [https://www.semantic-mediawiki.org/wiki/Help:List_of_datatypes list of available data types] help page.\";'),('en','messages:smw-elastic-rebuildelasticindex-run-incomplete','s:355:\"en:The <code>ElasticStore</code> has been selected as [https://www.semantic-mediawiki.org/wiki/Help:smwgDefaultStore default store], yet the extension was unable to find any record that the <code>[https://www.semantic-mediawiki.org/wiki/Help:rebuildElasticIndex.php rebuildElasticIndex.php]</code> script was executed, please run the script as instructed.\";'),('en','messages:smw-entity-examiner-associated-revision-mismatch','s:11:\"en:Revision\";'),('en','messages:smw-entity-examiner-check','s:64:\"en:Running {{PLURAL:$1|an examiner|examiners}} in the background\";'),('en','messages:smw-entity-examiner-deferred-check-awaiting-response','s:71:\"en:The \"$1\" examiner is currently awaiting a response from the backend.\";'),('en','messages:smw-entity-examiner-deferred-constraint-error','s:13:\"en:Constraint\";'),('en','messages:smw-entity-examiner-deferred-elastic-replication','s:10:\"en:Elastic\";'),('en','messages:smw-entity-examiner-deferred-fake','s:7:\"en:Fake\";'),('en','messages:smw-entity-examiner-indicator','s:21:\"en:Entity issue panel\";'),('en','messages:smw-entity-examiner-indicator-suggestions','s:213:\"en:As part of the entity examination, the following {{PLURAL:$1|issue was|issues were}} found and it is suggested to carefully review {{PLURAL:$1|the issue|them}} and take appropriate {{PLURAL:$1|action|actions}}.\";'),('en','messages:smw-error','s:8:\"en:Error\";'),('en','messages:smw-es-replication-check','s:36:\"en:Replication check (Elasticsearch)\";'),('en','messages:smw-es-replication-error','s:34:\"en:Elasticsearch replication issue\";'),('en','messages:smw-es-replication-error-bad-request-exception','s:172:\"en:The Elasticsearch connection handler has thrown a bad request exception (\"400 conflict http error\") indicating a continuing issue during replication and search requests.\";'),('en','messages:smw-es-replication-error-divergent-date','s:124:\"en:The replication monitoring has found that for the \"$1\" article (ID: $2) the <b>modification date</b> shows a discrepancy.\";'),('en','messages:smw-es-replication-error-divergent-date-detail','s:67:\"en:Referenced modification date:\n* Elasticsearch: $1\n* Database: $2\";'),('en','messages:smw-es-replication-error-divergent-date-short','s:59:\"en:The following date information were used for comparison:\";'),('en','messages:smw-es-replication-error-divergent-revision','s:126:\"en:The replication monitoring has found that for the \"$1\" article (ID: $2) the <b>associated revision</b> shows a discrepancy.\";'),('en','messages:smw-es-replication-error-divergent-revision-detail','s:69:\"en:Referenced associated revision:\n* Elasticsearch: $1\n* Database: $2\";'),('en','messages:smw-es-replication-error-divergent-revision-short','s:67:\"en:The following associated revision data were used for comparison:\";'),('en','messages:smw-es-replication-error-file-ingest-missing-file-attachment','s:194:\"en:The replication monitoring has found that \"$1\" is missing a [[Property:File attachment|File attachment]] annotation indicating that the file ingest processor hasn\'t started or isn\'t finished.\";'),('en','messages:smw-es-replication-error-file-ingest-missing-file-attachment-suggestions','s:198:\"en:Please ensure that the [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore/File_ingestion file ingest] job is scheduled and executed before the annotation and file index is made available.\";'),('en','messages:smw-es-replication-error-maintenance-mode','s:300:\"en:The Elasticsearch replication is currently restricted because it operates in a [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore/Maintenance_mode <b>maintenance mode</b>], changes to entities and pages are <b>not</b> immediately visible and query results may contain outdated information.\";'),('en','messages:smw-es-replication-error-missing-id','s:109:\"en:The replication monitoring has found that article \"$1\" (ID: $2) is missing from the Elasticsearch backend.\";'),('en','messages:smw-es-replication-error-no-connection','s:130:\"en:The replication monitoring is unable to perform any checks since it cannot establish a connection to the Elasticsearch cluster.\";'),('en','messages:smw-es-replication-error-other-exception','s:70:\"en:The Elasticsearch connection handler has thrown an exception: \"$1\".\";'),('en','messages:smw-es-replication-error-suggestions','s:178:\"en:It is suggested to edit or purge the page to remove the discrepancy. If the issue remains then check the Elasticsearch cluster itself (allocator, exceptions, disk space etc.).\";'),('en','messages:smw-es-replication-error-suggestions-exception','s:128:\"en:Please check the logs for information about the status of Elasticsearch, their indices, and possible misconfiguration issues.\";'),('en','messages:smw-es-replication-error-suggestions-maintenance-mode','s:269:\"en:It is suggested to contact the wiki administrator to check whether an [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore/Index_rebuild index rebuild] is currently in progress or the <code>refresh_interval</code> hasn\'t been set to the expected default value.\";'),('en','messages:smw-es-replication-error-suggestions-no-connection','s:90:\"en:It is suggested to contact the wiki administrator and report the \"no connection\" issue.\";'),('en','messages:smw-es-replication-file-ingest-error','s:20:\"en:File ingest issue\";'),('en','messages:smw-es-replication-maintenance-mode','s:28:\"en:Elasticsearch maintenance\";'),('en','messages:smw-expand','s:9:\"en:Expand\";'),('en','messages:smw-extensionload-error-how-explain','s:404:\"en:To enable the extension and avoid issues with namespace declarations and pending configurations it is necessary to use <code>enableSemantics</code> which will ensure required variables are set before loading the extension via the <code>ExtensionRegistry</code>.\n\nPlease have a look at the [https://www.semantic-mediawiki.org/wiki/Help:EnableSemantics enableSemantics] help page for further assistance.\";'),('en','messages:smw-extensionload-error-how-title','s:27:\"en:How do I fix this error?\";'),('en','messages:smw-extensionload-error-why-explain','s:184:\"en:The extension was <b>not</b> loaded using <code>enableSemantics</code> and instead enabled by other means such as using <code>wfLoadExtension( \'SemanticMediaWiki\' )</code> directly.\";'),('en','messages:smw-extensionload-error-why-title','s:26:\"en:Why do I see this page?\";'),('en','messages:smw-facetedsearch-clear-filters','s:37:\"en:Clear {{PLURAL:$1|filter|filters}}\";'),('en','messages:smw-facetedsearch-explore-intro','s:42:\"en:Select a collection and start browsing.\";'),('en','messages:smw-facetedsearch-format-options','s:18:\"en:Display options\";'),('en','messages:smw-facetedsearch-format-table','s:8:\"en:Table\";'),('en','messages:smw-facetedsearch-input-filter-placeholder','s:12:\"en:Filter...\";'),('en','messages:smw-facetedsearch-intro-tab-explore','s:10:\"en:Explore\";'),('en','messages:smw-facetedsearch-intro-tab-search','s:9:\"en:Search\";'),('en','messages:smw-facetedsearch-intro-text','s:281:\"en:The [https://www.semantic-mediawiki.org/wiki/Faceted_search <b>Faceted Search</b>] of Semantic MediaWiki provides users with a simple interface to quickly narrow down query results from a condition with the help of faceted views created from dependent properties and categories.\";'),('en','messages:smw-facetedsearch-intro-tips','s:569:\"en:* Use <code>category:?</code>, <code>property:?</code>, or <code>concept:?</code> to find available categories, properties, or concepts to build a condition set\n* Use the #ask syntax to describe a condition (e.g. <code><nowiki>[[Category:Foo]]</nowiki></code>)\n* Use \"OR\", \"AND\", or other query expressions to create complex conditions\n* Expressions like <code>in:</code> or <code>phrase:</code> can be used for full-text matches or unstructured searches, if the selected [https://www.semantic-mediawiki.org/wiki/Query_engine query engine] supports those expressions\";'),('en','messages:smw-facetedsearch-no-filter-range','s:19:\"en:No filter range.\";'),('en','messages:smw-facetedsearch-no-filters','s:14:\"en:No filters.\";'),('en','messages:smw-facetedsearch-no-output','s:57:\"en:For the selected \"$1\" format, no output was available.\";'),('en','messages:smw-facetedsearch-order-options','s:16:\"en:Order options\";'),('en','messages:smw-facetedsearch-profile-label-default','s:18:\"en:Default profile\";'),('en','messages:smw-facetedsearch-profile-options','s:18:\"en:Profile options\";'),('en','messages:smw-facetedsearch-size-options','s:17:\"en:Paging options\";'),('en','messages:smw-factbox-attachments','s:14:\"en:Attachments\";'),('en','messages:smw-factbox-attachments-help','s:30:\"en:Shows available attachments\";'),('en','messages:smw-factbox-attachments-is-local','s:11:\"en:Is local\";'),('en','messages:smw-factbox-attachments-value-unknown','s:6:\"en:N/A\";'),('en','messages:smw-factbox-facts','s:8:\"en:Facts\";'),('en','messages:smw-factbox-facts-derived','s:16:\"en:Derived facts\";'),('en','messages:smw-factbox-facts-derived-help','s:95:\"en:Shows facts that have been derived from rules or with the help of other reasoning techniques\";'),('en','messages:smw-factbox-facts-help','s:62:\"en:Shows statements and facts that have been created by a user\";'),('en','messages:smw-factbox-head','s:22:\"en:... more about \"$1\"\";'),('en','messages:smw-fetching','s:14:\"en:Fetching...\";'),('en','messages:smw-filter','s:9:\"en:Filter\";'),('en','messages:smw-filter-count','s:15:\"en:Filter count\";'),('en','messages:smw-format-datatable-emptytable','s:29:\"en:No data available in table\";'),('en','messages:smw-format-datatable-first','s:8:\"en:First\";'),('en','messages:smw-format-datatable-info','s:46:\"en:Showing _START_ to _END_ of _TOTAL_ entries\";'),('en','messages:smw-format-datatable-infoempty','s:30:\"en:Showing 0 to 0 of 0 entries\";'),('en','messages:smw-format-datatable-infofiltered','s:38:\"en:(filtered from _MAX_ total entries)\";'),('en','messages:smw-format-datatable-infothousands','s:4:\"en:,\";'),('en','messages:smw-format-datatable-last','s:7:\"en:Last\";'),('en','messages:smw-format-datatable-lengthmenu','s:22:\"en:Show _MENU_ entries\";'),('en','messages:smw-format-datatable-loadingrecords','s:13:\"en:Loading...\";'),('en','messages:smw-format-datatable-next','s:7:\"en:Next\";'),('en','messages:smw-format-datatable-previous','s:11:\"en:Previous\";'),('en','messages:smw-format-datatable-processing','s:16:\"en:Processing...\";'),('en','messages:smw-format-datatable-search','s:10:\"en:Search:\";'),('en','messages:smw-format-datatable-sortascending','s:38:\"en:: activate to sort column ascending\";'),('en','messages:smw-format-datatable-sortdescending','s:39:\"en:: activate to sort column descending\";'),('en','messages:smw-format-datatable-toolbar-export','s:9:\"en:Export\";'),('en','messages:smw-format-datatable-zerorecords','s:28:\"en:No matching records found\";'),('en','messages:smw-format-list-field-label-separator','s:5:\"en:: \";'),('en','messages:smw-format-list-other-fields-close','s:4:\"en:)\";'),('en','messages:smw-format-list-other-fields-open','s:5:\"en: (\";'),('en','messages:smw-format-list-property-separator','s:5:\"en:, \";'),('en','messages:smw-format-list-separator','s:5:\"en:, \";'),('en','messages:smw-format-list-value-separator','s:5:\"en:, \";'),('en','messages:smw-help','s:7:\"en:Help\";'),('en','messages:smw-helplink','s:50:\"en:https://www.semantic-mediawiki.org/wiki/Help:$1\";'),('en','messages:smw-helplink-concepts','s:56:\"en:https://www.semantic-mediawiki.org/wiki/Help:Concepts\";'),('en','messages:smw-indicator-constraint-violation','s:39:\"en:{{PLURAL:$1|Constraint|Constraints}}\";'),('en','messages:smw-indicator-revision-mismatch','s:11:\"en:Revision\";'),('en','messages:smw-indicator-revision-mismatch-comment','s:194:\"en:A mismatch normally indicates that some process interrupted the storage operation in Semantic MediaWiki. It is recommended to review the server logs and look for exceptions or other failures.\";'),('en','messages:smw-indicator-revision-mismatch-error','s:238:\"en:The [https://www.semantic-mediawiki.org/wiki/Help:Associated_revision/Examiner associated revision] check found a mismatch between the revision referenced in MediaWiki and the one being associated in Semantic MediaWiki for this entity.\";'),('en','messages:smw-info-par-icon','s:44:\"en:Icon to show, either \"info\" or \"warning\".\";'),('en','messages:smw-info-par-message','s:22:\"en:Message to display.\";'),('en','messages:smw-install-incomplete-elasticstore-indexrebuild','s:355:\"en:The <code>ElasticStore</code> has been selected as [https://www.semantic-mediawiki.org/wiki/Help:smwgDefaultStore default store], yet the extension was unable to find any record that the <code>[https://www.semantic-mediawiki.org/wiki/Help:rebuildElasticIndex.php rebuildElasticIndex.php]</code> script was executed, please run the script as instructed.\";'),('en','messages:smw-install-incomplete-intro','s:351:\"en:There are $2 incomplete or [[Special:PendingTaskList|pending]] {{PLURAL:$2|task|tasks}} to finish {{PLURAL:$1|installation|upgrading}} of [https://www.semantic-mediawiki.org Semantic MediaWiki]. An administrator or user with sufficient rights can complete {{PLURAL:$2|it|these}}. This should be done before adding new data to avoid inconsistencies.\";'),('en','messages:smw-install-incomplete-intro-note','s:75:\"en:This message will disappear after all relevant tasks have been resolved.\";'),('en','messages:smw-install-incomplete-populate-hash-field','s:208:\"en:The <code>smw_hash</code> field population was skipped during the setup. The <code>[https://www.semantic-mediawiki.org/wiki/Help:populateHashField.php populateHashField.php]</code> script must be executed.\";'),('en','messages:smw-install-incomplete-tasks-title','s:34:\"en:Incomplete administration tasks\";'),('en','messages:smw-jsonview-collapse-title','s:26:\"en:Collapses the JSON view\";'),('en','messages:smw-jsonview-expand-title','s:24:\"en:Expands the JSON view\";'),('en','messages:smw-jsonview-search-label','s:10:\"en:Search:\";'),('en','messages:smw-label-feed-description','s:13:\"en:$1 $2 feed\";'),('en','messages:smw-label-feed-link','s:6:\"en:RSS\";'),('en','messages:smw-legend','s:9:\"en:Legend\";'),('en','messages:smw-limitreport-intext-parsertime','s:39:\"en:[SMW] In-text annotation parser time\";'),('en','messages:smw-limitreport-intext-parsertime-value','s:34:\"en:$1 {{PLURAL:$1|second|seconds}}\";'),('en','messages:smw-limitreport-intext-postproctime','s:29:\"en:[SMW] post processing time\";'),('en','messages:smw-limitreport-intext-postproctime-value','s:34:\"en:$1 {{PLURAL:$1|second|seconds}}\";'),('en','messages:smw-limitreport-pagepurge-storeupdatetime','s:42:\"en:[SMW] Store update time (on page purge)\";'),('en','messages:smw-limitreport-pagepurge-storeupdatetime-value','s:34:\"en:$1 {{PLURAL:$1|second|seconds}}\";'),('en','messages:smw-list-count','s:52:\"en:The list contains $1 {{PLURAL:$1|entry|entries}}.\";'),('en','messages:smw-listingcontinuesabbrev','s:8:\"en:cont.\";'),('en','messages:smw-livepreview-loading','s:13:\"en:Loading...\";'),('en','messages:smw-loading','s:13:\"en:Loading...\";'),('en','messages:smw-missingredirects-intro','s:420:\"en:The following section will list pages that are missing [https://www.semantic-mediawiki.org/wiki/Redirects redirect] annotations in Semantic MediaWiki (by comparing with information stored in MediaWiki) and to restore those annotations either manually [https://www.semantic-mediawiki.org/wiki/Help:Purge purge] the page or run the <code>rebuildData.php</code> maintenance script (with option <code>--redirects</code>).\";'),('en','messages:smw-missingredirects-list','s:33:\"en:Pages with missing annotations\";'),('en','messages:smw-missingredirects-list-intro','s:73:\"en:Showing $1 {{PLURAL:$1|page|pages}} with missing redirect annotations.\";'),('en','messages:smw-missingredirects-noresult','s:41:\"en:No missing redirect annotations found.\";'),('en','messages:smw-next','s:24:\"en:next {{PLURAL:$1|$1}}\";'),('en','messages:smw-no-data-available','s:21:\"en:No data available.\";'),('en','messages:smw-noscript','s:310:\"en:This page or action requires JavaScript to work. Please enable JavaScript in your browser or use a browser where it is supported, so that functionality can be provided as requested. For further assistance, please have a look at the [https://www.semantic-mediawiki.org/wiki/Help:Noscript noscript] help page.\";'),('en','messages:smw-page-indicator-usage-count','s:116:\"en:Estimated [https://www.semantic-mediawiki.org/wiki/Help:Property_usage_count usage count]: {{PLURAL:$2|\'\'\'$2\'\'\'}}\";'),('en','messages:smw-paramdesc-aggregation','s:51:\"en:Specify to what the aggregation should relate to\";'),('en','messages:smw-paramdesc-category-delim','s:16:\"en:The delimiter\";'),('en','messages:smw-paramdesc-category-template','s:38:\"en:A template to format the items with\";'),('en','messages:smw-paramdesc-category-userparam','s:38:\"en:A parameter to pass to the template\";'),('en','messages:smw-paramdesc-class','s:46:\"en:An additional CSS class to set for the list\";'),('en','messages:smw-paramdesc-columns','s:52:\"en:The number of columns in which to display results\";'),('en','messages:smw-paramdesc-csv-bom','s:75:\"en:Add a BOM (character to signal endianness) at the top of the output file\";'),('en','messages:smw-paramdesc-csv-merge','s:87:\"en:Merge rows and column values with an identical subject identifier (aka first column)\";'),('en','messages:smw-paramdesc-csv-sep','s:31:\"en:Specifies a column separator\";'),('en','messages:smw-paramdesc-csv-valuesep','s:30:\"en:Specifies a value separator\";'),('en','messages:smw-paramdesc-default','s:52:\"en:The text to display if there are no query results\";'),('en','messages:smw-paramdesc-distribution','s:77:\"en:Instead of displaying all values, count their occurrences, and show these.\";'),('en','messages:smw-paramdesc-distributionlimit','s:65:\"en:Limit the value distribution to the count of only some values.\";'),('en','messages:smw-paramdesc-distributionsort','s:51:\"en:Sort the value distribution by occurrence count.\";'),('en','messages:smw-paramdesc-dsv-filename','s:28:\"en:The name for the DSV file\";'),('en','messages:smw-paramdesc-dsv-separator','s:23:\"en:The separator to use\";'),('en','messages:smw-paramdesc-embedformat','s:39:\"en:The HTML tag used to define headings\";'),('en','messages:smw-paramdesc-embedonly','s:22:\"en:Display no headings\";'),('en','messages:smw-paramdesc-export','s:16:\"en:Export option\";'),('en','messages:smw-paramdesc-feeddescription','s:53:\"en:The text to be used as the description of the feed\";'),('en','messages:smw-paramdesc-feedpagecontent','s:45:\"en:Page content to be displayed with the feed\";'),('en','messages:smw-paramdesc-feedtitle','s:47:\"en:The text to be used as the title of the feed\";'),('en','messages:smw-paramdesc-feedtype','s:12:\"en:Feed type\";'),('en','messages:smw-paramdesc-filename','s:31:\"en:The name for the output file\";'),('en','messages:smw-paramdesc-headers','s:37:\"en:Display the headers/property names\";'),('en','messages:smw-paramdesc-import-annotation','s:77:\"en:Additional annotated data are to be copied during the parsing of a subject\";'),('en','messages:smw-paramdesc-intro','s:65:\"en:T