tro','s:149:\"en:This page provides information about tasks that have been classified as pending, incomplete, or outstanding in connection with Semantic MediaWiki.\";'),('en','messages:smw-pendingtasks-intro-empty','s:110:\"en:No tasks have been classified as pending, incomplete, or outstanding in connection with Semantic MediaWiki.\";'),('en','messages:smw-pendingtasks-setup-intro','s:332:\"en:The {{PLURAL:$1|installation|upgrade}} of <b>Semantic MediaWiki</b> has classified the following tasks as [https://www.semantic-mediawiki.org/wiki/Help:Upgrade/Incomplete_upgrade incomplete] and an administrator (or user with sufficient rights) is expected to resolve those tasks before users continue to create or alter content.\";'),('en','messages:smw-pendingtasks-setup-no-tasks-intro','s:105:\"en:The installation (or upgrade) has been completed, currently there are no pending or outstanding tasks.\";'),('en','messages:smw-pendingtasks-setup-tasks','s:8:\"en:Tasks\";'),('en','messages:smw-pendingtasks-tab-setup','s:8:\"en:Setup\";'),('en','messages:smw-personal-jobqueue-watchlist','s:22:\"en:Job queue watchlist\";'),('en','messages:smw-personal-jobqueue-watchlist-explain','s:78:\"en:The numbers indicate an estimation of job queue entries awaiting execution.\";'),('en','messages:smw-populatehashfield-incomplete','s:208:\"en:The <code>smw_hash</code> field population was skipped during the setup. The <code>[https://www.semantic-mediawiki.org/wiki/Help:populateHashField.php populateHashField.php]</code> script must be executed.\";'),('en','messages:smw-postproc-queryref','s:109:\"en:Semantic MediaWiki is refreshing the current page on the condition of some required query post processing.\";'),('en','messages:smw-prefs-ask-options-compact-view-basic','s:28:\"en:Enable basic compact view\";'),('en','messages:smw-prefs-ask-options-tooltip-display','s:100:\"en:Display parameter text as an info tooltip on the #ask [[Special:Ask|query builder]] special page.\";'),('en','messages:smw-