ual preferences for a group of selected features and functions. A list of individual settings with their description and characteristics is available on the following [https://www.semantic-mediawiki.org/wiki/Help:User_preferences help page].\";'),('en','messages:smw-preparing','s:15:\"en:Preparing...\";'),('en','messages:smw-prev','s:28:\"en:previous {{PLURAL:$1|$1}}\";'),('en','messages:smw-printername-feed','s:20:\"en:RSS and Atom feed\";'),('en','messages:smw-processing','s:16:\"en:Processing...\";'),('en','messages:smw-processingerrorlist-helplink','s:65:\"en:https://www.semantic-mediawiki.org/wiki/Help:Processing_errors\";'),('en','messages:smw-processingerrorlist-intro','s:314:\"en:The following list provides an overview about [https://www.semantic-mediawiki.org/wiki/Processing_errors processing errors] that appeared in connection with [https://www.semantic-mediawiki.org/ Semantic MediaWiki]. It is recommended to monitor this list on a regular basis and correct invalid value annotations.\";'),('en','messages:smw-property-indicator-last-count-update','s:41:\"en:Estimated usage count\nLast updated: $1\";'),('en','messages:smw-property-indicator-type-info','s:45:\"en:{{PLURAL:$1|User|System}} defined property\";'),('en','messages:smw-property-label-similarity-docu','s:625:\"en:This pages compares the [https://www.semantic-mediawiki.org/wiki/Property_similarity similarity distance] (not to be confused with a semantic or lexical similarity) between property labels and reports them if they exceed the threshold. The report may help filter misspelled or equivalent properties that represent the same concept (see the [[Special:Properties|properties]] special page to help clarify concept and usage of reported properties). The threshold can be adjusted to widen or narrow the distance used for the approximate matching. <code>[[Property:$1|$1]]</code> is used to exempt properties from the analysis.\";'),('en','messages:smw-property-label-similarity-intro','s:65:\"en:<u>$1</u> calculates similarities for existing property labels\";'),('en','messages:smw-property-label-similarity-noresult','s:50:\"en:No results were found for the selected options.\";'),('en','messages:smw-property-label-similarity-threshold','s:13:\"en:Threshold:\";'),('en','messages:smw-property-label-similarity-title','s:35:\"en:Property label similarity report\";'),('en','messages:smw-property-label-similarity-type','s:18:\"en:Display Type ID\";'),('en','messages:smw-property-label-uniqueness','s:202:\"en:The \"$1\" label was matched to at least one other property representation. Please consult the [https://www.semantic-mediawiki.org/wiki/Help:Property_uniqueness help page] on how to resolve this issue.\";'),('en','messages:smw-property-name-invalid','s:55:\"en:Property $1 can not be used (invalid property name).\";'),('en','messages:smw-property-name-reserved','s:218:\"en:\"$1\" was listed as reserved name and should not be used as a property. The following [https://www.semantic-mediawiki.org/wiki/Help:Property_naming help page] may contain information as to why this name was reserved.\";'),('en','messages:smw-property-namespace-disabled','s:225:\"en:The property [https://www.semantic-mediawiki.org/wiki/Help:$smwgNamespacesWithSemanticLinks namespace] is disabled, attempting to declare a type or other property specific characteristics for this property is not possible.\";'),('en','messages:smw-property-page-filter-note','s:563:\"en:The [https://www.semantic-mediawiki.org/wiki/Help:Property_page/Filter search filter] allows the inclusion of [https://www.semantic-mediawiki.org/wiki/Help:Query_expressions query expressions] such as <code>~</code> or <code>!</code>. The selected [https://www.semantic-mediawiki.org/wiki/Query_engine query engine] might also support case insensitive matching or other short expressions like:\n\n* <code>in:</code> result should include the term, e.g. \'<code>in:Foo</code>\'\n\n* <code>not:</code> result should to not include the term, e.g. \'<code>not:Bar</code>\'\";'),('en','messages:smw-property-page-list-count','s:59:\"en:Showing $1 {{PLURAL:$1|page|pages}} using this property.\";'),('en','messages:smw-property-page-list-search-count','s:83:\"en:Showing $1 {{PLURAL:$1|page|pages}} using this property with a \"$2\" value match.\";'),('en','messages:smw-property-predefined-ask','s:272:\"en:\"$1\" is a predefined property that represents meta information (in form of a [https://www.semantic-mediawiki.org/wiki/Subobject subobject]) about individual queries and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-askco','s:181:\"en:\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to describe the state of a query or its components.\";'),('en','messages:smw-property-predefined-askde','s:177:\"en:\"$1\" is a predefined property that informs about the depth of a query and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-askdu','s:224:\"en:\"$1\" is a predefined property containing a time value (in seconds) that was required to complete the query execution and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-askfo','s:194:\"en:\"$1\" is a predefined property that holds the name of the result format used in a query and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-askpa','s:189:\"en:\"$1\" is a predefined property describing parameters that influence a query result and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-asksc','s:197:\"en:\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] that identifies alternative (e.g. remote, federated) query sources.\";'),('en','messages:smw-property-predefined-asksi','s:192:\"en:\"$1\" is a predefined property that collects the number of conditions used in a query and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-askst','s:192:\"en:\"$1\" is a predefined property that describes the conditions of the query as a string and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-attch-link','s:197:\"en:\"$1\" is a predefined property that collects embedded file and image links found in a page and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-boo','s:193:\"en:\"$1\" is a [[Special:Types/Boolean|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent boolean values.\";'),('en','messages:smw-property-predefined-cdat','s:201:\"en:\"$1\" is a predefined property that corresponds to the date of the first revision of a subject and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-chgpro','s:242:\"en:\"$1\" is a predefined property to hold [https://www.semantic-mediawiki.org/wiki/Help:Change_propagation change propagation] information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-common','s:293:\"en:This property is pre-deployed (also known as [https://www.semantic-mediawiki.org/wiki/Help:Special_properties special property]) and comes with additional administrative privileges but can be used just like any other [https://www.semantic-mediawiki.org/wiki/Property user-defined property].\";'),('en','messages:smw-property-predefined-conc','s:179:\"en:\"$1\" is an internal predefined property to define an associated concept and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-constraint-schema','s:170:\"en:\"$1\" is a predefined property that defines a constraint schema and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-author','s:165:\"en:\"$1\" is a predefined property to store author information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-date','s:163:\"en:\"$1\" is a predefined property to store date information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-keyw','s:159:\"en:\"$1\" is a predefined property to represent keywords and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-lang','s:167:\"en:\"$1\" is a predefined property to store language information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-len','s:165:\"en:\"$1\" is a predefined property to store length information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-title','s:164:\"en:\"$1\" is a predefined property to store title information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-type','s:168:\"en:\"$1\" is a predefined property to store file type information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-conv','s:214:\"en:\"$1\" is a declarative predefined property to define conversion factor for some unit of a physical quantity and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-dat','s:187:\"en:\"$1\" is a [[Special:Types/Date|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent date values.\";'),('en','messages:smw-property-predefined-default','s:44:\"en:\"$1\" is a predefined property of type $2.\";'),('en','messages:smw-property-predefined-dtitle','s:191:\"en:\"$1\" is a predefined property that can assign a distinct display title to an entity and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-edip','s:178:\"en:\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to indicate whether editing is protected or not.\";'),('en','messages:smw-property-predefined-eid','s:211:\"en:\"$1\" is a [[Special:Types/External identifier|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent external identifiers.\";'),('en','messages:smw-property-predefined-err-type','s:253:\"en:\"$1\" is a predefined property to indentify a group or class of [https://www.semantic-mediawiki.org/wiki/Help:Processing_errors processing errors] and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-errc','s:232:\"en:\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] and represents errors that appeared in connection with improper value annotations or input processing.\";'),('en','messages:smw-property-predefined-errp','s:194:\"en:\"$1\" is a predefined property that tracks input errors for irregular value annotations and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-errt','s:182:\"en:\"$1\" is a predefined property containing a textual description of an error and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-file-attch','s:197:\"en:\"$1\" is a predefined property to represent a container that stores attachment information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-format-schema','s:108:\"en: and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-impo','s:254:\"en:\"$1\" is a predefined property that describes a relation to an [https://www.semantic-mediawiki.org/wiki/Help:Import_vocabulary imported vocabulary] and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-inst','s:205:\"en:\"$1\" is an internal predefined property that stores category information independent of MediaWiki and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-keyw','s:226:\"en:\"$1\" is a predefined property and [[Special:Types/Keyword|type]] provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] that normalizes a text and has a restricted character length.\";'),('en','messages:smw-property-predefined-label-skey','s:10:\"en:Sortkey\";'),('en','messages:smw-property-predefined-lcode','s:185:\"en:\"$1\" is a predefined property that represents a BCP47 formatted language code and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-ledt','s:207:\"en:\"$1\" is a predefined property that contains the page name of the user who created the last revision and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-list','s:227:\"en:\"$1\" is a predefined property to define a list of properties used with a [[Special:Types/Record|record]] typed property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-long-askco','s:168:\"en:The number or numbers assigned represent an internal codified state that is explained on the [https://www.semantic-mediawiki.org/wiki/Help:Query_profiler help page].\";'),('en','messages:smw-property-predefined-long-askde','s:290:\"en:It is a numerical value computed on the basis of subquery nesting, property chains, and available description elements with the execution of a query being restricted by the <code>[https://www.semantic-mediawiki.org/wiki/Help:$smwgQMaxDepth $smwgQMaxDepth]</code> configuration parameter.\";'),('en','messages:smw-property-predefined-long-askpa','s:135:\"en:It is part of a collection of properties that specify a [https://www.semantic-mediawiki.org/wiki/Help:Query_profiler query profile].\";'),('en','messages:smw-property-predefined-long-cont-author','s:275:\"en:It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store author information retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-cont-date','s:273:\"en:It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store date information retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-cont-keyw','s:265:\"en:It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store keywords retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-cont-lang','s:277:\"en:It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store language information retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-cont-len','s:275:\"en:It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store length information retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-cont-title','s:274:\"en:It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store title information retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-cont-type','s:273:\"en:It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store type information retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-edip','s:177:\"en:While any user is qualified to add this property to a subject, only a user with a dedicated permission can edit or revoke the protection to an entity after it has been added.\";'),('en','messages:smw-property-predefined-long-errc','s:169:\"en:Errors are collected in a [https://www.semantic-mediawiki.org/wiki/Help:Container container] that may include a reference to the property that caused the discrepancy.\";'),('en','messages:smw-property-predefined-long-errp','s:98:\"en:In most cases it is caused by a type mismatch or a [[Property:Allows value|value]] restriction.\";'),('en','messages:smw-property-predefined-long-file-attch','s:281:\"en:It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect all content specific information retrievable from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-pefu','s:177:\"en:The URI is expected to contain a placeholder that will be adjusted with an [[Special:Types/External identifier|external identifier]] value to form a valid resource reference.\";'),('en','messages:smw-property-predefined-long-pvuc','s:157:\"en:Uniqueness is established when two values are not equal in their literal representation and any violation of that constraint will be categorized as error.\";'),('en','messages:smw-property-predefined-long-schema-tag','s:74:\"en:A label that identifies schemata of similar content or characteristics.\";'),('en','messages:smw-property-predefined-long-schema-type','s:268:\"en:Each [https://www.semantic-mediawiki.org/wiki/Help:Schema/Type type] provides its own interpretation of syntax elements and application rules and can be expressed with the help of a [https://www.semantic-mediawiki.org/wiki/Help:Schema#validation validation schema].\";'),('en','messages:smw-property-predefined-long-sobj','s:183:\"en:The container allows to accumulate property-value assignments similar to that of a normal wiki page but within a different entity space while being linked to the embedding subject.\";'),('en','messages:smw-property-predefined-long-unit','s:89:\"en:A comma-separated list allows to describe units or formats to be used for the display.\";'),('en','messages:smw-property-predefined-mdat','s:204:\"en:\"$1\" is a predefined property that corresponds to the date of the last modification of a subject and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-media','s:187:\"en:\"$1\" is a predefined property that describes the media type of an uploaded file and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-mime','s:186:\"en:\"$1\" is a predefined property that describes the MIME type of an uploaded file and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-newp','s:184:\"en:\"$1\" is a predefined property that indicates whether a subject is new or not and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-num','s:192:\"en:\"$1\" is a [[Special:Types/Number|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent numeric values.\";'),('en','messages:smw-property-predefined-pdesc','s:197:\"en:\"$1\" is a predefined property that allows to describe a property in context of a language and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-pefu','s:181:\"en:\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to specify an external resource with a placeholder.\";'),('en','messages:smw-property-predefined-peid','s:175:\"en:\"$1\" is a predefined property that specifies an external identifier and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-ppgr','s:232:\"en:\"$1\" is a predefined property that identifies entities (mainly categories) that are used as grouping instance for properties and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-pplb','s:259:\"en:\"$1\" is a declarative predefined property to specify a [https://www.semantic-mediawiki.org/wiki/Help:Preferred_property_label preferred property label] and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-prec','s:175:\"en:\"$1\" is a predefined property that describes a [https://www.semantic-mediawiki.org/wiki/Help:Display_precision display precision] (in decimal digits) for numeric datatypes.\";'),('en','messages:smw-property-predefined-profile-schema','s:108:\"en: and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-pval','s:304:\"en:[https://www.semantic-mediawiki.org/wiki/Help:Special_property_Allows_value \"$1\"] is a predefined property that can define a list of permissible values to restrict value assignments for a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-pvali','s:333:\"en:[https://www.semantic-mediawiki.org/wiki/Help:Special_property_Allows_value_list \"$1\"] is a predefined property that can specify a reference to a list that holds permissible values to restrict value assignments for a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-pvap','s:295:\"en:\"$1\" is a predefined property that can specify a [[MediaWiki:Smw allows pattern|pattern reference]] to apply [https://en.wikipedia.org/wiki/Regular_expression regular expression] matching and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-pvuc','s:208:\"en:\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to restrict value assignments for each instance to be unique (or one at most).\";'),('en','messages:smw-property-predefined-qty','s:195:\"en:\"$1\" is a [[Special:Types/Quantity|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent quantity values.\";'),('en','messages:smw-property-predefined-redi','s:167:\"en:\"$1\" is an internal predefined property to record redirects and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-schema-def','s:168:\"en:\"$1\" is a predefined property that stores the schema content and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-schema-desc','s:170:\"en:\"$1\" is a predefined property that stores a schema description and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-schema-link','s:108:\"en: and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-schema-tag','s:167:\"en:\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to identify a collection of schemata.\";'),('en','messages:smw-property-predefined-schema-type','s:194:\"en:\"$1\" is a predefined property that describes a type to distinguish a group of schemata and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-serv','s:184:\"en:\"$1\" is a declarative predefined property to add service links to a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-skey','s:172:\"en:\"$1\" is an internal predefined property to hold a sort reference and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-sobj','s:229:\"en:\"$1\" is a predefined property representing a [https://www.semantic-mediawiki.org/wiki/Help:Container container] construct and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-subc','s:270:\"en:\"$1\" is a predefined property to define that a category is a [https://www.semantic-mediawiki.org/wiki/Help:Special_property_Subcategory_of subcategory of] another and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-subp','s:282:\"en:\"$1\" is a declarative predefined property to define that a property is a [https://www.semantic-mediawiki.org/wiki/Help:Special_property_Subproperty_of subproperty of] another and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-text','s:178:\"en:\"$1\" is a predefined property that represents text of arbitrary length and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-trans','s:108:\"en: and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-trans-group','s:108:\"en: and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-trans-source','s:108:\"en: and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-type','s:197:\"en:\"$1\" is a predefined property that describes the [[Special:Types|datatype]] of a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-unit','s:205:\"en:\"$1\" is a declarative predefined property to define units of display for numeric typed properties and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-uri','s:189:\"en:\"$1\" is a [[Special:Types/URL|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent URI/URL values.\";'),('en','messages:smw-property-preferred-label-language-combination-exists','s:106:\"en:\"$1\" cannot be used as preferred label because the language \"$2\" is already assigned to the \"$3\" label.\";'),('en','messages:smw-property-preferred-title-format','s:10:\"en:$1 ($2)\";'),('en','messages:smw-property-req-error-list','s:58:\"en:The property contains the following errors or warnings:\";'),('en','messages:smw-property-req-violation-change-propagation-locked-error','s:530:\"en:Property \"$1\" was altered and requires assigned entities to be reevaluated using a [https://www.semantic-mediawiki.org/wiki/Change_propagation change propagation] process. The property page has been locked until the primary specification update is completed to prevent intermediary interruptions or contradictory specifications. The process may take a moment before the page can be unlocked as it depends on the size and frequency of the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue job queue] scheduler.\";'),('en','messages:smw-property-req-violation-change-propagation-locked-warning','s:466:\"en:Property \"$1\" was altered and requires assigned entities to be reevaluated using a [https://www.semantic-mediawiki.org/wiki/Change_propagation change propagation] process. The update may take a moment as it depends on the size and frequency of the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue job queue] scheduler and it is suggested to postpone changes to the property to prevent intermediary interruptions or contradictory specifications.\";'),('en','messages:smw-property-req-violation-change-propagation-pending','s:380:\"en:[https://www.semantic-mediawiki.org/wiki/Change_propagation Change propagation] updates are pending ($1 [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue {{PLURAL:$1|job|jobs}}] estimated) and it is recommended to wait with modifications to a property until the process has been finalized to prevent intermediary interruptions or contradictory specifications.\";'),('en','messages:smw-property-req-violation-forced-removal-annotated-type','s:423:\"en:The [https://www.semantic-mediawiki.org/wiki/Help:Mandatory_parent_type_inheritance mandatory parent type inheritance] enforcement has been enabled, the annotate type for the \"$1\" property doesn\'t match its parent property \"$2\" type and has been altered to reflect that requirement. It is recommended to adjust the in-page type definition so that the error message and mandatory enforcement is removed for this property.\";'),('en','messages:smw-property-req-violation-import-type','s:225:\"en:A type declaration was detected that is incompatible with the predefined type of the imported \"$1\" vocabulary. In general, it is not necessary to declare a type because information are retrieved from the import definition.\";'),('en','messages:smw-property-req-violation-missing-fields','s:169:\"en:Property \"$1\" is missing a required [https://www.semantic-mediawiki.org/wiki/Help:Special_property_Has_fields <code>Has fields</code>] declaration for this \"$2\" type.\";'),('en','messages:smw-property-req-violation-missing-formatter-uri','s:141:\"en:Property \"$1\" is missing declaration details for the annotated type by failing to define the <code>External formatter URI</code> property.\";'),('en','messages:smw-property-req-violation-missing-maps-extension','s:258:\"en:Semantic MediaWiki was unable to detect the [https://www.semantic-mediawiki.org/wiki/Extension:Maps \"Maps\"] extension which is a prerequisite and as a consequence limits the functionality (i.e. unable to store or process geographic data) of this property.\";'),('en','messages:smw-property-req-violation-multiple-fields','s:210:\"en:Property \"$1\" contains multiple (therefore competing) [https://www.semantic-mediawiki.org/wiki/Help:Special_property_Has_fields <code>Has fields</code>] declarations, only one is expected for this \"$2\" type.\";'),('en','messages:smw-property-req-violation-parent-type','s:87:\"en:Property \"$1\" and the assigned parent property \"$2\" have different type annotations.\";'),('en','messages:smw-property-req-violation-predefined-type','s:133:\"en:Property \"$1\" as predefined property contains a \"$2\" type declaration that is incompatible with the default type of this property.\";'),('en','messages:smw-property-req-violation-type','s:167:\"en:The property contains competing type specifications which may result in invalid value annotations therefore it is expected that a user assigns one appropriate type.\";'),('en','messages:smw-property-reserved-category','s:11:\"en:Category\";'),('en','messages:smw-property-tab-constraint-schema','s:20:\"en:Constraint schema\";'),('en','messages:smw-property-tab-constraint-schema-title','s:29:\"en:Compiled constraint schema\";'),('en','messages:smw-property-tab-errors','s:23:\"en:Improper assignments\";'),('en','messages:smw-property-tab-profile-schema','s:17:\"en:Profile schema\";'),('en','messages:smw-property-tab-redirects','s:11:\"en:Synonyms\";'),('en','messages:smw-property-tab-specification','s:11:\"en:... more\";'),('en','messages:smw-property-tab-subproperties','s:16:\"en:Subproperties\";'),('en','messages:smw-property-tab-usage','s:8:\"en:Usage\";'),('en','messages:smw-property-userdefined-fixedtable','s:353:\"en:\"$1\" was configured as [https://www.semantic-mediawiki.org/wiki/Fixed_properties fixed property] and any modification to its [https://www.semantic-mediawiki.org/wiki/Type_declaration type declaration] requires to either run <code>setupStore.php</code> or to complete the special [[Special:SemanticMediaWiki|\"Database installation and upgrade\"]] task.\";'),('en','messages:smw-propertylist-count','s:52:\"en:Showing $1 related {{PLURAL:$1|entity|entities}}.\";'),('en','messages:smw-propertylist-count-more-available','s:73:\"en:Showing $1 related {{PLURAL:$1|entity|entities}} (more are available).\";'),('en','messages:smw-propertylist-count-with-restricted-note','s:112:\"en:Showing $1 related {{PLURAL:$1|entity|entities }} (more are available but the display is restricted to \"$2\").\";'),('en','messages:smw-propertylist-error-header','s:34:\"en:Pages with improper assignments\";'),('en','messages:smw-propertylist-redirect-header','s:11:\"en:Synonyms\";'),('en','messages:smw-propertylist-subproperty-header','s:16:\"en:Subproperties\";'),('en','me