n','messages:smw-schema-namespace-edit-protection-by-import-performer','s:206:\"en:This page was imported by a listed [https://www.semantic-mediawiki.org/wiki/Import_performer import performer]. This means that changing the content of this page is restricted to only those listed users.\";'),('en','messages:smw-schema-namespace-editcontentmodel-disallowed','s:118:\"en:Changing the content model of a [https://www.semantic-mediawiki.org/wiki/Help:Schema schema page] is not permitted.\";'),('en','messages:smw-schema-summary-title','s:10:\"en:Summary\";'),('en','messages:smw-schema-tag','s:25:\"en:{{PLURAL:$1|Tag|Tags}}\";'),('en','messages:smw-schema-title','s:9:\"en:Schema\";'),('en','messages:smw-schema-type','s:14:\"en:Schema type\";'),('en','messages:smw-schema-type-description','s:19:\"en:Type description\";'),('en','messages:smw-schema-type-help-link','s:62:\"en:https://www.semantic-mediawiki.org/wiki/Help:Schema/Type/$1\";'),('en','messages:smw-schema-usage','s:8:\"en:Usage\";'),('en','messages:smw-schema-validation-error','s:148:\"en:The \"$1\" type is not registered and cannot be used for content in the [https://www.semantic-mediawiki.org/wiki/Help:Schema smw/schema] namespace.\";'),('en','messages:smw-schema-validation-schema-title','s:14:\"en:JSON schema\";'),('en','messages:smw-search-help-ask','s:373:\"en:The following links will explain how to use the <code>#ask</code> syntax.\n\n* [https://www.semantic-mediawiki.org/wiki/Help:Selecting_pages Selecting pages] describes how to select pages and build conditions\n\n* [https://www.semantic-mediawiki.org/wiki/Help:Search_operators Search operators] lists available search operators including those for range and wildcard queries\";'),('en','messages:smw-search-help-input-assistance','s:362:\"en:[https://www.semantic-mediawiki.org/wiki/Help:Input_assistance Input assistance] is provided for the input field and requires to use one of following prefixes:\n\n* <code>p:</code> to enable property suggestions (e.g. <code><nowiki>[[p:Has ...</nowiki></code>)\n\n* <code>c:</code> to enable category suggestions\n\n* <code>con:</code> to enable concept suggestions\";'),('en','messages:smw-search-help-intro','s:320:\"en:A <code><nowiki>[[ ... ]]</nowiki></code> input will signal to the input processor to use the Semantic MediaWiki search back-end. It should be noted that combining <code><nowiki>[[ ... ]]</nowiki></code> with an unstructured text search such as <code><nowiki>[[ ... ]] OR Lorem ipsum</nowiki></code> is not supported.\";'),('en','messages:smw-search-help-proximity','s:348:\"en:Proximity searches (a property being unknown, \'\'\'only\'\'\' available for those back-ends that provide a full-text search integration):\n\n* <code><nowiki>[[in:lorem ipsum]]</nowiki></code> (search in all documents for \"lorem\" and \"ipsum\" that have been indexed)\n\n* <code><nowiki>[[phrase:lorem ipsum]]</nowiki></code> (match \"lorem ipsum\" as phrase)\";'),('en','messages:smw-search-help-structured','s:370:\"en:Structured searches:\n\n* <code><nowiki>[[Category:Lorem ipsum]]</nowiki></code>, <code><nowiki>[[Has number::123]]</nowiki></code> (as [https://www.semantic-mediawiki.org/wiki/Help:Search#Filter_context filtered context])\n\n* <code><nowiki>[[Has text::~*lorem*]]</nowiki></code> (with a [https://www.semantic-mediawiki.org/wiki/Help:Search#Query_context query context])\";'),('en','messages:smw-search-hide','s:7:\"en:Hide\";'),('en','messages:smw-search-input','s:19:\"en:Input and search\";'),('en','messages:smw-search-input-assistance','s:168:\"en:The [https://www.semantic-mediawiki.org/wiki/Help:Input_assistance input assistant] is also enabled to ease the pre-selection of available properties and categories.\";'),('en','messages:smw-search-placeholder','s:12:\"en:Search...\";'),('en','messages:smw-search-profile','s:11:\"en:Extended\";'),('en','messages:smw-search-profile-extended-help-find-forms','s:18:\"en:available forms\";'),('en','messages:smw-search-profile-extended-help-form','s:216:\"en:Forms are provided (if maintained) to match specific use cases by exposing different property and value fields to narrow down the input process and make it easy for users to proceed with a search request. (see $1)\";'),('en','messages:smw-search-profile-extended-help-intro','s:212:\"en:The Special:Search [https://www.semantic-mediawiki.org/wiki/Help:SMWSearch/Extended_profile extended profile] provides access to search functions specific to Semantic MediaWiki and its supported query backend.\";'),('en','messages:smw-search-profile-extended-help-namespace','s:140:\"en:The namespace selection box will be hidden as soon as a form is selected but can be made visible with the help of the \"show/hide\" button.\";'),('en','messages:smw-search-profile-extended-help-query','s:50:\"en:Used <code><nowiki>$1</nowiki></code> as query.\";'),('en','messages:smw-search-profile-extended-help-query-link','s:39:\"en:For more details, please use the $1.\";'),('en','messages:smw-search-profile-extended-help-search-syntax','s:158:\"en:The search input field supports the use of the <code>#ask</code> syntax to define a Semantic MediaWiki specific search context. Useful expressions include:\";'),('en','messages:smw-search-profile-extended-help-search-syntax-note','s:119:\"en:\'\'Some of the listed operations are only useful in connection with an enabled full-text index or the ElasticStore.\'\'\";'),('en','messages:smw-search-profile-extended-help-search-syntax-prefix','s:69:\"en:* Additional custom prefixes are available and defined such as: $1\";'),('en','messages:smw-search-profile-extended-help-search-syntax-reserved','s:63:\"en:* Some expressions are reserved such as: <nowiki>$1</nowiki>\";'),('en','messages:smw-search-profile-extended-help-search-syntax-simplified-has','s:173:\"en:* <code>has:</code> to match any entity with a property \"...\" (e.g. <code>has:(Foo && Bar)</code> is equivalent to <code><nowiki>[[Foo::+]] && [[Bar::+]]</nowiki></code>)\";'),('en','messages:smw-search-profile-extended-help-search-syntax-simplified-in','s:261:\"en:* <code>in:</code> to find anything that contains \"...\" and is especially useful when the search context or properties involved are unknown (e.g. <code>in:(lorem && ipsum)</code> is equivalent to <code><nowiki>[[~~*lorem*]] && [[~~*ipsum*]]</nowiki></code>).\";'),('en','messages:smw-search-profile-extended-help-search-syntax-simplified-not','s:66:\"en:* <code>not:</code> to not match any entity that includes \"...\"\";'),('en','messages:smw-search-profile-extended-help-search-syntax-simplified-phrase','s:86:\"en:* <code>phrase:</code> to find anything that contains \"...\" in the exact same order\";'),('en','messages:smw-search-profile-extended-help-sort','s:62:\"en:Specifies a sorting preference for the result display with:\";'),('en','messages:smw-search-profile-extended-help-sort-best','s:159:\"en:* \"Best match\" will sort entities by [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore/Relevancy relevancy] based on scores provided by the backend\";'),('en','messages:smw-search-profile-extended-help-sort-recent','s:200:\"en:* \"Most recent\" will show the most recent modified entities first (subobject entities will be suppressed as those entities are not annotated with a [[Property:Modification date|Modification date]])\";'),('en','messages:smw-search-profile-extended-help-sort-title','s:69:\"en:* \"Title\" using the page title (or display title) as sort criteria\";'),('en','messages:smw-search-profile-extended-section-form','s:8:\"en:Forms\";'),('en','messages:smw-search-profile-extended-section-namespace','s:12:\"en:Namespace\";'),('en','messages:smw-search-profile-extended-section-query','s:8:\"en:Query\";'),('en','messages:smw-search-profile-extended-section-search-syntax','s:15:\"en:Search input\";'),('en','messages:smw-search-profile-extended-section-sort','s:10:\"en:Sort by\";'),('en','messages:smw-search-profile-link-caption-query','s:16:\"en:query builder\";'),('en','messag