unctions can access the content of this field.\";'),('en','messages:smw-upgrade-error','s:183:\"en:[https://www.semantic-mediawiki.org/ Semantic MediaWiki] was installed and enabled but is missing an appropriate [https://www.semantic-mediawiki.org/wiki/Help:Upgrade upgrade key].\";'),('en','messages:smw-upgrade-error-how-explain-admin','s:293:\"en:An administrator (or any person with administrator rights) has to run either MediaWiki\'s [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Update.php update.php] or Semantic MediaWiki\'s [https://www.semantic-mediawiki.org/wiki/Help:SetupStore.php setupStore.php] maintenance script.\";'),('en','messages:smw-upgrade-error-how-explain-links','s:259:\"en:You may also consult the following pages for further assistance:\n* [https://www.semantic-mediawiki.org/wiki/Help:Installation Installation] instructions\n* [https://www.semantic-mediawiki.org/wiki/Help:Installation/Troubleshooting Troubleshooting] help page\";'),('en','messages:smw-upgrade-error-how-title','s:27:\"en:How do I fix this error?\";'),('en','messages:smw-upgrade-error-title','s:30:\"en:Error  Semantic MediaWiki\";'),('en','messages:smw-upgrade-error-why-explain','s:389:\"en:Semantic MediaWiki\'s internal database structure has changed and requires some adjustments to be fully functional. There can be several reasons including:\n* Additional fixed properties (requires additional table setup) were added\n* An upgrade contains some changes to tables or indices making an interception obligatory before accessing the data\n* Changes to the storage or query engine\";'),('en','messages:smw-upgrade-error-why-title','s:26:\"en:Why do I see this page?\";'),('en','messages:smw-upgrade-maintenance-explain','s:401:\"en:The extension tries to minimize the impact and downtime by deferring most of its maintenance tasks to after the <code>update.php</code> but some database related changes are required to finish first to avoid data inconsistencies. It can include:\n* Changing table structures such as adding new or modify existing fields\n* Changing or adding table indices\n* Running table optimizations (when enabled)\";'),('en','messages:smw-upgrade-maintenance-note','s:342:\"en:The system is currently undergoing an [https://www.semantic-mediawiki.org/wiki/Help:Upgrade upgrade] of the [https://www.semantic-mediawiki.org/ Semantic MediaWiki] extension together with its data repository and we would like to ask you for your patience and allow the maintenance to continue before the wiki can be made accessible again.\";'),('en','messages:smw-upgrade-maintenance-title','s:36:\"en:Maintenance  Semantic MediaWiki\";'),('en','messages:smw-upgrade-maintenance-why-title','s:26:\"en:Why do I see this page?\";'),('en','messages:smw-upgrade-progress','s:11:\"en:Progress\";'),('en','messages:smw-upgrade-progress-create-tables','s:47:\"en:Creating (or updating) tables and indices...\";'),('en','messages:smw-upgrade-progress-explain','s:300:\"en:An estimation as to when the upgrade is going to be finished is difficult to predict as it depends on the size of the data repository and the available hardware and can take a moment for larger wikis to complete.\n\nPlease contact your local administrator to get more information about the progress.\";'),('en','messages:smw-upgrade-progress-post-creation','s:33:\"en:Running post creation tasks...\";'),('en','messages:smw-upgrade-progress-supplement-jobs','s:28:\"en:Adding supplement jobs...\";'),('en','messages:smw-upgrade-progress-table-optimization','s:33:\"en:Running table optimizations...\";'),('en','messages:smw-upgrade-release','s:10:\"en:Release\";'),('en','messages:smw-wantedproperties-docu','s:292:\"en:This page lists [https://www.semantic-mediawiki.org/wiki/Wanted_properties wanted properties] that are used in the wiki but do not have a page describing them. For a differentiated view, see the [[Special:Properties|entire]] or [[Special:UnusedProperties|unused properties]] special pages.\";'),('en','m